INSERT INTO `product` (`id`, `name`, `available_stock`, `price`, `desc`, `featured`, `created_at`) VALUES
(1, 'Biomutant', 123, 37.49, 'Biomutant for PC is an open world, post-apocalyptic, dystopian, action role-playing game in which there is a strong emphasis on martial arts. The combat scenes are a glorious mixture of martial arts, gun play and specific and specialised mutant ability. Player point of view is from the third person vantage point.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nThe world is under threat from a natural disaster which has caused poisonous oil to seep up from the ground, tainting the Tree of Life which has five roots. These roots provide life to the whole world, and the player’s job is to travel to the far end of each root where they will find a creature gnawing on the root. This, along with the deadly oil, is what is presenting such a big threat to the world.<br>\r\n<br>\r\nThere are six tribes in this dystopian world, and three of them have the same idea as the player: to stop the creature and the oil and heal the tree, while the other three tribes have their own, more selfish, plans about what to do next. The player can influence each tribe to a certain extent, using the Karma system.<br>\r\n<br>\r\nThe player can also ally themselves more definitively with one of the tribes, helping them to eliminate their rivals so their tribe’s power and prestige grows accordingly.<br>\r\n<br>\r\nHowever, the player can successfully play through the game – and achieve his or her goals – without needing to murder any tribes in order to do so, so you can play according to your own morality system if you want to.<br>\r\n<br>\r\n<h3>Letting the Cat Out of the Bag</h3><br>\r\nPerhaps the most fun thing about this game is your playing character. You are not a buff fighting man, a slender sylph-like yet ferocious babe, nor a grey-haired mage oozing wisdom from every pore. Nope. You are a cat. And not just any cat, you are a sentient, intelligent, feisty, action-inclined cat that will kick some serious enemy booty when given half a chance!<br>\r\n<br>\r\nYour first act when you begin the game is to carefully and very comprehensively customise your character. You can choose your gender, your length and overall size, the length of your fangs and your fur and a whole host of other attributes: all can be precisely designed to suit your own preferences. These choices will affect game play, so a heavier cat will not be able to move so fast – but they will be able to resist enemy actions more readily. Choose wisely!<br>\r\n<br>\r\nYour character will readily pick up new abilities thanks to the mutations floating about. Sometimes simply being in the proximity of an area will be enough to give you new powers, so keep an ear on what the pleasant vaguely British accented narrator is saying to see if there is anything you need to know while travelling.<br>\r\n<br>\r\n<h3>Fighting Skills</h3><br>\r\n<li>Weapons have ‘affixes’ which can be electric or cryogenic. Cryogenic attachments will, of course, freeze your enemies when they are hit</li><br>\r\n<li>Players can quickly switch between weapons during combat, so if you seem to be losing you can swap out your weapon for a more powerful, or even just a different one</li><br>\r\n<li>Use level-up points to increase your powers and abilities and to unlock new attack combinations as well as for the usual purpose of levelling up your character</li><br>\r\n<li>Robotic legs, wings and claws can all be attached to give your cat even more of a fighting chance</li><br>\r\n<li>Try to interact with NPCs (non-playing characters) in every area: they will teach you new fighting moves as well as telling you the next part of the story arc so you can continue your mission</li>', 1, '2021-05-27 22:00:00'),
(2, 'Cyberpunk 2077', 7, 23.98, 'Cyberpunk 2077 for PC is a first-person shooter game, but one with a difference. Set in a dystopian Free State of California, the rules of the nation and the state no longer apply. Instead, playing as a mercenary named V, the player must work their way around the city, attaining their goals and battling enemies as they go.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nSeven years in the making, Cyberpunk 2077 looks to be living up to all the hype generated by its introduction at E3 in 2019. <br>\r\n<br>\r\nSet fifty-seven years after the table-top game upon which it is based, Cyberpunk 2020, the graphics are exquisitely rendered with characters, scenery and even actions and movements so realistic that they could be mistaken for movie footage.<br>\r\n<br>\r\nAs you play through the narrative driven game, it is possible to play without killing any other characters, using non-lethal weaponry and strategies that keep you out of serious confrontations of the sort that tend to become lethal.<br>\r\n<br>\r\nThe game features full nudity, as players are able to upgrade their bodies with modifications that give them extra powers and capabilities, and they need to strip down in order to fit their new limbs and attachments. <br>\r\n<br>\r\n<h2>New Details</h2><br>\r\nOne of the biggest unique selling points of this game is the fact that Keanu Reeves is heavily featured in the game. He plays a character called Johnny Silverhand, who is the lead singer from a band, Samurai, whose songs contain lyrics relevant to V’s state of mind and his life.<br>\r\n<br>\r\nSilverhand, an original character from the table-top game, is dead in this time, but ‘lives’ in V’s head. This means that the character has more lines of dialogue than any other character save V, who is the protagonist.<br>\r\n<br>\r\nReeves was a surprise unveiling when the third trailer dropped, and gave the release date to excited fans, keen to get to grips with the latest offering from CD PROJEKT RED, famous for giving us the beloved Witcher games.<br>\r\n<br>\r\n<h2>Ways to Play</h2><br>\r\n<li>Skills: You can play your way through the game, relishing the agility that V has on his or her feet (the character is fully customisable as to clothing, gender, size and so much more), racking up a high kill rate as you dodge from behind walls or vehicles to take down your enemies as quickly and accurately as you can.</li><br>\r\n<li>Smart Rifle: Using the Smart Rifle is a good way to target your enemy. Simply lock on to their avatar, then send a bullet after them. The bullet will pursue the character until it catches up with them. An efficient way to rid yourself of nuisances while getting on with the rest of your mission.</li><br>\r\n<li>No Kill: There is no moral code on the game, meaning that you can storm through the game killing anyone and everyone who annoys you if that is the way that you like to play. However, there is no need to kill anyone at all. Challenge yourself to work through the game in a non-violent way, trading and dealing with non-playing characters (known as NPCs). </li><br>\r\nNPCs are important to the game – take Johnny Silverhand as a case in point – and you can interact with them, befriending and even marrying them. Therefore, the no-kill play method can open up a whole new world for you, introducing you to characters and their backstories in a way that you will not experience should you simply blast them out of your way.<br>\r\n<br>\r\n<h2>Endgame</h2><br>\r\nThere is no fixed aim for the game. Instead V must travel around the city, working to find health points and mods, avoiding or killing villains and generally just living their best life. Think of it as a world away from the real world: somewhere that you can be someone a little different.<br>\r\n<br>', 1, '2021-05-27 22:00:00'),
(3, 'Hitman 3', 353, 32.98, 'Hitman 3 for PC is the eighth in the Hitman series and the final episode in the nicely rounded World of Assassination trilogy, which consists of Hitman, Hitman 2 and now Hitman 3. The trilogy follows a narrative arc which is concluded in this game by playing the single player mode. In this game, the genetically engineered hitman, Agent 47, is tasked with finding and eliminating the leaders of the secretive cabal, Providence, that is controlling world-wide affairs. <br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nThe game is a third person stealth game, like the others in the series, and once again, the player takes on control of Agent 47, who must travel the world, completing missions as he works towards his ultimate targets. <br>\r\n<br>\r\nAs always, the storyline is absorbing, as are the diverse locations (see below for details), and there is plenty of action, adventure, betrayal and extremes of loyalty to keep you engaged and invested in getting Agent 47 to the bottom of who is behind the mysterious contracts he keeps receiving. <br>\r\n<br>\r\nThe missions are engaging and you have a huge choice of methods of murder, from posing as a waiter and serving your target some poisoned wine, or luring them into out of the way area so you can do your thing. Replaying levels allows you to try different modes and methods, which is both satisfying rewarding but also fun to see just how lethal Agent 47 can be with something as mundane as a piece of fruit! <br>\r\n<br>\r\nThis boosts your experience and gains you valuable rewards, as well as increasing your overall play time, so there is literally nothing to lose by doing so. Agent 47, in this game, has a camera tool that helps him to spy on people in other rooms, hack into places where he is not meant to be and generally offer him a handy helping hand whenever he needs it. <br>\r\n<br>\r\nPasscodes must be entered manually, in this game, rather than having it happen automatically as in other games, and the access codes to everything tend to be hidden somewhere nearby, so Agent 47 must carefully and thoroughly examine the surroundings &#8211; and do it without losing his stealthiness!<br>\r\n<br>\r\n<h3>Some Extra Details</h3><br>\r\nThe visuals are amazing especially as regarding the light engine which works at optimum throughout the game, producing glorious sunrises and sunsets, but also authentic neon streetlighting, disco strobes and more. Scenes that would compelling and attractive anyway are somehow rendered even more so!<br>\r\n<br>\r\nAs far as modes of play are concerned, multiplayer mode is completely gone from this incarnation, Sniper Assassin is now single-player only, and Ghost Mode is now itself a ghost, having vanished entirely. <br>\r\n<br>\r\nHowever, players can import maps, levels and progress into this game from its predecessor. For those ongoing fans of the series, there are plenty of nods to the other games in the series, with predecessors to people previously assassinated popping up as NPCs and provided fascinating snippets of gossip to eavesdrop upon as you stealth your way through the gatherings of the rich and famous &#8211; and usually villainously vile! <br>\r\n<br>\r\nAny game with a basic premise about killing people could go dark, or it could go cheesy &#8211; and Hitman 3 has picked the latter option, making it a satisfyingly gory kill-fest that nevertheless never tips over into uncontrollable homicidal rage thanks to the quirky moments that provide a strong undercurrent of dark humour. <br>\r\n<br>\r\nThe sprawling sandbox setting gives you lots of latitude to wander off exploring and having mini-adventures and side quests, before getting back on track and hunting down your current target. Take your bald bar-coded assassin through mini-games like Elusive Target in which you get one chance to take out the target: you miss and they&#8217;re gone forever, get them and you get a nifty reward. <br>\r\n<br>\r\nEscalations add degrees of challenge to the hitman making missions more challenging and more fun. In Contracts you design a hit yourself, and after you&#8217;ve completed it, it goes live for other players to try out. You will need a permanent online connection to play the game. You can play offline, but your progress and rewards will not be retained.<br>\r\n<br>\r\n<h3>Worldwide Hits!</h3><br>\r\nIn this game, there are six new locations, all as beautiful and diverse as you might expect. They are: <br>\r\n<br>\r\n<li>Dubai &#8211; the capital city of the emirate with the same name in the UAE, known for many amazing architectural and engineering wonders, as well as being home to a large indoor ski slope, despite regular outdoor temps of 40&#176;C!</li><br>\r\n<li>Dartmoor &#8211; a wild scrubby moorland in England, best known for its ponies, having a prison on it &#8211; much written about in literature including by literary heavyweights like Charles Dickens, being the home of the Hound of the Baskervilles, and the site of the Quidditch World Cup in Harry Potter and the Goblet of Fire! In this location, Agent 47 is going to attend a party in a mansion on the blasted moor, but it&#8217;s a party with a difference, as you will discover!</li><br>\r\n<li>Berlin &#8211; Germany&#8217;s capital city, where the player is largely on his own, working out who to kill &#8211; and avoid being killed by in turn &#8211; and maintaining that all important secrecy as he works &#8211; easy to say, not so easy to do!</li><br>\r\n<li>Mendoza &#8211; a stunningly beautiful province of Argentina, but needless to say, Agent 47 is not there for the beef, the wine or the exquisite views&#8230;</li><br>\r\n<li>Chongqing &#8211; a megacity in the southwest of China famed for its spicy food, romantic river views and beautiful settings. It also does rather well in the new technology department </li><br>\r\n<li>Romania&#8217;s Carpathian Mountains are famed as the setting for Bram Stoker&#8217;s Dracula, as well as being a large and formidable mountain range. The area is full of sturdy and utterly beautiful castles and strongholds, making it the perfect location for the finale</li>', 0, '2021-05-27 22:00:00'),
(4, 'Assassins Creed Valhalla', 54, 34.78, 'Assassin’s Creed Valhalla for PC is the 12th instalment of the Assassin’s Creed games, and this one takes place in the 9th century (beginning in 873AD) carrying you across Europe as you move your clan from a seriously overcrowded and war torn Norway to England, a green land of peace, prosperity and fertile fields in which to raise your crops. The UK might have a reputation as being a chilly and rainy place, but compared to near arctic desolation, it is not too bad a substiture! It is an open world action adventure game.<br>\r\n<br>\r\n<h2>What To Do?</h2><br>\r\nSiblings Eivor and Sigurd are the leaders of their intrepid band of Vikings and you play as Eivor, who can be male or female, as you choose. Do not worry about your gender, though, as you can change it on the fly, even in the heat of battle if you suddenly fancy a change.<br>\r\n<br>\r\nIf combat is not your thing, there is still plenty to do in the game. Visit the stable to buy horses, pop into the fishing hut before hitting the streams and lakes, and keep your equipment up to date in the hunting hut. There is even an aviary where you can customise your ravens with such details as white flashes on their wings. As an added bonus, your fishing catch or hunting successes can be sold in exchange for various rewards or as in-game currency. Being a Viking, you will, of course, want to keep your access to the sea in good nick, and there is a shipyard where you can repair, maintain, build and replace your longboat.<br>\r\n<br>\r\nYou will be busy at first, learning skills and crafting new items, even as you plant and raise crops, and enjoy occasional battles as raiders try and take what you have got. Establishing a bakery, cattle farm and brewery ensures that you and your clan are all well-fed, while Gunnar, the blacksmith, forges you some quite amazing weapons!<br>\r\n<br>\r\nThe map-maker, or cartographer, is well worth keeping sweet as they can offer you special maps, from time to time, which can point you in profitable raiding directions – well worth the investment of a little friendship and a few gold coins. <br>\r\n<br>\r\nWhen you do decide to go on a raid, you can hand-pick your warriors from a handful of presets – all of whom can be customised slightly into a cohesive team. But it is not all battling – you can attend weddings of tribesmen, get far too drink and end up with a terrible and well-deserved hangover after rap battles that your character will be very happy to consign to the dustbin of their memory! <br>\r\n<br>\r\n<h3>Doesn’t Sound Very Assassin-Oriented?</h3><br>\r\nAlongside mere living and survival, there are subplots in which the eternal battle between the Hidden Ones and the Order of Ancients imposes upon you the need to choose a side, usually the former. In between harvests, fishing, hunting and battling, you will find time to slip away, alone, with a companion or even with your entire band, to try and assassinate judiciously, aiming to restore the advantage to the Hidden Ones.<br>\r\n<br>\r\nYou are aided in all your endeavours by three skill trees:<br>\r\n<br>\r\n<li>Wolf stands for agility</li><br>\r\n<li>Raven means stealth</li> <br>\r\n<li>Bear, on the other hand, values brute strength</li><br>\r\nBoost your buffs, gear and skills as much as you can as you play through, even if you think it might be overkill: the bosses can be exceedingly challenging! As well as all the above, there are many side missions that go all over the world, including to mythical places. All that is left to say is to go see the Seer as soon as you can!<br>', 1, '2021-05-27 22:00:00'),
(5, 'Anno 1800', 48, 23.49, 'Anno 1800 for PC is a real-time city-building strategy game. It is the seventh in the Anno series and returns the game to its historical format following two futuristic editions: Anno 2070 and Anno 2205 respectively. It is set in the early 19th century and follows the technological explosion of the Industrial Revolution.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nTo progress you need to grow your population and keep your citizens happy. The latter is achieved differently for each type of people: for instance, farmers subsist on fish and clothing, but are made content with alcohol. Happiness causes the population to grow – um… as in real life, perhaps? – and once a farmstead is filled up, the building can be upgraded into workers’ accommodations.<br>\r\n<br>\r\nEach class of people brings their own demands, and also their own benefits: so you must balance their needs against the value they have to your society. Just as in life, the more complex the building, the more items are needed in order to craft resources and the more workers are required to run them. Large factories can require hundreds of workers, all demanding, food, clothing and soap along with housing<br>\r\n<br>\r\n<h3>The Old and the New</h3><br>\r\nThe game is divided into the ‘Old World’ and the ‘New World’ and you have to play on both maps, colonising and growing raw materials on one hand and manufacturing and distributing on the other, in order to maintain supply lines and manufacturing capacity. This is where the game can get very interesting in multiplayer mode, as a raid in the New World can bankrupt your Old World factory by cutting off a vital line of supply.<br>\r\n<br>\r\n<h3>Blueprint to Success</h3><br>\r\nOne new feature in this version of Anno is the ability to use blueprints to help lay out the city. When planning your city, bear in mind that factories and industrialisation take away aesthetics (which puts off tourists), even as they creating valuable resources. Use the blueprint to balance your cities, aiming to achieve the best of all worlds.<br>\r\n<br>\r\nBlueprint mode also allows you to block out buildings that you don’t yet have the resources to build. Once the resources are available, the construction can be completed with a single click.<br>\r\n<br>\r\nIn between building your city, you might run out of resources and find that you need to wage war to seize assets or land to boost your infrastructure and keep your people happy. You can battle for the assets, or you can work some financial wizardry and stage a takeover, seizing control of factories, islands or cities, for your own purposes.<br>\r\n<br>\r\n<h3>Ways to play</h3> <br>\r\n<li>Story Campaign</li> <br>\r\nFollow the suggestions of the AI characters to play around the map, gathering crates and fulfilling missions. As you play, you will find yourself becoming busier and busier as your territories expand: your populations boom and you find you need more and more resources to run your growing settlement.<br>\r\n<br>\r\n<li>Sandbox mode</li><br>\r\nGo off and explore the islands and lands on your own, seeing what there is to see and only accepting whatever missions take your fancy. This is a slower way of playing, and one that might suit someone who likes to meander along in a game, exploring every nook and islet to see what might be there. It is a great way to stumble across unexpected valuables, so be sure to take notes for when you decide to play in earnest!<br>\r\n<br>\r\n<li>Multiplayer mode</li><br>\r\nTeam up with friends or battle it out to score the best resources and grab goodies from under other players’ noses. The game can get very exciting as you have to divide your time between the two worlds, keeping your characters happy and productive and making sure that other players haven’t swiped your best assets for themselves.<br>\r\n<br>\r\nBe warned – whichever mode you choose to play in, you will spend more time on it than you plan to!<br>', 0, '2021-05-27 22:00:00'),
(6, 'Maneater', 541, 18.98, 'Experience the ultimate power fantasy as the apex predator of the seas - a terrifying SHARK! Maneater is a single player, open world action RPG (ShaRkPG) where YOU are the shark. Starting as a small shark pup you are tasked with surviving the harsh world while eating your way up the ecosystem. To do this you will explore a large and varied open world encountering diverse enemies - both human and wildlife. Find the right resources and you can grow and evolve far beyond what nature intended, allowing the player to tailor the shark to their play style. This is fortunate, because to get revenge on the cruel fisherman that dismembered you will take evolving into a massive shark, an apex predator of legends. Eat. Explore. Evolve.\r\nPlay through a full narrative, story-based campaign narrated by Chris Parnell (Rick and Morty, Saturday Night Live, 30 Rock) and set against the backdrop of a reality TV show.\r\nBattle fierce wildlife including other apex predators or fight against various types of human hunters ranging from town drunks all the way up to the Coast Guard.\r\nFeed on humans and wildlife to grow your shark, and find shark loot to evolve your shark down multiple possible paths.\r\n7 large regions including bayous of the gulf coast, resort beaches, industrial docks, the open ocean and more. Experience a living world with a full day/night cycle.', 0, '2021-05-27 22:00:00'),
(7, 'Outriders', 212, 33.89, 'Outriders for PC is a third person action adventure shooter game with some role playing elements. It is a successful mixture of Wild West type survival and sci fi space exploration, offering the most fun bits of both worlds in an engrossing game that will keep you playing happily for hours.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nYou begin the game by customising your character, as so often is the case. You will pick one of four classes for your character (see below for details) and then arm yourself against the variety of human and monster enemies that you will be battling. You can play solo, or with two other players depending on your preferences and the availability of your mates.<br>\r\n<br>\r\nWeapons are rifles and shotguns, but they can be upgraded and improved with modifications, and you can opt for every assisting trick, gizmo and gadget on the market, or you can play old-school with just a simple cross-hair through which to aim at your opponents. <br>\r\n<br>\r\nAs you play, explore the map to your heart&#8217;s content &#8211; the game is not open world with missions keeping you tied to one area until it is complete, but within that area the map is spacious enough that you feel as though you are moving at your own motivation rather than being funnelled along a narrow path. So, take your time and speak to any non-playing characters (NPCs) that you come across and accept side missions and mini quests from them as you go.<br>\r\n<br>\r\nInstead of level difficulty this game offers world tiers, with higher tiers offering more challenging quests which offer more rewards in the form of loot. Despite the presence of enemies, the focus of the game is rather more player versus environment over player versus player, which is better for those who like to test their skills against the game without having to watch out for fellow players coming along to sabotage their best efforts!<br>\r\nThe core game will run to 25 &#8211; 30 hours with plenty of extras in the form of side quests and missions from NPCs. <br>\r\n<br>\r\n<h3>What&#8217;s the Story?</h3><br>\r\nThe basic premise of the game is simple: having completely drained the Earth of all its usable resources, humanity has fortuitously discovered planet Enoch, which is (very nearly) perfect to support human life. This attempt to colonise the planet is still in its early stages, and you and your band of compatriots are tracking a mysterious signal to discover what it is and who is sending it. All of a sudden, the expedition is disrupted by a mysterious energy storm which they call &#8216;The Anomaly&#8217;. The Anomaly turns out to be basically a storm which will eat you, given half the chance, and if it doesn&#8217;t do that, it will mutate you! The mutations are not all bad, however, and Enoch&#8217;s indigenous inhabitants and colonists end up with a variety of superpowers. <br>\r\n<br>\r\n<h3>How Classy Are You?</h3><br>\r\nThe four classes you can choose from when setting up your character are as follows:<br>\r\n<br>\r\n<li>Trickster &#8211; annoy enemies and impress friends by manipulating time to suit your own purposes</li><br>\r\n<li>Pyromancer &#8211; burn enemies and light cooking fires for friends by manipulating fire to suit your own purposes</li><br>\r\n<li>Devastator &#8211; unleash seismic waves and blasts upon hordes of enemies to clear the path in one fell swoop</li><br>\r\n<li>Technomancer &#8211; use your mutant powers to awaken defunct technologies and make them do your bidding</li>', 1, '2021-05-27 22:00:00'),
(8, 'SnowRunner', 875, 22.99, 'Get ready for the next-generation off-road experience! <br>\r\n<br>\r\nSnowRunner puts you in the driver&#8217;s seat of powerful vehicles as you conquer extreme open environments with the most advanced terrain simulation ever. Drive 40 vehicles from brands such as Ford, Chevrolet, and Freightliner as you leave your mark on an untamed open world.<br>\r\n<br>\r\nOvercome mud, torrential waters, snow, and frozen lakes while taking on perilous contracts and missions. Expand and customize your fleet with many upgrades and accessories including an exhaust snorkel for heavy waters or chain tires to battle the snow.<br>\r\n<br>\r\nRide solo or with other players in 4-player co-operative and expand your SnowRunner experience with community-created mods!<br>\r\n&#8226; Face extreme environments in a highly advanced physics engine<br>\r\n&#8226; 40 unique vehicles to unlock, upgrade, and customize<br>\r\n&#8226; Complete dozens of challenging missions across an interconnected world<br>\r\n&#8226; Go solo or play with other players in 4-player co-op', 0, '2021-05-27 22:00:00'),
(9, 'Hood Outlaws & Legends', 321, 22.49, 'Hood: Outlaws &amp; Legends for PC is an action adventure game played from a third person perspective and it is a combination of old-time fantasy and a thoroughly modern lack of morals as your prime aim is thievery! The player takes the persona of an outlaw whose aim is to bring down the nefarious &#8216;State&#8217; by infiltrating their well-guarded and treasure-filled Keep.<br>\r\n<br>\r\n<h3>About the Game</h3><br>\r\nBut there is more to the game that you and a bunch of team-mates trying to take down the Keep and get to the treasure. You, and your band of up to four players (including you) must go head to head with fellow outlaws for possession of said treasure currently snugly in the Keep&#8217;s vault.<br>\r\n<br>\r\nThe heist is in three parts: first, you must steal the key from the sheriff of Nottingham. The Sheriff is a boss character and defeating him signals the end of the first phase. Phase two involves both parties of outlaws being given clues to the whereabouts of the vault, after which the game is on to get there, taking out both enemy outlaws and Keep guards. Once the treasure is yours, you must get to the extraction point safely &#8211; and this is the end of phase two.<br>\r\n<br>\r\nThe last phase is where your personal greed and altruism battle against one another as you decide, &#224; la Robin Hood, exactly how much treasure to keep, and how much you will give to the poor by working the Scales of Justice. Don&#8217;t be tempted to be overly generous though, nor yet too stingy! You must keep enough to warrant your continued successes &#8211; buying equipment etc, while giving away enough to earn rewards, and for the poor to survive and support you.<br>\r\n<br>\r\n<h2>Fun Facts to Know</h2><br>\r\nPlaying against AI guards and the opposition team and trying to make your way around the Keep, makes for a great PvPvE (player versus player versus environment) game with enough real human interactions to mix it up in a way that computer programming can seldom achieve!<br>\r\n<br>\r\nWinning earns you perks, such as level-ups, while clothing and weapons can be purchased with the gold you gain. Get some practise in during training mode, which lets you get to grips with your weapons and controls &#8211; but, in training, you are on your own against the AI soldiers which can feel a bit lonely!<br>\r\n<br>\r\nBe sure to keep an eye on the AI guards in the game as they respond to intruders and can give you valuable insights into movements that you cannot directly see. Make sure they don&#8217;t see you either as they can summon reinforcements and block off areas of the keep, leaving you stranded from your goal.<br>\r\n<br>\r\n<h2>Four Characters to Play As</h2><br>\r\nChoose one of the following as your own persona, and allow your teammates to choose from the others. You can, if desired, all play as the same character, or each choose a different one.<br>\r\n<br>\r\nThe latter is recommended as each character has, as you will see, very different and valuable skills, all of which come in handy during the game.<br>\r\n<br>\r\n<li>Ranger: Robin Hood, the bow wielding marksman of legend. He can shoot explosive arrows</li><br>\r\n<li>Hunter: Maid Marian, a specialist in stealth kills when there are too many guards nearby for comfort. She carries a crossbow and can unleash handy smoke grenades</li><br>\r\n<li>Mystic: Friar Tooke (sometimes spelled Tuck) has a near magical ability to get into places he is not meant to be in, which comes in handy in a locked Keep. He is excellent at supporting your team and disrupting enemies, whether AI guards or opposing human outlaws</li><br>\r\n<li>Brawler: Little John is a best at melee fighting and has a big hammer and not afraid to wield it when necessary. He can also hold portcullis.</li>', 0, '2021-05-27 22:00:00'),
(10, 'The Medium', 75, 29.98, 'The Medium for PC is a game all about the spirit world, demonstrating how actions taken in this realm (the real world) can affect the spirits and places in the spirit world &#8211; and sometimes vice versa which is much less of a fun idea! The game incorporates puzzle solving, exploration and thinking your way around or through problems that seem insurmountable.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nYou are in the guise of a Polish orphan, Marianne, who grows up to be an undertaker, like the man who adopted her. Marianne is the eponymous medium for whom the game is named, and she must work to solve puzzles and fulfil missions and quests. There is an entertaining and absorbing storyline to be winkled out by accompanying Marianne and getting her through all her quests.<br>\r\n<br>\r\nBeing psychic, Marianne can see and walk in the spiritual realm even as she is present in the real world at the same time, and this action is frequently shown on a split screen, with real world and spiritual world Marianne in both, interacting with objects and people on both sides as she needs to.<br>\r\n<br>\r\nMarianne&#8217;s spiritual or psychic energy can be depleted by battles with hostile spirits and overusing her powers and when this happens she must seek out spirit wells where she will be rejuvenated.<br>\r\n<br>\r\nThe antagonist of the game is the creepy Maw, which wants to possess Marianne in order to escape its prison in the spirit world and fulfil its bloodlust in the real world. Despite her best efforts, The Maw does escape, and Marianne must work hard to contain the evil entity before it can do too much harm. The creepy villainy of The Maw is beautifully brought to life by voice actor Troy Baker, while Marianne excels, thanks to the voice talents of Kathy Burke.<br>\r\n<br>\r\nThe player must work both worlds in tandem, and learn how to use the features of one world in the other: such as letting Marianne have an out of body experience, so her spirit can go where her body cannot. Gameplay is third person, with fixed camera angles, almost as though you are watching her via CCTV &#8211; except for the bit where you are in charge of where she goes. <br>\r\n<br>\r\nThe visuals are excellently done with the imagery flicking between reality and the spiritual: for example, in one split scene Marianne is talking to ghost child in the spiritual realm but is seen counterpointed by her talking to an apparently empty room in the real world. Keep your eyes peeled for one memorable chase scene where the landscape flicks between the two realms as she runs.<br>\r\n<br>\r\nGame play is fairly linear, with no sandboxiness allowing you to explore at will, so the storyline unfolds pacily and the whole narrative arc runs for about 8 hours altogether.<br>\r\n<br>\r\n<h3>Dark Story</h3><br>\r\nMarianne unravels a tale of horrific past deeds and dark acts which turn out to be personally linked to her and her orphan state. Despite the potential for upsetting trauma, the character of Marianne is robust and sardonic, offering asides and quips that keep the mood light. <br>\r\n<br>\r\nMarianne meets, along the way, a distressed spirit called Thomas and begins to understand the darkness of her own past, made all the more nerve-racking by the reality shifting qualities of the game. <br>\r\n<br>\r\nIn summary, the game is a psychological horror that plays out like a set-piece puzzle game in a very cool gothic setting. Marianne must find objects, avoid hostile spirits, solve puzzles and work out where she comes from, in this well-written and thought- provoking game that tackles some of the hard subjects &#8211; such as what makes people evil? <br>\r\n<br>\r\n<h3>Marianne&#8217;s Psychic Tricks </h3><br>\r\nMarianne has three special tricks up her sleeve that she can deploy when her spiritual energy is high. They are:<br>\r\n<br>\r\n<li>Insight &#8211; she has the power to look deeper than normal sight would allow and spot secret items and places that bear further inspection</li><br>\r\n<li>Spirit Blast &#8211; she can shoot out a powerful shockwave of psychic energy to throw enemies off her trail or disrupt the electrics, as needed</li><br>\r\n<li>Out of Body Experience &#8211; Marianne&#8217;s spirit can leave her body at will, and perform tasks that her physical body would not be capable of doing and go where she would not physically be able to. Be warned however, spirit Marianne will slowly run down until she fades, returning to Marianne&#8217;s physical body to recover</li>', 0, '2021-05-27 22:00:00'),
(11, 'The Evil Within', 515, 4.53, 'Developed by Shinji Mikami -- creator of the seminal Resident Evil series -- and the talented team at Tango Gameworks, <u>The Evil Within</u> embodies the meaning of pure survival horror. Highly-crafted environments, horrifying anxiety, and an intricate story are combined to create an immersive world that will bring you to the height of tension. With limited resources at your disposal, you&#8217;ll fight for survival and experience profound fear in this perfect blend of horror and action.<br>\r\n<br>\r\n<strong>STORY:</strong> <br>\r\n<br>\r\nWhile investigating the scene of a gruesome mass murder, Detective Sebastian Castellanos and his partners encounter a mysterious and powerful force. After seeing the slaughter of fellow officers, Sebastian is ambushed and knocked unconscious. When he awakens, he finds himself in a deranged world where hideous creatures wander among the dead. <br>\r\nFacing unimaginable terror, and fighting for survival, Sebastian embarks on a frightening journey to unravel what&#8217;s behind this evil force.<ul class=\"bb_ul\"><li><strong>Pure Survival Horror Returns</strong><br>\r\nShinji Mikami, the father of survival horror, is back to direct a chilling new game wrapped in haunting narrative. Tension and anxiety heighten dramatically as you explore the game&#8217;s tortured world. <br>\r\n<br>\r\n</li><li><strong>Brutal Traps and Twisted Creatures</strong><br>\r\nFace unthinkable horrors and cruel traps as you struggle to survive against overwhelming odds. Turn evil against itself by using the same diabolical devices against overwhelming deadly creatures.<br>\r\n<br>\r\n</li><li><strong>Unknown Threats in an Uncertain World</strong><br>\r\nMysterious and wicked fears loom ahead in a world that warps and twists around you. Corridors, walls, doors, and entire buildings change in real-time, ensnaring players in a reality where threats can appear at any time and from any direction.<br>\r\n<br>\r\n</li><li><strong>The New Face of Horror</strong><br>\r\nExperience a disturbing reality as you try to break free from warped machinations that could only exist in the most horrifying worlds. Defeat insurmountable terror and experience the ultimate thrill by discovering <u>The Evil Within</u>.</li></ul>', 0, '0000-00-00 00:00:00'),
(12, 'The Crew 2', 18, 9.19, 'The Crew 2 for PC is an open world racing game in which the player must range freely, exploring and racing, over a perpetual world loosely based on continental North America. Players have their choice of planes, hovercraft, boats, motorcycles and, of course, cars – including monster trucks.<br>\r\n<br>\r\nThe game is the sequel to the first in the series: The Crew, released in 2014.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nThe game’s setting covers only those states that are found on mainland USA, so Alaska and Hawaii are not included this time. Each different vehicle type has different engineering, so the physics engines behave uniquely according to each vehicle’s design: allowing players to make fairly large changes to the end result, simply by changing the vehicle being used.<br>\r\n<br>\r\nThe goal is to earn followers on social media: this is how a player ‘wins’ in the game. Needless to say, follower counts spike when you actually come first in the races and events like performing stunts and similar activities.<br>\r\n<br>\r\n<h3>Just Drive – or Fly or Boat </h3><br>\r\nThe game is especially good when you can just aimlessly tool around the countryside, exploring the famous landmarks and seeing just how fast you can get your vehicle to go.<br>\r\n<br>\r\nOne exceptionally cool feature is that you can change your vehicle right in the middle of the action, at the touch of a button. You could be blasting across the Nevada desert and decide you need a change, and within a fraction of a second, be blasting across a lake on a motorboat or soaring into the sky in a small plane.<br>\r\n<br>\r\n<h3> Ways to Race</h3><br>\r\nThere are a total of four different hub-worlds, in which the racing style varies and with a different opponent/ mentor for each style. They are:<br>\r\n<li>Street Racing: Aided by Latrell, if ‘aided’ is the right word for advice like ‘street racing is wrong’ and injunctions to go back to the track, this style of racing adds some spice to your racing mojo. Tear down streets avoiding obstacles and get to your destination before the opposition to win. Some obstacles can be knocked down without harming you – such as lampposts – but walls and other objects are immovable and will cause you to crash out</li><br>\r\n<li>Pro Racing: Alexis helps out, and just as well as these races must be completed in three different vehicles! From a touring car to a powerboat to an Alpha GP vehicle, make sure you change vehicles at the right point and put your foot down to score a win</li><br>\r\n<li>Off-Road Racing: Tucker ‘Tuck’ Morgan shows you how to do it in this tense round where you are given a start point and an end point: the route you take can be entirely up to you! </li><br>\r\n<li>Free-style Racing: Sofia and her dad oversee this round where you start out in a boat, switching to a car halfway through. This is one of the more challenging levels as the vehicles are hard to handle and the course is very precisely marked: going out of bounds can slow you down a lot</li><br>\r\nAll these types of racing can be done solo (which is basically multiplayer but with AI companions), cooperative multiplayer or oppositional multiplayer, depending on the way you prefer to play. <br>', 0, '2021-05-27 22:00:00'),
(13, 'A Way Out', 141, 5.51, 'From the creators of Brothers &#8211; A Tale of Two Sons comes A Way Out, an exclusively co-op adventure where you play the role of one of two prisoners making their daring escape from prison.<br>\r\n<br>\r\nWhat begins as a thrilling breakout quickly turns into an unpredictable, emotional adventure unlike anything seen or played before. <br>\r\n<br>\r\nA Way Out is an experience that must be played with two players. Each player controls one of the main characters, Leo and Vincent, in a reluctant alliance to break out of prison and gain their freedom.<br>\r\n<br>\r\nTogether, you&#8217;ll explore notions of trust and consequence as your choices begin to catch up with you.<br>\r\n<br>\r\nPlay the entire experience with your friends for free using the one-click free trial feature.', 0, '2021-05-27 22:00:00'),
(14, 'Resident Evil Village', 0, 38.19, 'Resident Evil Village for PC is a survival horror game. This incarnation is the tenth main release in the franchise and amazingly, the 26th including all the spin-offs and remakes, making Resident Evil one of the most prolific games out there! Resident Evil Village is sometimes called Resident Evil 8: Village, and the developers have spotted that they can create a hidden puzzle within the title, which is rendered with roman numerals for eight VIII instead of the Vill of Villagers. As in V I I.I. AGE. Clever! <br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nThe game is first-person game, that allows for six-player online multi-play when preferred. The game is set a few years after the previous game, Resident Evil Seven, and Ethan Winters is once again the protagonist along with his wife, Mia, also from RE7 (see the list of important characters, below, for more). <br>\r\n<br>\r\nEthan’s inventory items are kept in a virtual ‘briefcase’ which he keeps with himself at all times, paying periodic visits to a vendor called Duke who sells weapons and healing items. This version of the game places a greater focus on exploration and combat than the other versions of the game, but the underlying story is both fascinating and compelling (and scary too, in places!).<br>\r\n<br>\r\nVIII is a bit more open world than its predecessor, so you can explore and stretch your character more than was permitted in the strictly linear progress of the previous game.<br>\r\n<br>\r\nEthan is surprised when Chris suddenly visits and disrupts his peaceful life. Events play out in such a way that Ethan has no choice but to chase after Chris in search of answers. Ethan tracks Chris to a remote village – that of the title of the game, obviously – and realises that things are not all they seem…<br>\r\n<br>\r\nThe nearby castle is home to a nearly three metre tall vampire woman, with a nest of hungry daughters, while spooky… things, let us call them, flicker at the edge of Ethan’s vision, darting out of sight when he tries to catch a proper look at them. Throw enormous blue werewolves into the mix, and you would think that Ethan’s hands are full enough – but there are more shocks to come! <br>\r\n<br>\r\n<h3>RE: Verse Bonus</h3><br>\r\nFree to all Resident Evil Village owners, is access to Resident Evil RE: Verse, the online game. This game incorporates all the fan favourite characters and locations from the whole franchise, and don’t worry if you get killed. In a fun twist, if you die in RE: Verse, you instantly respawn as a bioweapon, so you can get beautiful karmic revenge on whoever killed you! <br>\r\n<br>\r\nAside from coming with VIII there is no real connection between the two, certainly not as far as storyline goes. <br>\r\n<br>\r\n<h3>Dramatis Personae</h3><br>\r\n<li>Ethan Winter – the protagonist of the game, he has survived RE7 and settled down to a comfortable married life until events force him up and about</li><br>\r\n<li>Mia Winters – one of the main protagonists of RE7, alongside her now-husband Ethan, with whom she is expecting a baby</li><br>\r\n<li>Chris Redfield – a shock blast from the past, Chris pops up and violently disrupts Ethan’s contented life. What does he really want, though?</li><br>\r\n<li>Alcina Dimitrescu – a cheerful and beautiful vampire, Alcina puts Hagrid to shame, standing a hefty 9-foot 6 tall. That’s scrape-the-ceiling tall and duck-through-every-doorway tall</li><br>\r\n<li>Alcina’s Daughters – not quite as tall as their Mama, these ladies are somewhat lacking in the beauty department too!</li><br>\r\n<li>Werewolves – where did these ferocious howling creatures come from? Who controls them?</li>', 0, '2021-05-27 22:00:00'),
(15, 'Dark Souls 3', 474, 9.35, 'Dark Souls 3 for PC is a fantasy action role-playing game, the fourth in the series and a close follow-on from its immediate predecessor, Dark Souls 2. The game is set in a fictional universe, in the Kingdom of Lothric, where are lengthy period of enlightenment (literally) is being threatened by the coming of the Age of Dark. The player must ensure the survive of the Age of Fire by ensuring that the First Flame continues to burn a while longer.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nThe player takes on the third-person persona of the Ashen One, who is tasked with &#8216;linking&#8217; the First Flame to keep it burning. The flame is fuelled by the sacrifices of heroes and champions, who willingly sacrifice their souls to the flame, thereby becoming Lords of Cinder. This has happened in an unbroken line from times gone by until now. The Ashen One failed to link the flame and has not become a Lord of Cinder, instead being known as an Unkindled.<br>\r\n<br>\r\nThe Ashen One arises as the player enters the game, and is given the mission of returning the Prince Lothric and the rebellious Lords of Cinder to their rightful places, their thrones in Firelink Shrine. The flame is dying because Prince Lothric has defied his destiny: he must be persuaded otherwise.<br>\r\n<br>\r\nSuccessfully returning the Lords of Cinder and the Prince, they travel on to the ruins of the Kiln of the First Flame: at this point, after the defeat of the Soul of Cinder, there are four potential endings, more about which see below.<br>\r\n<br>\r\n<h3>Battles and Treasures and Weapons, Oh My</h3><br>\r\nIn the course of his mission, the Ashen One must battle using a variety of weapons, that range from bows to swords to throwable projectiles, with shields and evasive manoeuvres an important skill to learn. Each weapon has a standard use and a boost: a powered-up version which must be used sparingly as it does not last long and takes a bit of time to reset once depleted.<br>\r\nHe will also battle a wide range of creatures, many of them grisly and in keeping with the spectral, supernatural theme of the game. Watch out for skeletal hounds, various hostile lizard-men, the undead in forms that range from skeleton to blood-thirsty knight to the revolting Pus of Man, an enemy who transforms from vaguely normal man-shape into a hideous abyss-tainted corruption. Enemies drop resources though, so be sure to grab them all.<br>\r\n<br>\r\nThe Ashen One can use magic by acquiring FP (focus points) which are used up whenever a spell is cast. Hit Points (HP) is used when taking damage from enemies, and both of these are refilled through estus flasks, magical healing vessels that can be upgraded up to seven times for maximum benefit.<br>\r\n<br>\r\n<h3>Ending It All</h3><br>\r\nThere are four potential endings after the Soul of Cinder has been defeated. They are as follows:<br>\r\n<li>Link the Flame: The player can attempt to link to the First Flame, ensuring that the Age of Fire will continue</li><br>\r\n<li>Summon the Fire Keeper: The Fire Keeper will extinguish the flame and the Age of Dark will begin in earnest</li><br>\r\n<li>Kill the Fire Keeper: This is much like the ending above, except after summoning the Fire Keeper, you kill her. Note: you will not receive any end game achievements for playing out this ending. The Fire Keeper will respawn as soon as you leave the area, so you can come back and try again</li><br>\r\n<li>Keep the Flame: The Ashen One can choose to keep the flame for themselves, an option which results in his becoming the Dark Lord of Londor</li>', 0, '2021-05-27 22:00:00');
INSERT INTO `product` (`id`, `name`, `available_stock`, `price`, `desc`, `featured`, `created_at`) VALUES
(16, 'Horizon Zero Dawn', 82, 22.49, 'Horizon Zero Dawn for PC is an action role playing game in which you control Aloy, a rare human survivor in the 31st century dystopian landscape. <br>\r\n<br>\r\nHumans may be rare, and access to technology is limited, but there is a large population of unfriendly robotic creatures (who were originally created by Big Tech who then lost control of them).<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nAloy gets by in life by cannibalising the remains of the robotic creatures for electrical components that enable her own survival. She can also use other parts of the creatures to craft weapons and equipment that help her survive and succeed. The machine creatures band together, rather like real life wildlife herds, and will not usually attack one another unless they have been subject to corruption arrows or have been hacked with an Override Tool.<br>\r\n<br>\r\nHowever, they do attack when they sense a threat, but they do tend to use brute force rather than finesse, and they all have differing attack and defence modes. Your various weapons have modification slots that allow you to boost weapons&#8217; offensive capabilities for more dramatic effects, and Aloy wears a small head-mounted scanner called Focus that helps her zone in on her prey. However, The Stalker, in particular, can avoid this with stealth cloaking technology. <br>\r\n<br>\r\nAloy also battles human enemies: there are bandits and a creepy cult to keep clear of, amongst others. Aloy was rejected by her tribe when she was younger, then being adopted and taught all she knows by Rost, her father figure. But she wants to find the truth &#8211; no spoilers are forthcoming, other than to say it&#8217;s well worth tracing through the narrative as Aloy learns that not only does her identity exist, but that she can change the entire shape of humanity altogether.<br>\r\n<br>\r\n<h3>The Nitty Gritty</h3><br>\r\nThere are various skill trees, that bear unusual names for recognisable skills: Prowler means stealth, Braves are excellent at combat and Foragers are skilled at gathering and healing. You will progress up the skill tree based on your experience from completing quests and making kills, and open out new areas of the map by climbing up the nearest Tall Neck to literally broaden your horizons! Tall Necks are immense, giraffe-like robot creatures.<br>\r\n<br>\r\nThe map includes a variety of terrains to playthrough, and there is the option for fast travel if you only have a short time to play and want to get on with the quest &#8211; otherwise it is more fun to take your time! These terrains include jungles and forests, deserts, and snowy mountains &#8211; where your parkour skills come in handy. The open world game has a night and day cycle and dynamic weather to make things more fun.<br>\r\n<br>\r\nAs well as Tall Necks, there are Striders which are the robotic equivalent of horses, and you can tame yourself one to gain a speedy and obedient mode of transportation. There are also truly immense creatures that appear to be the size of an entire village, that will wow you, even as you work out how to bring it down!<br>\r\n<br>\r\nCorruption Zones dot the map and are harder to cross, with corrupted machines that are more aggressive and will actively attack. There are plenty of collectibles and signs of the &#8216;old world&#8217; all around, many of which are valuable and should be gathered when possible. <br>\r\n<br>\r\nTo get through the game, Aloy must help other friendlies, complete quests, gather materials, and solve mysteries, not least of which is the mystery of her own life.<br>\r\n<br>\r\nPro-tip: be on the special look-out for a suit of ancient armour that renders Aloy all but indestructible&#8230; <br>\r\n<br>\r\n<h3>Aloy&#8217;s Movements to Master</h3><br>\r\n<li>Dodge &#8211; get the timing right and Aloy can step out of range effortlessly, giving herself valuable time to take out the enemy</li><br>\r\n<li>Sprint &#8211; it is always useful to put on a good turn of speed when necessary!</li><br>\r\n<li>Slide &#8211; practise this niche skill that will get Aloy out of an enemy&#8217;s range or to a treasure before anyone else. It also looks cool!</li><br>\r\n<li>Roll &#8211; there is something about having your character duck and roll that looks and feels amazing as you creep up on unaware enemies, ready to sneak past them or into their domain!</li><br>\r\n<li>Swim &#8211; take to the water to glide silently past vigilant hostiles and also get to places that are inaccessible on foot</li><br>\r\n<li>Hide &#8211; sometimes Aloy will need to lure hostiles into a trap. To this end, she can hide and wait to ambush the unwary as they pass<br>\r\n</li><li> Parkour &#8211; sometimes there is no obvious up or over an obstacle. Put Aloy&#8217;s parkour into action and bounce, flip and somersault into tricky places</li><br>\r\n<li>Zipline &#8211; these useful wire cables can get Aloy from up here to down there in a flash!</li>', 0, '2021-05-27 22:00:00'),
(17, 'The Elder Scrolls V', 544, 10.49, 'Skyrim Special Edition for PC is a remastered version of the highly popular action role-playing game from Bethesda and it represents the fifth edition of the fantasy game. The Skyrim games (the Elder Scroll series) are multi award-winning games known for their open world play, immensely detailed worlds and free-form gameplay that allow the player to drive the action, and to a certain extent, the story.<br>\r\n<br>\r\n<h2>About the Game </h2><br>\r\nAlduin the World Eater is the central antagonist in this game, a massive dragon who is prophesied to end the world. The action takes place in the world of Skyrim, specifically in the northernmost province of Tamriel. The player must work to increase his or her characters strengths and abilities, while working their way across the map. <br>\r\n<br>\r\nThere is no urgency to complete the main story arc, so players can explore the whole map and focus on character building before returning to pick up the threads of the storyline and work to defeat Alduin.<br>\r\n<br>\r\n<h3>What to Do</h3><br>\r\nThe player can play from a first-person or third-person perspective, exploring the richly detailed world which includes wilderness areas, towns and cities &#8211; both large and small, fortresses and small rural villages. Players can fast travel to cover large distances quickly, or they can ride horses to explore regions fairly quickly but in detail.<br>\r\n<br>\r\nWhile the storyline can be ignored until the player is ready to continue along that path, some quests do rely on the story having progressed a certain amount, so players might need to dip in and out of narrative play if they want to solve quests in a certain order.<br>\r\n<br>\r\nYou can, if you want to, race to complete the story arc to ensure that all the areas are unlocked, and then go back and do some explorations. <br>\r\nWhichever way you choose to play, the game is highly deserving of many hours&#8217; attention as you explore, quest and battle your way through the intensely detailed land.<br>\r\n<br>\r\n<h3>The Importance of Being NPC</h3><br>\r\nNPCs (non-playing characters) are largely interactive and players can choose to befriend, romance and marry, fight with and even kill them. Some NPCs are important to the storyline and cannot be killed until they have played their part, while others can be killed, but their death then locks some of the content from the player: clues and information that they would have offered the player being inaccessible after their demise.<br>\r\n<br>\r\nBehaving in an immoral way &#8211; killing NPCs etc &#8211; can rachet up your infamy, and putting a bounty on your head. Should you be stopped by guards when there is a price on your head, you can be jailed, pay a handsome fine (or bribe) in gold to prevent this, or you can resist arrest, running away and evading the guards. <br>\r\n<br>\r\nThis last action will, however, trigger a vigorous pursuit on the part of the guards, and may make life a bit exciting for your character until they can get out of their range.<br>\r\n<br>\r\n<h3>Three DLCs for You</h3><br>\r\nThe Special Edition comes with access to three DLC story arcs, as follows:<br>\r\n<br>\r\n<li>Dawnguard: Join or resist the Vampire uprising. Lord Harkon, a vampire lord, wants to use an Elder Scroll to darken the sun, thereby allowing vampires to roam the world freely, at any time, night or day</li><br>\r\n<li>Hearthfire: Perfect for those who love crafting, this DLC lets you build yourself a home, from a basic one-room shack, all the way up to the most sumptuous mansion. Using crafting stations and work benches to your hearts&#8217; content, and then, once your home is ready, adopt some children to make the house into a real home</li><br>\r\n<li>Dragonborn: Travel off the Morrowind to the island of Solstheim where you will meet your deadliest adversary ever: the Dragonborn. The Dragonborn have the body of mortals but the souls of Dragons and they are thought to be the only beings who can defeat Alduin. The fate of the world (and yourself) lies in the outcome of this encounter!</li>', 0, '2021-05-27 22:00:00'),
(18, 'Green Hell', 143, 6.57, 'Green Hell for PC is a survival game in an open world format, where the player must survive &#8211; and try to thrive &#8211; in an unusual location for such games which are usually set in deserts or arid landscapes &#8211; places survival is hard because of a lack of resources. This game parks you firmly on the banks of the Amazon river with all the dangers that entails: poisonous plants, bad water, dangerous creatures and natives who may or may not welcome intruders into their domain! <br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nIn story mode you are Dr Jake Higgins &#8211; again an apparent improvement on other survival games, as it means you start with some advantages and knowledge. You are looking to find your wife, Mia, who is bent on making friends with local tribespeople because she speaks their language &#8211; she is Jake&#8217;s interpreter, as well as his partner. <br>\r\n<br>\r\nHowever, this rather blinds her to the dangers of those who do not wish her well, and Jake, whose only current contact with her is via a radio, must keep himself alive and track her down before it is too late. Jake&#8217;s progress is constrained by the need to learn on the go, making and then using tools that give him access to more of the jungle, each one hopefully taking him ever closer to Mia. There are multiple endings, so the game is worth replaying to see how the other endings play out.<br>\r\n<br>\r\n<h3>Need to Know</h3> <br>\r\nJake is armed with a useful satellite watch which doubles as your health monitor and a compass to keep you on track. Your inventory all fits into your backpack, so it is with you all the time, and you save by building a shelter, wherever you are. Remember to save before committing yourself to a tricky crossing or feat, and in a place where you are relatively safe &#8211; it&#8217;s mildly irritating to repeatedly die seconds into any save!<br>\r\n<br>\r\nIt&#8217;s not just basic food along with clean water and sleep that you need in this game, you need to get the right balance of fats, carbs and proteins which makes it a lot trickier to accomplish, despite the abundance of potential nourishment all around you. You can check your limbs, one at a time and in fair detail, so you can spot wounds, leeches, bugs, bites and rashes as soon as they start affecting your health status.<br>\r\n<br>\r\nThere is also a sanity bar which you should keep an eye on, especially when Jake is particularly stressed, ill or exhausted! If you start losing your mind, your grip on reality wanders and the music becomes poignant, and the colour drains from the world. The jungle will try and kill you even harder in this state, but you can recover by performing &#8216;normal&#8217; actions, such as curing minor illnesses, drinking good water, eating well, and getting caught up on your sleep etc. <br>\r\n<br>\r\n<h3>Ways to Play</h3><br>\r\nThe beginning of story mode &#8211; about ten minutes or so &#8211; is identical to the tutorial, and it cannot be skipped, so you could miss the tutorial and dive straight into story mode. If you survive first time out (highly unlikely!) you will be away, without needing to do it all again, for real this time. <br>\r\n<br>\r\nYou can play with a buddy in story mode, and have a friend along to keep an eye out for danger, slap a cure together and generally look out for each other.<br>\r\n<br>\r\nCo-operative multi-play is also available in online survival mode where you and three others work to keep the team alive and on the move. <br>\r\nWhichever mode you play, it is possible to survive, but the game does not make it easy &#8211; you have to work at it and you may well finish the game exhausted and feeling as though the real Amazon wouldn&#8217;t be quite so determined to make you dead! In both modes there are plenty of missions and side quests to work through.<br>\r\n<br>\r\nCrafting is &#8211; surprisingly &#8211; super simple. Just gather what you need &#8211; usually just one of each item &#8211; and then drag and drop them together and voila, the item is made. You must have a shelter to save the game, as mentioned above, so make the first one early and then save often as you progress! <br>\r\n<br>\r\nPro tip &#8211; coconuts are your friend! They are clean water, food and even bowls all in one. Gather as many as you can carry!<br>\r\n<br>\r\n<h3>Exciting Ways to Die in the Jungle!</h3><br>\r\nJaguars will kill you with enthusiasm, enjoying you for dinner while you curse and respawn, trying to remember exactly where they were so as to avoid them this time round, but there are a great many ways to die in this appropriately named green hell &#8211; here are just some of them!<br>\r\n<br>\r\n<li>Arrows &#8211; not all the locals are happy to see you, and despite Mia&#8217;s insistences, some of them will happily try to kill you!</li><br>\r\n<li>Falls &#8211; all that lush green growth can be deceptive, with lethal drops suddenly opening under your unwary feet</li><br>\r\n<li>Venom &#8211; famously, venom is what snakes squirt into when they bite, poison is what kills you should you eat it. But you are not going to be bothered about using the right word when snakes are falling out of trees and biting you, creeping up behind you and biting you, or appearing apparently out of nowhere and &#8211; you guessed it &#8211; biting you!</li><br>\r\n<li>Poison &#8211; watch what you eat, as some of the berries, animals and leaves will, if not outright kill you (although some do!), make you very ill, and open to dying from any number of other causes.</li><br>\r\n<li>Dehydration &#8211; just as in real life, not drinking enough water is a major problem. And despite the fact that there is plenty of water, unlike in other survival games, you need to be careful about drinking it! Water must be clean and bug free if it isn&#8217;t going to make you sick. Oh, and check yourself, if you&#8217;ve been near water you almost certainly have a leech or twenty somewhere about your person! This will make Jake&#8217;s health bar start dropping, so be sure to sort it quickly!</li>', 0, '2021-05-27 22:00:00'),
(19, 'Overwatch', 221, 13.49, 'Overwatch for PC is a team-based multiplayer first-person shooter game developed by Blizzard Entertainment, who are also known for the highly popular World of Warcraft games and their spin-offs.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nOnce players join up, they are put into two teams of six along with other players. Each player can choose from up to 30 characters (in the game, these are called heroes). The characters are excellent: individually rendered, complete with personality traits and physical quirks that are charming and individual. These quirks can include an attractive smile, a wayward lock of hair falling across their face at a certain point, and many other subtle but significant features.<br>\r\n<br>\r\nEach is given a mission or series of missions which can include either defending or attacking strongholds and laboratories, or escorting cargo or payloads across the map, guarding valuables from attack.<br>\r\n<br>\r\nEach successfully completed mission results in prizes for the successful team, and they are rewarded. Examples of prizes or rewards for completing missions are things like cosmetic skins and upgrades that make you look cool. Ability is not upgradable through these prizes, which are just for fun and add greatly to the individual vibe given off by each character. <br>\r\n<br>\r\n<h3>Storyline </h3><br>\r\nThe game is set in a fictionalised world sixty years in the future. Overwatch was the United Nations of its time, set thirty years before the time of the game, but a series of in-fights and accusations resulted in an explosion at headquarters which killed many of the founding leaders. After this event, six years prior to the commencement of the game, Overwatch was disbanded and closed down, the members scattered to the four wind.<br>\r\n<br>\r\nOverwatch was started up originally to save the world from an AI uprising when robots designed to serve mankind turned on them instead, when so-called God programs took control and took against their creators and masters.<br>\r\n<br>\r\nOverwatch defeated the omnics, as the robots are called, and a fragile peace was maintained until the fighting kicked off, resulting in the above-mentioned explosion and the shutting down of the program. An offshoot of beings who believe that omnics have souls have an organisation &#8211; more of a cult &#8211; which enjoys a secretive but healthy following.<br>\r\n<br>\r\nIn the void left by Overwatch&#8217;s shut down, enemies begin to gather information and try to raid Overwatch strongholds for tech and data that can help them with their nefarious activities. They are thwarted by Winston, a gorilla scientist who refused to leave his lab when they were shut down. <br>\r\n<br>\r\nHe reconnects the Overwatch infrastructure and sends out a call to action to any surviving agents. This is the point when the game begins.<br>\r\n<br>\r\n<h3>Some Fun Overwatch Facts </h3><br>\r\n<li>Winston, the gorilla, grew up on the moon. He was looked after by a Dr Winston, whose name (and spectacles) he took as his own, and escaped from the moon by building a rocket and flying to earth</li><br>\r\n<li>The game won Game of the Year in 2016</li><br>\r\n<li>There are over 7,000 voice lines in the game. Given that the game has been translated into 12 languages, that means there is an incredible 84,000 voice lines altogether. That is a lot of voice acting and a lot of work: but it is well worth it as the gameplay is wonderful, with seamless interaction and believable conversational dialogue</li><br>\r\n<li>Keep your eyes open for Easter eggs to other Blizzard Entertainment products and releases: they&#8217;re everywhere if you look carefully! </li>', 0, '2021-05-27 22:00:00'),
(20, 'Dark Souls Remastered', 98, 14.84, 'Then, there was fire. Re-experience the critically acclaimed, genre-defining game that started it all. Beautifully remastered, return to Lordran in stunning high-definition detail running at 60fps.\r\nDark Souls Remastered includes the main game plus the Artorias of the Abyss DLC.\r\nKey features:\r\n&#8226; Deep and Dark Universe\r\n&#8226; Each End is a New Beginning\r\n&#8226; Gameplay Richness and Possibilities\r\n&#8226; Sense of Learning, Mastering and Accomplishment\r\n&#8226; The Way of the Multiplayer (up to 6 players with dedicated servers)', 0, '2021-05-27 22:00:00'),
(21, 'Battlefield 5', 569, 14.98, 'Battlefield 5 for PC behaves possibly much like real war does, with moments of horrendously soul-crushing death followed by ridiculous moments of lethal levity &#8211; death by cricket bat, anyone? The first-person shooter is set in the middle of WWII, albeit with some (rather a lot of) historical inaccuracies, not least of which is the inclusion of female soldiers.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nThe core game follows three basic stories, one of which the player chooses in order to follow that character&#8217;s path through the war. Cosmetic items and weapons upgrades can be purchased using in game currency which can be earned through completing missions, or bought if you are in a hurry to progress through the levels. <br>\r\n<br>\r\n<h3>Battle Royale</h3><br>\r\nJoin in a battle to the death in a restricted campaign called Firestorm. The name comes from the unique feature designed to keep the slaughter ground contained to a relatively small area of the open world format. A literal storm of fire sweeps over and around the battleground killing any who stray into its path &#8211; however, nevertheless, this campaign features the biggest game map yet on any Battlefield game. Up to sixty-four players can play the Battle Royale at any one time, and they are organised into battalions of sixteen players initially, with an emphasis on co-operative team play.<br>\r\n<br>\r\n<h3>Ways to Play</h3><br>\r\n<li>Single player</li><br>\r\nChoose one of the game paths which will take you from safety into the midst and battle and, hopefully, safely home again! These stories are based on real life campaigns from WWII although with some added drama and exaggerations to make the game play even more compulsive.<br>\r\n<br>\r\nThe game is set in the bombed out ruins of Rotterdam, and boasts some wonderful visual treats, such as the wounded Spitfire grazing an already wounded wing against a bell-tower before losing height as it stumbles over the horizon leaving a trail of smoke and dust.<br>\r\n<br>\r\n<li>Creation as well as Destruction</li><br>\r\nIt is not all death and destruction though, in certain areas of the map you can build shelters and erect sandbags as a defence against attack. Do look sharp, though, working on your constructions can leave you vulnerable to snipers or ambush from others, so keep a wary eye out while you wait for your progress bar to tick over to complete.<br>\r\n<br>\r\nYou can play over much of Europe, with many areas in France offering evocative and stunningly depicted locations to battle through and explore.<br>\r\n<br>\r\n<li>Multiplayer</li><br>\r\nThere are several multiplayer modes, most of which lay out a brief backstory to give you your incentives. You battle it out with and against many others, in continuous battle modes, working your way through the Grand Operations which simulates real battle campaigns. Towards the end of the session, players are reduced to single weapons with no respawn capability &#8211; this feature is called &#8216;Final Stand&#8217; and marks an exciting and breath-taking culmination of all your combat hours.<br>\r\n<br>\r\n<li>Cooperative</li> <br>\r\nTeam up with three other players to work cooperatively to achieve the aims of the mission. These missions are dynamic and responsive so you are guaranteed a different experience each time you play.<br>\r\n<br>\r\nWhichever way you choose to play, you will exult in the game&#8217;s stated core pillars of: destruction, team play and vehicles &#8211; a glorious mass of shooting, fighting and winning your laurels during the war that displaced &#8216;The Great War&#8217; as the worst conflict of modern times.<br>', 0, '2021-05-27 22:00:00'),
(22, 'Rainbow Six Siege', 1127, 8.04, 'Rainbow Six Siege for PC is an online tactical shooter game. There is a strong emphasis on environmental destruction and cooperation between players, with each player assuming control of a playing character to defend or attack in each different scenario. These include hostage rescue, bomb defusing, and capturing or defending a control point.<br>\r\n<br>\r\nThe game got off to a slow start but plenty of downloadable content upgrades, plus the developers &#8216;game as service model&#8217;, since its release have seen any gaps in gameplay, plot and progression get filled in, and it is now known as one of the best games of its type with over 45 million registered players worldwide.<br>\r\n<br>\r\n<h2>About the game</h2><br>\r\nThe player chooses to play as one of the members of the Rainbow teams. There are several to choose from, and each character has different gear and gadgetry, specialised weapons and are even of nationalities. You can play as American, German, Russian, French or British operatives, all in teams of four.<br>\r\n<br>\r\nAs each team member has different capabilities and gear, teamwork, cooperation and communication between all the players is absolutely vital for successful runs. Tactical thinking starts early and then provides a support throughout the whole game: the most successful missions are those that are carefully planned from the off.<br>\r\n<br>\r\nPlayers can choose their character, make upgrades and perform customisations to weaponry and gadgets, as well as pick spawn/ respawn points: but once the mission has started these choices cannot be undone so players must consider all the information carefully before committing to anything.<br>\r\n<br>\r\nOnce a battle is initiated, it must run to the end, and players cannot respawn until it is lost or won. Characters killed in the fray, however, can enter Support Mode, and aid their companions remotely as radio support and similar.<br>\r\n<br>\r\n<h3>What&#8217;s the Story?</h3><br>\r\nThe White Masks are a terrorist organisation bent on world domination for unknown reasons. Rainbow unit is redeployed, having been dormant for three years, and controlled by Six (voicing and motion capture performed by Angela Bassett). <br>\r\n<br>\r\nThe teams are assembled and trained, before setting forth on the main mission, the take down of the White Masks after they attack a university (Bartlett University). The players must find their way onto campus, battle through the villains and break the siege to rescue those innocents on the grounds and eradicate the terrorists. <br>\r\n<br>\r\nThe campaign ends with a huge success, and the end result is that Rainbow Unit is needed for the security of the world. The unit stands ready and able, awaiting the next call to action, whenever it should arise.<br>\r\n<br>\r\n<h3>Real Feel Sieges and Earning Renown</h3><br>\r\nIn order to offer an authentic siege experience, the game developers actually consulted genuine anti-terror units, examining real-life siege scenarios. This is noticeable in the game, with genuine psychological dilemmas presenting themselves to the players &#8211; a couple of hours&#8217; gameplay will leave you sweating and breathless!<br>\r\n<br>\r\nThe in-game currency is &#8216;reknown&#8217; and it can be used to upgrade weapons and gear, customise characters and to purchase cosmetic touches that will make your character more uniquely yours. It is earned by completing missions, performing tasks and can also be bought with real cash.<br>\r\n<br>\r\n<h3>Environmental concerns</h3><br>\r\nPlayers must use their environment to their advantage: shooting holes through walls to weaken them, or planting explosives while on the attack. Defenders need to strengthen walls and raise barriers using barbed wire or laser traps to prevent attackers from breaching into their stronghold. <br>\r\n<br>\r\nThese actions must be planned before battle commences as there will no be time once everything kicks off.<br>\r\n<br>\r\nWhile tracking through places, the backgrounds are well rendered, with lots of domestic detritus and the odd poignant reminder of former times. <br>\r\n<br>\r\nThe sound-track is quieter, with muted ambient sounds overlaid with occasional bursts of footsteps and gunshots &#8211; this gives a spectral feel to the quiet times, heightening the tension to almost unbearable levels before contact with the enemy allows the suspense to be dispensed with a burst of action.<br>\r\n<br>\r\n<h3>Ways to Play</h3><br>\r\n<li>Multiplayer</li><br>\r\nWorking in concert with your team members is the overall purpose of the game, and communication and planning are key in getting the whole team working in concert to cover all the bases and make sure objectives are met.<br>\r\n<br>\r\n<li>Single player</li><br>\r\nThis is the tutorial level, but offers enough fun and engagement to be a standalone solo game in its own right. &#8216;Situations&#8217; are a series of missions, loosely connected with a narrative thread, which train players in all the skills needed for future meetings with or battles against the White Masks. <br>\r\n<br>\r\nAbsorbing and fun, they get you ready for the main game which is multiplayer combat missions, as mentioned above.<br>\r\n<br>\r\nThree major positives offered by the game include:<br>\r\n<br>\r\n<li>Player Expression</li><br>\r\n<li>Tactical Intensity</li><br>\r\n<li>Creative &#8211; competitive &#8211; teamwork</li><br>', 0, '2021-05-27 22:00:00'),
(23, 'No Mans Sky', 570, 15.15, 'No Man&#8217;s Sky for PC is an action-adventure survival game in which the player takes the form of a crash-landed alien humanoid who is supplied with the basics of what he or she needs to survive and even thrive. Equipped with a multi-tool, the player can follow the on-screen advice from an entity named Atlas.<br>\r\n<br>\r\nThis advice leads the players on a pre-set course, giving them plenty of opportunities to mine for resources, battle or trade and team up with fellow players or aliens (the latter are generated by the servers&#8217; algorithms as needed, much like the more distant parts of the cosmos). <br>\r\n<br>\r\nBut the best way to play is to head off on your own, building the ships and carriers you need to continue your journey as when you need them. See how far you can travel: trading, mining and fighting as you go.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nWhen released in 2016, the game was hailed as something unique and wonderful, though critics complained because many of the promised features were not present. However, the developers have made good on those promises since that first release and those promised features, such as multi player capability, extra building features, etc, are now available.<br>\r\n<br>\r\nThe game operates largely using algorithms that &#8216;create&#8217; the world just ahead of the player&#8217;s progress. This is called progression generation and it is a positive because it uses fewer resources than maintaining a fixed world would. <br>\r\n<br>\r\nIf players travel to the same place at the same time, they will see the same features and colonies. This makes gameplay more authentic, while keeping the data usage relatively low.<br>\r\n<br>\r\n<h3>New Details</h3><br>\r\nThe developers, a company called Hello Games, have worked hard to bring the game up to its original promise with regular updates that make the game more exciting, immersive and fun for all players.<br>\r\n<br>\r\nMultiplayer functionality was the main feature that gamers wanted and this was included in the first major update, shortly after the launch. Improved building enables players to make their home base unique to their own preferences: having an ideal home to protect is a good way for players to feel invested in the game. <br>\r\n<br>\r\nThe developers continue to release updates regularly so you will always have something new and exciting to look forward to. They have learned from the errors of the past, and now only announce the new features once they are sure that they are player ready.<br>\r\n<br>\r\n<h3>Ways to Play</h3><br>\r\nThe game is predominantly a world-building exploration game, with enough interesting missions to keep interest high. Players can choose their level of difficulty so they can simply explore the beautifully depicted space. There are different methods of play to choose, depending on what the player prefers:<br>\r\n<br>\r\n<li>Exploration</li><br>\r\nThe default setting. You take on the character of a crash-landed humanoid alien and set about ensuring your survival and exit from the planet on which you have crash-landed. You are encouraged to use the multi-tool, that all players have as standard, to mine for resources which you then craft into protective gear and transport.<br>\r\n<br>\r\n<li>Survival</li><br>\r\nThis is similar to standard gameplay but with much higher difficulty so if you like maximum excitement and challenge in your gaming this is the mode for you as you will be subject to more hostile attacks and more combat situations than otherwise.<br>\r\n<br>\r\n<li>Combat</li><br>\r\nFull-on battles from the beginning to the end. These usually slot into the player&#8217;s exploration, with battles being more prevalent when this mode is chosen.<br>\r\n<br>\r\n<li>Trading</li><br>\r\nThis mode of play relies more on diplomacy and making deals with the aliens that you come across as you explore the worlds. It is not as easy as it sounds, however, the aliens speak languages which you must work to understand by gathering &#8216;Rosetta stones&#8217; that will help with translations. Misunderstandings can cause friction!<br>\r\n<br>\r\n<li>Multiplayer</li><br>\r\nUp to 16 players can team up to explore new areas of the map and friends can track each other on the map.<br>\r\n<br>\r\n<h3>Endgame</h3><br>\r\nPlay through all the various modes in the format that suits your playing style best, enjoying the beautiful vastness of space and the exquisite landscapes as you travel between planets and settlements to raid, trade and explore the cosmos.<br>', 0, '2021-05-27 22:00:00'),
(24, 'Crusader Kings III', 33, 22.08, 'Paradox Development Studio brings you the sequel to one of the most popular strategy games ever made. Crusader Kings III is the heir to a long legacy of historical grand strategy experiences and arrives with a host of new ways to ensure the success of your royal house.<br>\r\n<br>\r\n<ul class=\"bb_ul\"><li> Choose a royal or noble house from a number of realms on a map that stretches from Iceland to India, from the Arctic Circle to Central Africa.<br>\r\n</li><li> Guide a dynasty through the centuries, ensuring the security and power of each new generation. Gather new lands and titles to cement your legacy.<br>\r\n</li><li> Be a pious king to bring the religious powers to your side, or strike out on your own, designing your own splinter religion and earning everlasting fame or eternal damnation.<br>\r\n</li><li> Knights, peasant revolts, pilgrimages, Viking raiders... experience the drama and pageantry of the Middle Ages.</li></ul><br>\r\n<br>\r\n<ul class=\"bb_ul\"><li> Adopt one of five different lifestyles, perfecting your skills in military strategy or kingdom management.<br>\r\n</li><li> Acquire character traits that will guide your actions, but beware if you act against your nature! The stress from denying your truest self could bring a new host of troubles!<br>\r\n</li><li> Choose appropriate guardians for your heirs, or train them yourself. But what do you do if the legal heir is not quite up to the job?<br>\r\n</li><li> Violent characters may develop a fearsome reputation, cowering your timid subjects into obedience with the dread you inspire.</li></ul><br>\r\n<br>\r\n<ul class=\"bb_ul\"><li> Recruit men-at-arms units and powerful knights to supplement your royal levies.<br>\r\n</li><li> Research new technologies to increase the wealth and military might of your realm.<br>\r\n</li><li> Hire mercenaries and Holy Orders for your major wars. <br>\r\n</li><li> Supplement your income with ransomed prisoners or raiding parties on neighboring realms.</li></ul><br>\r\n<br>\r\n<ul class=\"bb_ul\"><li> Use your spymaster to discover plots against your dynasty and your rule.<br>\r\n</li><li> Recruit agents to assist your schemes to undermine or murder anyone who stands between you and power.<br>\r\n</li><li> Seduce other characters for love or political power.<br>\r\n</li><li> Gather information for blackmailing purposes or call in favors whenever your plans need an extra bit of influence.</li></ul>', 0, '2021-05-27 22:00:00'),
(25, 'Grand Theft Auto V', 96, 9.99, 'Grand Theft Auto V for PC is an action adventure game, the fifth in the GTA series. As with the other games in the series, you score points by committing crimes. The game alternates between third-person narrative and play and first-person play, and you play as three criminals trying to avoid a determined government agency and committing heists. You do not pick just one character to play as, the game&#8217;s narrative jumps from one character to the next.<br>\r\n<br>\r\n<h2>About the game</h2><br>\r\nThe game is set in the fictional town of San Andreas which is based loosely on generic southern California life. While much of the game&#8217;s scripted action takes place in the city, the world is much larger than previous GTA offerings, and players can explore freely. The city lies in Blaine County, near another city, Los Santos (both also fictional) and all areas can be accessed from the beginning of the game.<br>\r\n<br>\r\n<h3>Fully Operational Towns!</h3><br>\r\nHowever, some gameplay needs to be unlocked in the open map area, before you can get the full flavour of what the game has to offer. But it is well worth exploring as you play, or in between the linear missions: Los Santos boasts a fully operational golf course, tennis courts, you can go to the races &#8211; there is even a stock market that you can watch for fluctuations. Movie theatres allow you to watch a movie if you want some downtime, or you help to mug (or save from being mugged) an unsuspecting passer-by, you can collect vehicles, or even rob an armoured van &#8211; whatever you fancy when the situation arises in the game!<br>\r\n<br>\r\nThe story is centred around the heist action and there are plenty of shooting and driving scenarios to keep players engaged and interested. Players use melee attacks, explosions and firearms to defeat their enemies, and can drive, swim, run and jump to move around the world. Exploring the wider world, you can even steal planes and fly over the terrain to cut down travel times.<br>\r\n<br>\r\nThe game is very immersive, almost like an interactive movie rather than a game, with the actions interspersed with plenty of driving conversations and connecting scenes to watch while you wait for your next opportunity to shoot up a bank or commit a heist.<br>\r\n<br>\r\n<h3>If You Can&#8217;t Do the Time&#8230;</h3><br>\r\nYour criminality puts a target on your back so do bear that in mind when being lawless! The worse the crime you commit the higher on the &#8216;wanted&#8217; list you are &#8211; and this impacts on how aggressively law enforcement will behave towards you when they catch up with you. If they do!<br>\r\n<br>\r\n<h3>Make a Feature Film!</h3> <br>\r\nDirector mode is a new feature of this version of GTA, and it allows you to explore the world as any character but with an artistic, creative eye. You can record pieces of footage, then cut and edit it into a short film &#8211; you can do this while still following the narrative arc of the game, or while you are exploring in and around Blaine County. More about Director Mode below.<br>\r\n<br>\r\nBe spontaneous &#8211; you can buy a vehicle and break into the airport to do wheelies on the runway, only to find an easily accessible plane that you can hop into and fly away, off to elsewhere for a completely unexpected adventure!<br>\r\n<br>\r\n<h3>Ways to Play</h3><br>\r\n<li>Single Player</li> <br>\r\nPlayers must complete the linear missions in order to progress in the game, but it is a matter of individual choice as to whether you blast through all the levels to unlock all areas and upgrades for leisurely exploration of the open world later, or if you want to take your time, exploring assets and areas as they unlock as you savour your journey through the game.<br>\r\n<br>\r\n<li>Multiplayer</li><br>\r\nA massive online offering where up to thirty players can join in, more about which on <a href=\"https://www.instant-gaming.com/en/4211-buy-key-rockstar-grand-theft-auto-v-premium-online-edition/\">Grand Theft Auto V Premium Online Edition</a> <br>\r\n<br>\r\n<li>Director Mode</li><br>\r\nAs mentioned above, this way of playing allows you to make movies. You can opt for humorous montages &#8211; slips, trips or close-ups of ridiculous action shots, or let out your inner Spielberg and use the full range of editing and cutting tools to craft high-quality footage. <br>\r\n<br>\r\nThe game is rendered with exquisite attention to detail, from the garbage bags littering the back alleys to the splendour of the sunset caught in character&#8217;s sunglasses &#8211; there is nothing left out and all can be displayed to good effect in your film. However, be warned, if you die while &#8216;filming&#8217;, you lose your footage and have to start again!<br>', 0, '2021-05-27 22:00:00'),
(26, 'Minecraft', 615, 16.89, 'Minecraft Mojang Edition / Java<br>\r\n<br>\r\nMinecraft for PC is the best-selling video game of all time. That alone should be enough to sell you on it, but here’s a bit more information about why you should start playing right now. It is a sandbox game in which players must mine, build, and craft to create their own ideal world.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nThe premise of the game is laughably simple: you arrive in the game with nothing more than your hands and a limited inventory. You mine to gather materials which you then use to make tools and build houses and other buildings. <br>\r\n<br>\r\nResources range from the very common to the super rare, and often the rarest and most valuable commodities are the hardest to reach, requiring deep mining and even the building of reinforced tunnels to keep flood water or rock falls from setting you back.<br>\r\n<br>\r\nThere is no story arc, as such: it is entirely up to you as to what you want to achieve. You can build cities, or a rural mansion, you can farm sheep or go fishing. The game is exactly what you and your imagination want it to be.<br>\r\n<br>\r\n<h3>Some Famous Minecraft Feats</h3><br>\r\nIf you want to see some examples of what the game can do the following are easily findable with a quick Google:<br>\r\n<br>\r\n<li>The Eiffel Tower has been recreated in exquisite and accurate detail in the game. The careful and dedicated player even recreated the beautiful parklands nearby, so you can go and have a look-see around a part of Paris that will make you feel as though you have actually been there</li><br>\r\n<li>Kings Landing from Game of Thrones. It took 175 players two and half years to build the iconic city from the even more iconic television blockbuster. There are also a host of other fictional towns and cities from games (Sonic, Bioshock), popular culture (Star Wars), and books, such as the Lord of the Ring trilogy</li><br>\r\n<li>The medieval town of Chester in the United Kingdom has been painstakingly recreated by a man who lived nearby. He wanted a project to work on with his daughters and the picturesque old town was their favourite place to visit. Hours of careful research and crafting has seen them recreate the city in exquisite detail</li><br>\r\n<li>Working computers and iPhone. A couple of genius players have recreated a working computer – complete with programs that can be run by curious visitors – and an early edition iPhone, complete with touchscreen and apps</li><br>\r\n<br>\r\n<h3>Some Hints for Fun Play</h3><br>\r\nThere are no instructions about how to craft within the game, but there are a huge number of wikis and how-tos online. Find a couple of sites that seem to have all the info you need and keep the tabs open while you’re playing so that you don’t waste too much time should you forget how to craft a specific item or need a bit of info on what to do next.<br>\r\n<br>\r\nWatch out for Creepers! These sneaky fellows will creep up on you (hence the name) utter a short hiss (just long enough to scare the pants off you but not long enough that you can run away) and then explode, killing you and damaging anything in the immediate vicinity. <br>\r\n<br>\r\nIf you do manage to kill a Creeper before they get you, they can drop experience pearls which are valuable and should be gathered without delay.<br>\r\n<br>\r\nOther monsters include spiders, skeletons, zombies, witches, slimes, Endermen and endermites, and more. Each can be defeated in its own way, and learning how to do this can be a steep and thrilling learning curve!<br>\r\n<br>\r\nAnimals and monsters are called ‘mobs’. Not because they throng around you (although they can) but because it is short for ‘mobile’ meaning that they can move around – and even wander away altogether if you are not quick at setting out after them!<br>\r\n<br>\r\n<h3> Ways to Play</h3><br>\r\n<li>Survival Mode: plenty of enemies, this is an exciting and engrossing level to play if you’re looking for some excitement to while away a bit of time.</li><br>\r\n<li>Creative Mode: perfect for those who want to build and see how far they can push their imagination. The world is yours to shape your way!</li>', 0, '2021-05-27 22:00:00'),
(27, 'The Sims 4', 41, 5.89, 'The Sims 4 (Europe) for PC is a life simulation management game, the best-selling game of 2014 and 2015, and at one point topped the charts across all formats. There are many Sims games, from main games like this one to the frequent expansion packs and add-ons: all proving the enduring popularity of the series.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nAs with the other games and expansion packs in the series, you control the life of your Sims completely – or almost completely – as they go through life, buying or building a home, getting a job or getting into the dating scene.<br>\r\n<br>\r\nThere were no defined story arcs in the original game, but later expansion packs and add-ons issued challenges to the Sims, giving them missions to perform or career paths to follow. This game is still largely a sandbox game which gives you plenty of scope to decide what your Sims should be doing with their lives.<br>\r\n<br>\r\nHowever, like children, Sims can unexpectedly resist: some of these traits are more coding issues, such as going on a date and choosing to sit at opposite ends of the bar, shouting through the crowd to get a flirtation going, while others are just apparent personal quirks, like not using the closest bin and walking a minute or two to find another that they like better! These quirks are engaging and keep your interest on the game: it would be dull if everyone just did what they were told!<br>\r\n<br>\r\n<h3>What’s New?</h3><br>\r\nThis game takes place in a different setting to the others in the series, opening up new neighbours and terrains to players, whether new to the series or old hands returning to breath new life into their existing Sims.<br>\r\n<br>\r\nLeft to themselves Sims will naturally multitask now, as long as the dual chores are feasible, listening to music while washing up, or chatting while watching TV. You couldn’t, for example, write a novel and do the ironing at the same time.<br>\r\n<br>\r\nThere are also ‘moodlets’ which put your Sim in a different state of mind: they can be chilled and relaxed, they can be really angry or they can be really excited. This is a great way to make your Sims’ plans feel more real: being excited about a date puts a whole different vibe on the atmosphere of the Sims’ preparations for the date.<br>\r\n<br>\r\n<h3>A Bit of Back-Story</h3> <br>\r\nThe game was inspired by a real-life home-rebuilding exercise. Game developer, Will Wright, lost all his possessions and home in a fire and had to rebuild his entire life from scratch. Going through this process put the idea of a ‘virtual doll house’ into his mind and – after a bit of tweaking – the Sims were born.<br>\r\n<br>\r\nLike many innovative ideas that later seem to have always been a sure thing, Wright was turned down by the first publishers he offered the game to. Fortunately, the second found the idea striking and he was on his way.<br>\r\n<br>\r\n<h3>CAS (Create-A-Sim) System</h3><br>\r\nSims in this incarnation are easier than ever to tweak to make them unique, and you can now make highly detailed customisations, such as:<br>\r\n<br>\r\n<li>Abdomen – flat tummy, concave leanness, or a cute little belly? You decide which your Sim is going to sport</li><br>\r\n<li>Chest – want your male Sims to be big, husky guys, or whippet slender lads? Should you female Sims have moderate cleavage or a great big massive bust? The game allows you to carefully tailor your Sims’ attributes</li><br>\r\n<li>Arms/ Legs – give your Sim long slender limbs so they can run far and reach the highest shelves. Or keep them small and mighty, so even grocery shopping can be a challenge to them! </li><br>\r\n<li>Feet – if you have a thing for feet, then you can go to town on your Sims, giving them perfectly formed, slender feet that you can admire, whether they are in shoes or if they are barefoot</li><br>\r\n<li>Fitness – from gym nut to couch potato, pick a level of fitness for your Sim and let them loose to do their own thing, working out or slobbing around, according to their tastes</li><br>\r\n<li>Fatness – body positivity comes to Sim land. Use the slider to give your Sim some cuddly curves or have them drop ten pounds at the drag of a slider. If only it worked that way in real life! </li>', 0, '2021-05-27 22:00:00');
INSERT INTO `product` (`id`, `name`, `available_stock`, `price`, `desc`, `featured`, `created_at`) VALUES
(28, 'Dead by Daylight', 64, 4.95, 'Civilization VI for PC is a 4X, turn based, empire-building game. 4X stands for eXplore, eXpand, eXploit, eXterminate, and this is a reasonable summary of what the player needs to do in order to take the civilisation from small village to superpower.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nBuild civilisation from tiny village or settlement all the way up to political juggernaut – basically a digital boardgame in which you have to build your empire from scratch into a leader on the world’s stage through trade, deals, battles and much more.<br>\r\n<br>\r\nThe terrain affects your successes, with forest, desert and tundra all having their own advantages and disadvantages to the player, so you will need to adapt your game play to get the best out of the area in which you are playing.<br>\r\n<br>\r\n<h3>New Details</h3><br>\r\nYou can now spread your city around a bit – previously all improvements to a city were stacked into the hex block on which the city was built. <br>\r\n<br>\r\nGives more scope for expansion and gives the player more freedom in the layout of their city<br>\r\n<br>\r\nThe new ‘unstacked’ way allows for cities to be better laid out, and players can earn bonuses for placing appropriate buildings in the right place – for example placing barracks near a training ground is a sensible decision, and is rewarded in the game<br>\r\n<br>\r\nThis is not to say that you can no longer stack items, but it is now somewhat limited and stacking can only happen with similar types of construction<br>\r\n<br>\r\nThe menus are displayed as ‘trees’ and there are trees for many aspects of the game, from Technology to Culture. The latter is new, and allows players to more easily win a game played from a cultural slant – something that was quite tricky in the original incarnation.<br>\r\n<br>\r\n<h3>Ways to Play</h3><br>\r\nThe game rewards players for sensible decisions – building a marina, for example, in the middle of dry land will result in few resources being made available, whereas building it by the water will ensure a steady flow of resources coming your way. There is really only one way to play: you against the game, but here are some tips that will help you if you are just getting started:<br>\r\n<br>\r\n<li>Planning ahead is key</li><br>\r\nAs mentioned above, you will need to consider every move carefully, in every aspect of the game. From where you are going to place a theatre today to leaving enough virgin countryside for a National Park some time far in the future, you have to think about everything!<br>\r\n<br>\r\n<li>Barbarians are smart</li><br>\r\nDo not think that because you caught just one glimpse of a barbarian who then vanished that your city is safe, especially in the early days of construction. Often, they are scouts, assessing whether your city is attackable, and will return before you know it with a horde all set to destroy your careful creation!<br>\r\n<br>\r\n<li>Traders generate roads</li><br>\r\nUse this useful feature to get your infrastructure in place by spreading your traders far and wide. Doing this will ensure that your civilisation benefits from a wide network of roads with very little other effort from you. <br>\r\n<br>\r\n<li>Read the tech and civic trees carefully</li><br>\r\nThese can offer you invaluable advice and can even offer warnings if you learn to read them thoroughly, putting their tips into good practice to build a magnificent civilisation. <br>\r\n<br>\r\n<h3>Endgame</h3><br>\r\nStrategy is the key to succeeding at this game, and you must always be thinking three or four steps ahead of the game at every stage. Filling up the best tiles too soon can leave you short of assets at a later time, so you must plan out your city as carefully as possible, leaving enough space to expand into when necessary.<br>', 0, '2021-05-27 22:00:00'),
(29, 'FIFA 21', 61, 21.49, 'FIFA 2021 for PC is the incredible 28th game in this series. The game developers have had years to reach perfection and as a result there is little that has been interfered with to ruin the well-loved classic. As always, it is the licensing that attracts buyers, and this edition is no different with a staggering 17,000 players from 700 clubs playing in 30 leagues to choose from, swap and transfer and change the fortunes of! This means you could play out an entire season’s worth of games without repeating a player, even in the same team, if you wanted to! <br>\r\n<br>\r\n<h2>So What IS New?</h2><br>\r\nThe ‘footage’ of the gameplay has continued on its quest towards perfect realism – perhaps better than real perfection – and the introduction of agile dribbling (which sounds like a terrible affliction of old age) makes set plays more intense and engaging than ever before. The physics engine has been tweaked to allow for subtle interventions by players, instead of the old 8-direction ‘star’ that previous iterations had the players stuck on. <br>\r\n<br>\r\nThe improved physics engine can be seen in ball movements and flight, with much more nuanced responses to the strength of kicks and throw-ins. The AI is more intelligent too, getting players to respond more authentically to the movement of the ball, taking up defensive or offensive positions without the player needing to micromanage every step of the way, resulting in faster and more fluid gameplay than has been seen before. <br>\r\n<br>\r\nAbsolutely irrelevant to the game and the team, but so much fun that they deserve a special mention are the stadium customisations, crowd chants and tifos that can be used to make your stadium your own. (Tifos are crowd-based displays, often across an entire side of a stadium, such as when each spectator is given a different colour card which, when held up, forms an enormous supportive message.) These little tweaks are ridiculous. But also fun!<br>\r\n<br>\r\nThe soundtrack is excellent and should be enjoyed for its own sake! <br>\r\n<br>\r\n<h3>Modes of Play</h3><br>\r\n<li>Utimate Team – the classic mode features 100 iconic players from retirees, Eric Cantona, Petr Cech, Ashley Cole, Samuel Eto’o, Philipp Lahm, and many more, to all the names we know and love on our fields today. The mode no longer features health and stamina packs, with the player losing these during the game, but being fully restored for the next kick-off. Fitness mini games keep your players in the peak of condition</li><br>\r\n<li>Career Mode – This has been dramatically improved, especially when playing in manager mode, where you can now instantly change players even during the game, when game plans change based on the opposition, weather or any other factor</li><br>\r\n<li>Online play mode – Join in, play your boots off and have fun!</li><br>\r\n<li>Volta Mode – More or less the same street mode as the last release, this mode allows you to get creative in a more informal setting than an official stadium surrounded by the game’s authorities!</li><br>\r\nWhichever mode you prefer, if you are an established fan of the game, and did not want massive changes but rather, just wanted a new comprehensive and up-to-date players list with slight tweaks to playability, this game is perfect for you.<br>', 0, '2021-05-27 22:00:00'),
(30, 'Sea of Thieves', 115, 12.99, 'Sea of Thieves is an action adventure game set on the high seas in which players must set sail across a beautifully rendered ocean. The play of light on water is perfectly captured, and just sailing around looking at the ocean is a good way to kill some time while waiting for your buddies to join in.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nPlayers can play as pirates or as regular sailors from a first-person point of view. When playing as the latter, you are provided with a ship, some companions if you are playing multi-player or co-op, and minimal instructions along the lines of: ‘Sail to an island and bring back something valuable.’ Playing as a pirate is, as you might imagine, lawless and potentially more fun! Track other ships and attack them for their gold and other loot, seizing and taking it to port to cash in for yourself.<br>\r\n<br>\r\nPlaying the game as a sailor, the premise is simple: accept a mission and sail off to an island, using the on-board map to guide you. Once on the island, dig up treasure, fight skeletons or solve a riddle – for all of which you are rewarded should you win. Then return – with your loot if possible – to the home port, and accept another mission to go off all over again.<br>\r\n<br>\r\n<h3>Extras</h3><br>\r\nFor an extra special treat, look out for ship wrecks, which you can go into and retrieve crates of sugar and tea to trade in. There are also sea creatures to overcome, like kraken and megalodons – including a super-rare megalodon called the ‘shrouded ghost’ who must be lured from the deeps with gold. In short, by you throwing your previous treasure overboard.<br>\r\n<br>\r\nThe loot you successfully bring to port can then be sold for gold, which is then used to make (largely cosmetic) improves to your ship’s hull and sails and to your weapons (more about which below) You can cut out the middle man by raiding skeleton forts or attacking other ships and seizing their gold directly.<br>\r\n<br>\r\nSkeleton forts are advertised to every player in the game – a skull-shaped cloud floats above the fortress, attracting the attention of everyone: regular sailors and pirates alike, so be prepared for a bit of a free-for-all when it all kicks off!<br>\r\n<br>\r\nThe game has a fun cartoonish style and emphatic physics engine that allows players to survive the most unlikely stunts – like being shot out of a cannon, for example! Try your limits and see what stunts you can make your character perform.<br>\r\n<br>\r\n<h3>Four Ways with Weapons</h3><br>\r\nPlayers are given four weapons right at the beginning of the game, and these are not upgradeable, putting the emphasis on the fun, rather than the combat scenarios. You are also given a small amount of ammunition, after which you will need to find ammo boxes in order to reload – all but the cutlass!<br>\r\n<br>\r\nThe four weapons are a blunderbuss, a flintlock pistol, a sniper rifle (sneaky for pirates!) and a cutlass.<br>\r\n<br>\r\n<h3>Ways to play</h3><br>\r\nPlayers must learn to steer the ship, navigating to the right spot, hoist and lower the sails and shoot the cannons when necessary. There are, loosely, three ways to play:<br>\r\n<br>\r\n<li>Solo Play</li><br>\r\nThis method of play can be rather quiet as the game is designed for multiple players. The solo player will have to manage sails, anchor, navigation, defence and attack all alone. In the other modes, part of the beauty of the game is allowing other players to make random decisions: as this adds excitement. Without that human uncertainty, the game can feel a little flat although you do have complete control if that is what you like. Solo play offers a smaller ship, a one- or two-sail sloop: as one person can’t operate the bigger three-sail ships.<br>\r\n<br>\r\n<li>Cooperative Play</li><br>\r\nWork with your buddies as a team in this mode: and you have to use that teamwork! The player steering can’t see the map, so the navigator must let them know which way to go, and do so in enough time to avoid islands, rocks and other ships full of players anxious to attack you!<br>\r\n<br>\r\n<li>Multiple Play</li><br>\r\nGet paired with strangers and end up loving them or hating them! You can be a pirate ship and attack other ships instead of going on missions, but do be careful of ‘griefing’ (the in-game equivalent of trolling, harassing other players in an unfair manner) rather than keeping it fun and light-hearted, for example, by hovering near trading ports to ambush players by not giving them a sporting chance of keeping their own loot.<br>\r\n<br>\r\nOh, and – mind out for the sharks. The schools of fish do not react to players or ships, but sharks? Sharks will eat you every chance they get!<br>', 0, '2021-05-27 22:00:00'),
(31, 'ARK Survival Evolved', 76, 24.99, 'As a man or woman stranded naked, freezing and starving on the shores of a mysterious island called ARK, you must hunt, harvest resources, craft items, grow crops, research technologies, and build shelters to withstand the elements. Use your cunning and resources to kill or tame &amp; breed the leviathan dinosaurs and other primeval creatures roaming the land, and team up with or prey on hundreds of other players to survive, dominate... and escape!\r\nDinosaurs, Creatures, &amp; Breeding! -- over 100+ creatures can be tamed using a challenging capture-&amp;-affinity process, involving weakening a feral creature to knock it unconscious, and then nursing it back to health with appropriate food. Once tamed, you can issue commands to your tames, which it may follow depending on how well you’ve tamed and trained it. Tames, which can continue to level-up and consume food, can also carry Inventory and Equipment such as Armor, carry prey back to your settlement depending on their strength, and larger tames can be ridden and directly controlled! Fly a Pterodactyl over the snow-capped mountains, lift allies over enemy walls, race through the jungle with a pack of Raptors, tromp through an enemy base along a gigantic brontosaurus, or chase down prey on the back of a raging T-Rex! Take part in a dynamic ecosystem life-cycle with its own predator &amp; prey hierarchies, where you are just one creature among many species struggling for dominance and survival. Tames can also be mated with the opposite gender, to selectively breed successive generations using a trait system based on recombinant genetic inheritance. This process includes both egg-based incubation and mammalian gestation lifecycles! Or put more simply, raise babies!\r\nYou must eat and drink to survive, with different kinds of plants &amp; meat having different nutritional properties, including human meat. Ensuring a supply of fresh water to your home and inventory is a pressing concern. All physical actions come at a cost of food and water, long-distance travel is fraught with subsistence peril! Inventory weight makes you move slower, and the day/night cycle along with randomized weather patterns add another layer of challenge by altering the temperature of the environment, causing you to hunger or thirst more quickly. Build a fire or shelter, and craft a large variety of customizable clothing &amp; armors, to help protect yourself against locational damage &amp; extreme temperatures using the dynamic indoor/outdoor insulation calculation system!\r\nBy chopping down forests full of trees and mining metal and other precious resources, you can craft the parts to build massive multi-leveled structures composed of complex snap-linked parts, including ramps, beams, pillars, windows, doors, gates, remote gates, trapdoors, water pipes, faucets, generators, wires and all manner of electrical devices, and ladders among many other types. Structures have a load system to fall apart if enough support has been destroyed, so reinforcing your buildings is important. All structures and items can be painted to customize the look of your home, as well as placing dynamically per-pixel paintable signs, textual billboards, and other decorative objects. Shelter reduces the extremes of weather and provides security for yourself and your stash! Weapons, clothing &amp; armor gear can also be painted to express your own visual style.\r\nPick seeds from the wild vegetation around you, plant them in plots that you lay down, water them and nurture them with fertilizer (everything poops after consuming calories, which can then be composted, and some fertilizer is better than others). Tend to your crops and they will grow to produce delicious and rare fruits, which can also be used to cook a plethora of logical recipes and make useful tonics! Explore to find the rarest of plant seeds that have the most powerful properties! Vegetarians &amp; vegans can flourish, and it will be possible to master and conquer the ARK in a non-violent manner!\r\nBy bringing sufficient rare sacrificial items to special Summon locations, you can capture the attention of the one of the ARK’s god-like mythical creatures, who will arrive for battle. These gargantuan monstrosities provide an end-game goal for the most experienced groups of players and their armies of tames, and will yield extremely valuable progression items if they are defeated.\r\nCreate a Tribe and add your friends to it, and all your tames can be commanded by and allied to anyone in your Tribe. Your Tribe will also be able to respawn at any of your home spawn points. Promote members to Tribe Admins to reduce the burden of management. Distribute key items and pass-codes to provide access your shared village!\r\nAll items are crafted from Blueprints that have variable statistics and qualities, and require corresponding resources. More remote and harsh locales across the ARK tend to have better resources, including the tallest mountains, darkest caves, and depths of the ocean! Level-Up your player character by gaining experience through performance actions, Level-Up your tames, and learn new \"Engrams\" to be able to craft Items from memory without the use of blueprints, even if you die! Customize the underlying physical look of your character with hair, eye, and skin tones, along with an array of body proportion modifiers. As you explore the vast ARK, you\'ll find clues left by other Survivors who have made the ARK their home in ages past, in the form of collectible detailed 3D \"Explorer Notes\". By uncovering all of these, you can begin to piece together the true nature of the ARK, and discover its purpose!\r\nEverything you craft has durability and will wear-out from extended use if not repaired, and when you leave the game, your character remains sleeping in the persistent world. Your inventory physically exists in boxes or on your character in the world. Everything can be looted &amp; stolen, so to achieve security you must build-up, team-up, or have tames to guard your stash. Death is permanent, and you can even knock out, capture, and force-feed other players to use them for your own purposes, such as extracting their blood to for transfusions, harvesting their fecal matter to use as fertilizer, or using them as food for your carnivorous tames!\r\nThe mysterious ARK is a formidable and imposing environment, composed of many natural and unnatural structures, above-ground, below-ground, and underwater. By fully exploring its secrets, you’ll find the most exotic procedurally randomized creatures and rare blueprints. Also to be found are Explorer Notes that are dynamically updated into the game, written by previous human denizens of the ARK from across the millennia, creatively detailing the creatures and backstory of the ARK and its creatures. Fully develop your in-game ARK-map through exploration, write custom points of interest onto it, and craft a Compass or GPS coordinates to aid exploring with other players, whom you can communicate with via proximity text &amp; voice chat, or long-distance radio. Construct &amp; draw in-game signs for other players to help them or lead them astray... And yet.. how do you ultimately challenge the Creators and Conquer the ARK? A definitive end-game is planned.\r\nOn the 100+ player servers, your character, everything you built, and your tames, stay in-game even when you leave. You can even physically travel your character and items between the network of ARK\'s by accessing the Obelisks and uploading (or downloading) your data from the Steam Economy! A galaxy of ARKs, each slightly different than the previous, to leave your mark on and conquer, one at a time -- special official ARKs will be unveiled on the World-map for limited times in singular themed events with corresponding limited-run items! Furthermore, you can now design or randomize your own unique \'Procedurally Generated ARKs\', for infinite replayability and endless surprises.\r\nYou can play single-player local games, and bring your character and items between unofficial player-hosted servers, back and forth from singleplayer to multiplayer. Mod the game, with full Steam Workshop support and customized Unreal Engine 4 editor. See how we built our ARK using our maps and assets as an example. Host your own server and configure your ARK precisely to your liking. We want to see what you create!\r\nThe over-the-top hyper real imagery of the ARK its creatures is brought to expressive life using a highly-customized Unreal Engine 4, with fully dynamic lighting &amp; global illumination, weather systems (rain, fog, snow, etc) &amp; true-to-life volumetric cloud simulation, and the latest in advanced DirectX11 and DirectX12 rendering techniques. Music by award-winning composer of \"Ori and the Blind Forest\", Gareth Coker!', 0, '2021-05-27 22:00:00'),
(32, 'Red Dead Redemption 2', 316, 35.49, 'Red Dead Redemption 2 for PC is an action adventure, open world game in which the player can roam freely with some elements playing out in third person, others in first person play modes. The player can commit crimes, but must then be prepared for law enforcement to hunt them down, ready to bring to bear the full weight of the law on the miscreant!<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nRDR2, as the game is affectionately known, was released for other platforms before the PC release, and this saw the game gaining the title of best-selling game of all time, before the PC game figures were included. The reason for the game’s popularity is not hard to see.<br>\r\n<br>\r\nUnlike games where mayhem and destruction are key, this game allows you to sink into the beauty of the Wild West scenery, and to form empathic and sympathetic bonds with other players and NPCs (non-playing characters) in the moments between the action driven sequences – of which there are also many.<br>\r\n<br>\r\nYou play as Arthur Morgan, a member of the Van der Linde Gang, and the linear storyline guides play through set story arcs, with Arthur completing missions and achieving objectives as he goes along, guided by the overall narrative. <br>\r\n<br>\r\nOnce each mission is complete, Arthur is free to wander the open world, exploring widely and uncovering new places and, occasionally, stumbling onto his next mission which he can play through before returning to his original point to continue from there.<br>\r\n<br>\r\nDespite the tightly plotted story arcs, the game is strongly player driven, with your decisions deciding where the game will take you next. You can linger along each journey, catching villains committing crimes, helping people in distress and helping them with side missions, or you can pass them by, ignoring all the NPCs in your determination to get to your next destination.<br>\r\n<br>\r\n<h3>Great Graphics</h3><br>\r\nGiven that the game sets a high consideration on the aesthetics of the game, it will come as no surprise that huge amounts of detail have been put into creating the best looking game play, backgrounds and movement shifts possible. <br>\r\n<br>\r\nShadows and reflections are more detailed and realistic than ever before with higher resolution and sharper definition. Trees, grass and snow all look and ‘feel’ more authentic as you play over them, with subtle alterations in sounds helping to give a realistic impression of the terrain over which you are playing.<br>\r\nMovement is more responsive too, with drawing weapons seeming fluid, and walking, riding and running authentic as far as the graphics and physics engines are concerned.<br>\r\n<br>\r\n<h3>New Features to Look Out For</h3><br>\r\n<li>Horses – there are new breeds of horses for you to catch, tame and ride, including the speedy Warped Brindle Arabian; the Perlino Andalusian, an excellent hunter; the Red Chestnut Arabian, beautiful and fast; and several others. Try them all and see which best suits Arthur’s style of riding, fighting and tracking</li><br>\r\n<li>Guns – there are several guns in this game that were only available in the online version of the first game, including the High Roller Revolver and Le Mat revolver, while the M1899 pistol is entirely new to this game</li><br>\r\n<li>Talismans - keep your eyes open for gadgets and amulets that will give you aid. These include a shark tooth that helps you and your horse work as a team, a turtle shell that increases your health recovery speed (permanently) and a crow beak that boosts your looted ammo (also permanently)</li>', 0, '2021-05-27 22:00:00'),
(33, 'Valheim', 93, 9.99, 'A battle-slain warrior, the Valkyries have ferried your soul to Valheim, the tenth Norse world. Besieged by creatures of chaos and ancient enemies of the gods, you are the newest custodian of the primordial purgatory, tasked with slaying Odin’s ancient rivals and bringing order to Valheim.\r\nYour trials begin at the disarmingly peaceful centre of Valheim, but the gods reward the brave and glory awaits. Venture forth through imposing forests and snow-capped mountains, explore and harvest more valuable materials to craft deadlier weapons, sturdier armor, viking strongholds and outposts. Build a mighty longship and sail the great oceans in search of exotic lands … but be wary of sailing too far...\r\n<strong>Key features:</strong>\r\n<ul class=\"bb_ul\"><li>Huge procedurally-generated world - explore and inhabit mystical lands, from mysteriousforests to imposing snow-topped mountain ranges and stunning meadows, complete with their own creatures of legend to battle and wildlife to hunt.\r\n</li><li>Co-op PvE (2-10 players) - - Whether you want to brave the lands alone or venture with trusted allies, Valheim supports independent, player-hosted servers and unlimited world creation. We recommend playing co-op with 3-5 players.\r\n</li><li>Punishing dodge &amp; block based combat system with a wide range of weapons\r\n</li><li>Build &amp; sail ships - from flimsy rafts to imposing warships, build legendary vessels to conquer the seas and discover new lands.\r\n</li><li>Summon and defeat vengeful primordial bosses of myth and legend, and collect trophies to progress and craft new powerful items\r\n</li><li>Flexible house and base building system - raise mead halls, farms, settlements outposts, castles and more.\r\n</li><li>Intuitive item crafting - forge the finest weapons and armour, and craft food and mead.\r\n</li><li>Dedicated server- for players who want to run a persistent server. If you prefer not to run a server on your PC, consider renting a server at G-Portal. </li></ul>\r\n<strong>Community-translated languages:</strong>\r\nIn addition to the officially supported languages, Valheim has several community-translated languages. As the name would suggest these are all translated by fans and members of the community, and is an ongoing process. <strong>We can\'t guarantee the quality nor completeness of any specific translation effort.</strong>\r\nThe following languages have been partially translated by the community:\r\n<ul class=\"bb_ul\"><li>Svenska\r\n</li><li>Italiano\r\n</li><li>Romanian\r\n</li><li>български\r\n</li><li>македонски\r\n</li><li>Suomi\r\n</li><li>Dansk\r\n</li><li>íslenska\r\n</li><li>Lietuvių kalba\r\n</li><li>čeština\r\n</li><li>Magyar nyelv\r\n</li><li>Português europeu\r\n</li><li>한국어 (불완전한)</li></ul>', 0, '2021-05-27 22:00:00'),
(34, 'It Takes Two', 3, 24.99, 'Embark on the craziest journey of your life in It Takes Two, a genre-bending platform adventure created purely for co-op. Invite a friend to join for free with Friend’s Pass and work together across a huge variety of gleefully disruptive gameplay challenges. Play as the clashing couple Cody and May, two humans turned into dolls by a magic spell. Together, trapped in a fantastical world where the unpredictable hides around every corner, they are reluctantly challenged with saving their fractured relationship. <br>\r\n<br>\r\nMaster unique and connected character abilities in every new level. Help each other across an abundance of unexpected obstacles and laugh-out-loud moments. Kick gangster squirrels’ furry tails, pilot a pair of underpants, DJ a buzzing night club, and bobsleigh through a magical snow globe. Embrace a heartfelt and hilarious story where narrative and gameplay weave into a uniquely metaphorical experience. <br>\r\n<br>\r\nIt Takes Two is developed by the award-winning studio Hazelight, the industry leader of cooperative play. They’re about to take you on a wild and wondrous ride where only one thing is for certain: we’re better together.<br>\r\n<br>\r\n<strong>KEY FEATURES</strong><br>\r\n<br>\r\n<ul class=\"bb_ul\"><li><strong>Pure co-op perfection</strong> — Invite a friend to join for free with Remote Play Together**, and experience a thrilling adventure built purely for two. Choose from couch or online co-op with split-screen play, and face ever-changing challenges where working together is the only way forward.<br>\r\n<br>\r\n</li><li><strong>Gleefully disruptive gameplay</strong> — From rampaging vacuum cleaners to suave love gurus, you never know what you’ll be up against next. Filled with genre-bending challenges and new character abilities to master in every level, experience a metaphorical merging of gameplay and narrative that pushes the boundaries of interactive storytelling. <br>\r\n<br>\r\n</li><li><strong>A universal tale of relationships</strong> — Discover a touching and heartfelt story of the challenges in getting along. Help Cody and May learn how to overcome their differences. Meet a diverse cast of strange and endearing characters. Join forces and go on an adventure you’ll treasure — together!</li></ul><br>\r\n<strong>ABOUT HAZELIGHT</strong><br>\r\nHazelight is an award-winning independent game development studio based in Stockholm, Sweden. Founded in 2014 by Josef Fares (film director and creator of the award-winning game Brothers: A Tale of Two Sons), Hazelight is committed to pushing the creative boundaries of what is possible in games. In 2018, Hazelight released the BAFTA award-winning A Way Out — the first-ever co-op only, third-person action-adventure — as part of the EA Originals program. <br>\r\n<br>\r\n<strong>ABOUT EA ORIGINALS</strong><br>\r\nEA Originals helps shine a light on some of the most passionate, independent, and talented game studios across the globe. Discover innovative and unforgettable gaming experiences from highly creative game makers who love to enchant and inspire.', 0, '2021-05-27 22:00:00'),
(35, 'Star Wars Squadrons', 67, 19.99, 'Master the art of starfighter combat in the authentic piloting experience STAR WARS™: Squadrons. Buckle up and feel the adrenaline of first-person, multiplayer space dogfights alongside your squadron. Pilots who enlist will step into the cockpits of starfighters from both the New Republic and Imperial fleets and fight in strategic 5v5 space battles. Modify your starfighter, and adjust the composition of your squadron to suit varying playstyles and crush the opposition. Pilots will triumph as a team and complete tactical objectives across known and never-before-seen battlefields, including the gas giant of Yavin Prime and the shattered moon of Galitan. Take control of starfighters such as the X-wing and TIE fighter. Customize loadouts and cosmetics. Divert power between weapons, shields, and engines while immersing yourself in the cockpit. In addition, players will have the option to play the entirety of the game in virtual reality (VR)! The cockpit is your home. Use its dashboards to your advantage and — with just a thin hull of metal and glass between you and the perils of space — feel the intensity of combat from a first-person perspective. Take off in thrilling multiplayer modes and a unique single-player STAR WARS story. Immerse yourself in the pilot’s seat completely with the option to play the entirety of STAR WARS: Squadrons in VR.\r\n<strong>STAR WARS™ single-player story</strong> — Learn what it means to be a pilot after the events of Return of the Jedi. Seen from alternating perspectives between 2 factions, iconic and emerging leaders on both sides are battling for the galaxy. The New Republic fights for freedom. The Empire demands order. We need you to join the galaxy’s finest.\r\n<strong>All wings report in</strong> — Plan skirmishes with your squadron in the briefing room before taking off to the evolving battlefields across the galaxy. Compete in intense 5v5 multiplayer dogfights, or unite with your squadron to tip the scales in monumental fleet battles. Together, you’re the galaxy’s finest.\r\n<strong>Master legendary starfighters</strong> — Take control of different classes of starfighters from both the New Republic and Imperial fleets — including the agile A-wing and the devastating TIE bomber. Modify your ship, divert the power between its systems, and destroy your opponents in strategic space dogfights.\r\n<strong>The mission is clear</strong> — STAR WARS: Squadrons is a fully self-contained experience from day one, where you earn rewards through play. Climb the ranks and unlock new components like weapons, hulls, engines, shields, and cosmetic items in a clear path for progression that keeps gameplay fresh and engaging.', 0, '2021-05-27 22:00:00'),
(36, 'Forza Horizon 4', 71, 39.99, 'Forza Horizon 4 is an open world racing game where players compete against other players who are online, but in a way that means that you do not have to engage with them if you feel like some alone time. The game can also be played offline if necessary, if your internet is down, or you feel like going your own way for a bit. <br>\r\n<br>\r\nSet in a fictionalised and truncated version of the United Kingdom, the game is the eleventh Forza game and the fourth in the Forza Horizon series.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nThe version of the UK featured comprises Edinburgh; the Lake District, especially Derwentwater; and the Cotswolds, amongst other beautiful and well-known British places. The game is set amongst predominantly rural settings, namely forests, farmlands and small villages, giving a gentle and intimate feel to your explorations.<br>\r\n<br>\r\nPlayers can choose from up to 450 different cars, and can play in groups of up to 72 players per server, all in a synchronised, shared world. Each vehicle has been individually designed so it ‘feels’ different to the last – you could turn down the difficulty of a particular section or race, or you could have fun switching vehicles until you get the ideal car for that specific race and ace it!<br>\r\n<br>\r\nThere are plenty of side quests, alongside the main story arc, to keep you busy and entertained, each with their own progress bar so you can see how close to completion you are.<br>\r\n<br>\r\n<h3>Getting Started</h3><br>\r\nWhen you first login, there is a prologue series of events that walks players through the game’s many features and introduces concepts like the changing seasons – more about which can be found below. In the prologue, you get to sample a good flavour of the overall game including being able to play each season for five hours or so, easily long enough to enjoy a good sampling of the joys ahead in the full game.<br>\r\n<br>\r\nOnce through the tutorial prologue, you can choose where to go next: exploring the map, trying to run over sheep (fortunately, you will not succeed), or building combos. You can play alone, ignoring the other players on the field, or you can challenge them to Player vs Player contests. <br>\r\n<br>\r\nDo note, even though you can challenge them , you can’t otherwise physically interact with them (and vice versa) unless you are actively grouped together. In other words, if someone wants to upset your win, and tries to drive into you, they will pass harmlessly through you: a relief to anyone doing particularly well on a round that they don’t want messed up by some passing random!<br>\r\n<br>\r\n<h3>To Everything There is a Season</h3><br>\r\nThe game’s main USP is the seasonal changes that occur throughout the whole world at the same time. These fixed seasons mean that all players experience the same climate conditions at the same time, offering a fair playing field and also encouraging players to fully explore the open world sandbox not just once, but four different time, seeing all the differences and difficulties that each season brings.<br>\r\n<br>\r\nFor example, in winter Derwentwater freezes over enabling players to drive onto the ice to reach areas that are otherwise inaccessible. Seasonal changes occur on the Thursday, and each ‘season’ lasts for a week, so there is plenty of time to enjoy the full experience of each climatic change.<br>\r\nTo add even more interest, there are always season specific events going on, including:<br>\r\n<br>\r\n<li>daily bounty challenges</li> <br>\r\n<li>weekly bounty challenges</li> <br>\r\n<li>Unique events which change frequently</li><br>\r\n<br>\r\nThese challenges can range from the almost laughably easy to the very challenging.<br>', 0, '2021-05-28 22:00:00'),
(37, 'The Witcher 3', 11, 11.49, 'The Witcher 3: Wild Hunt GOTY for PC is a bundle of the action role-playing game’s third edition and includes:<br>\r\n<br>\r\n<li>The Hearts of Stone and Blood &amp; Wine expansions, which offer a massive 50 hours of additional storytelling as well as new features and new areas that expand the explorable world by over a third!<br>\r\n<br>\r\n</li><li>Affords access to all additional content released so far, including weapons, armor, side quests, game modes and new GWENT cards!<br>\r\n<br>\r\n</li><li>Features all technical and visual updates as well as a new user interface completely redesigned on the basis of feedback from members of the Witcher Community.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nGeralt is joined by several NPCs along the way, including a couple of lovers, both former and current, who help to fill in the backstory as well as providing useful aid to Geralt on occasion and sending him in the right direction whenever necessary.<br>\r\n<br>\r\n<h3>Fun Facts About This Bundle</h3><br>\r\nThis game ends up with a map size some thirty times the size of that in previous games from the series. This means that there is plenty of sandbox play to be had, and plenty of exploring to do in between completing missions and following the story arc through to its conclusion. <br>\r\nSet aside a good chunk of time to play this game: it can take over fifty hours just to complete the main story arc, with about the same again in side missions and quests.<br>\r\n<br>\r\nEven if you have played the other games in the series, make sure you spend some time putting Geralt through his paces. He has new powers and skills in this game, including a ‘witcher sense’ that helps him to track monsters, find important waystations and sniff out useful weapons and treasures.<br>\r\n<br>\r\nYou can play as Ciri – the first time in the series that the player is given a choice of playing character aside from Geralt. In a way this makes sense as Geralt is The Witcher, which is the name of the game. Fortunately, Ciri is being trained as a witcher herself, so playing as her remains true to the game’s premise.<br>\r\n<br>\r\n<h3>End it Your Way</h3><br>\r\nThere are a number of endings some of which depend on choices the player makes in the ending moments just prior to the end, while others depend on choices made earlier in the game. <br>', 0, '2021-05-28 22:00:00'),
(38, 'Assassins Creed Odyssey', 6, 11.99, 'Assassins Creed Odyssey for PC is the latest in the wide-ranging and popular action role-playing series in which the player becomes an assassin in a certain era. There are, to date, ten main games and seventeen spin-off games as well as a lot of other products, such as books and films. <br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nAs often, with such carefully realised worlds, there are multiple overlapping storylines, some of which the player can heavily influence. The broad storyline deals with the attempt to eradicate an evil Greek cult along with the discovery of evidence of Atlantean creatures and artefacts.<br>\r\n<br>\r\nMeanwhile the more intimate story deals with the character’s attempt to reunite and heal his or her family, having been left for dead in their youth.<br>\r\n<br>\r\nThe game is strongly role-playing, with almost every player’s choice making a difference to the outcome of the quest or mission. The world is highly interactive with plenty of authentic seeming dialogue options, and the opportunity for quests to branch off in a number of ways, which – obviously – provides the option for multiple endings. This means that you can play over areas and quests as often as you like, getting different results each time.<br>\r\n<br>\r\n<h3>Male/ Female: Spartan/ Athenian – the Choice is Yours</h3><br>\r\nThe player chooses to be male (Alexios) or female (Kassandra): a mercenary who is a descendant of the famed Leonidas 1. They have inherited his broken spear and rework the fragments into a new powerful weapon with attendant new powers to be explored and mastered.<br>\r\n<br>\r\nYou join the battle between Sparta and Athens in 431BC, and as you are a mercenary, you can choose to be on either side, according to your preferences. As the game is highly story-driven, your character can have romantic relationships with NPCs (non-playing characters). You can even choose same-sex partners, if you so desire, making the game effortlessly inclusive.<br>\r\n<br>\r\n<h3>Trees and Ships (and sealing wax!)</h3><br>\r\nThe game allows players to develop their skills by filling up skill trees, of which there are three:<br>\r\n<br>\r\n<li>Assassin skill tree: deals with stealth and silent takedowns of enemies</li><br>\r\n<br>\r\n<li>Weapons skill tree: deals with close-up combat using swords, spears and similar weapons</li><br>\r\n<br>\r\n<li>Hunter skill tree: deals with distance combat, such as using a bow and arrow to take down an enemy from far</li><br>\r\n<br>\r\nAs well as these skill trees, each piece of equipment is graded and rated and each provides the player with certain benefits. All of these pieces of gear can be upgraded separately to give the player the maximum benefit in any scenario.<br>\r\n<br>\r\nThe sea combat that was such a hit in Origins has returned, and players can take their battle to the high seas, slicing triremes in half or swinging alongside to board the ship and fight the inhabitants. The ships and setting are appropriate for the game setting so you can indulge in naval combat using Hellenistic-era warships and exploring the Aegean Sea to your heart’s content.<br>\r\n<br>\r\n<h3>A Bit About Gameplay</h3><br>\r\nThe game’s graphics are beautiful and the open world is immense, positively inviting exploration. Each region is depicted so it is distinct from the one before, but all are exquisitely detailed to play through.<br>\r\n<br>\r\nThe player has a lot of agency within the game, and can choose to do things for their own reasons – or for no reason at all! This adds immeasurably to the charm of the game, as it gets you invested in doing things your way and seeing how it all comes out in the long run.<br>\r\n<br>\r\nThe game is a beautiful combination of systems, something that might seem like overkill, but is not. The systems work well to create an engaging world that you will not want to leave until you have filled this metre, mastered that weapon, or just had a look over the hill just there, see?<br>', 0, '2021-05-28 22:00:00'),
(39, 'Assassins Creed Origins', 5, 9.89, 'ASSASSIN’S CREED® ORIGINS IS A NEW BEGINNING<br>\r\n<br>\r\nAncient Egypt, a land of majesty and intrigue, is disappearing in a ruthless fight for power. Unveil dark secrets and forgotten myths as you go back to the one founding moment: The Origins of the Assassin’s Brotherhood.<br>\r\n<br>\r\n<strong>A COUNTRY TO DISCOVER</strong><br>\r\nSail down the Nile, uncover the mysteries of the pyramids or fight your way against dangerous ancient factions and wild beasts as you explore this gigantic and unpredictable land.<br>\r\n<br>\r\n<strong>A NEW STORY EVERY TIME YOU PLAY</strong><br>\r\nEngage into multiple quests and gripping stories as you cross paths with strong and memorable characters, from the wealthiest high-born to the most desperate outcasts.<br>\r\n<br>\r\n<strong>EMBRACE ACTION-RPG</strong><br>\r\nExperience a completely new way to fight. Loot and use dozens of weapons with different characteristics and rarities. Explore deep progression mechanics and challenge your skills against unique and powerful bosses.', 0, '2021-05-28 22:00:00');
INSERT INTO `product` (`id`, `name`, `available_stock`, `price`, `desc`, `featured`, `created_at`) VALUES
(40, 'Days Gone', 20, 31.49, 'INCLUDES:<br>\r\n<br>\r\n•	New Game Plus <br>\r\n•	Survival Mode<br>\r\n•	Challenge Mode<br>\r\n•	Bike Skins<br>\r\n<br>\r\nPC features include ultra-wide monitor support, unlocked framerates and improved graphics (increased level of details, field of view, foliage draw distances).<br>\r\n<br>\r\nDays Gone for PC is an action adventure survival horror game set in a dystopian future in the state of Oregon. The game begins two years after the start of a global pandemic which killed most people and turned a lot of the rest into ‘Freakers’ which are mindless proto-zombies who are nocturnal and constantly evolving throughout the game, which is a great way to prevent the player becoming complacent!<br>\r\n<br>\r\n<h3>About the Game</h3><br>\r\nThe game is played from a third-person perspective with the playing taking on the persona of Deacon St John. Deacon is on a mission to find his wife, last seen being evacuated to a camp later overrun by Freakers. However, Deacon has heard a rumour that his wife’s political influence might have been enough to have her bounced on to an even more secure location – and it is his hope that this is what has happened and that her can find her again soon.<br>\r\n<br>\r\nThe open world game gives you plenty of scope for exploration and you can use all sorts of things to defend yourself: from melee weapons, firearms for long shots and even improvised weapons when you are in a bind. Or, if the pacifist route is your favourite, you can also use stealth to dodge Freakers, and other people. Hostile uninfected humans include cultists called Rippers, and there are various militia and government bodies to assess for friendliness.<br>\r\n<br>\r\nDeacon’s best form of travel is a motorbike, and it is so much more than just his mode of transportation. The vehicle holds much of your inventory, and also allows for ‘fast travel’ without which the game slows to a very sluggish pace indeed!<br>\r\n<br>\r\nThe game has a dynamic day-night system which is highly important to your progress and success, as the Freakers are slow and weak by day, but scarily fast and strong at night – not creatures you want to meet down a dark alley, low on both fuel and ammo!<br>\r\n<br>\r\n<h2>The Nitty Gritty</h2><br>\r\nAs you play along the overarching story-line, there are plenty of missions and side quests to keep you occupied. Finishing missions completes some story lines and opens up other avenues of exploration. Sometimes these story-lines split up on themselves, so you can choose from more than one at a time – ideal if you need to wait for the right upgrade or resource in one thread as you can complete another in the meantime.<br>\r\n<br>\r\nCombat moves feel satisfying and they come with skill trees that helps Deacon in a number of ways, from Deacon’s aim, to fighting melee battles with improvised weapons – these are particularly gory and satisfying. <br>\r\n<br>\r\nThe graphics are great too: Oregon has some truly beautiful scenery with rolling mountains, lush forests and detailed little towns, all of which respond to the weather changes which can jump from beautifully sunny warm days to full-on snow storms – so keep an eye on the clouds!<br>\r\n<br>\r\n<h2>Deacon’s Motorbike</h2><br>\r\nAs mentioned above, Deacon St John’s motorbike is almost a character in its own right, and can benefit from cosmetic customisation at the beginning of the game, and also enjoys a range of power-ups and upgrades along the way. When choosing which upgrades to go for first, try these:<br>\r\n<br>\r\n<li>Fuel capacity. You are not going anywhere without fuel in the tank, and you don’t know when you will get your hands on any more – so make sure a fill up gives you plenty of range!</li><br>\r\n<li>Speed is all you need! Well, not quite – but it is important and makes sure you can fast-travel across the map to complete missions and side quests and get the next chunk of story exposition under way</li><br>\r\n<li>Durability is essential in any dystopia, and your bike is all that stands between you and a much more uncomfortable life, some days, so look after it! Deacon tinkers endlessly with his bike, trying to make it stronger, while every encounter with Freakers or hostiles sees it taking damage that must be repaired promptly so it doesn’t worsen</li><br>\r\n<li>Manoeuvrability is also a good thing, when driving through Freaker hordes, dodging irate militia, and avoiding capture by the Rippers – whose name origins you really do not want to explore!</li> <br>\r\n<li>Ammo storage. The more bullets you have, the easily and clearer you path can be! More ammo is always useful, so make sure you can maximise the amount you carry!</li><br>\r\nPro Tip! Going for the first two items on the list early on in the game, speed and fuel capacity, means that you can quickly make those early milestones without being bored or needing to hunt about for supplies. The other upgrades can come later once you can get where you need to without too much fuss.<br>\r\n<br>\r\nDays Gone for PC is available for purchase on Instant Gaming for a fraction of its retail price. You will receive an official key and be able to play the game in seconds. Play smart. Pay less. <br>\r\n<br>\r\nINCLUDES:<br>\r\n<br>\r\n• New Game Plus<br>\r\n• Survival Mode<br>\r\n• Challenge Mode<br>\r\n• Bike Skins<br>\r\n<br>\r\nPC features include ultra-wide monitor support, unlocked framerates and improved graphics (increased level of details, field of view, foliage draw distances).<br>', 0, '2021-05-28 22:00:00'),
(41, 'Chivalry 2', 198, 24.99, '', 0, '2021-05-29 22:00:00'),
(42, 'Elite Dangerous Odyssey', 39, 23.49, 'Disembark, Commander, and leave your mark&nbsp;on the galaxy in&nbsp;Elite Dangerous: Odyssey. Explore distant worlds on foot and&nbsp;expand the frontier of known space. Be the first to step out onto&nbsp;countless&nbsp;unique&nbsp;planets&nbsp;as&nbsp;you&nbsp;discover land untouched since time began.&nbsp;Elite Dangerous:&nbsp;Odyssey&nbsp;invites you to become a true pioneer.\r\nSee the galaxy like never before. Touch down on breathtaking planets powered by stunning new tech, soak in suns rising over unforgettable vistas, discover outposts and settlements, and explore with unrestricted freedom.\r\nTake on a wide variety of contracts and play your way, from diplomacy and commerce to lethal stealth and all-out combat. Diverse settings, objectives, and NPCs offer endless mission variety and a near infinite amount of content to enjoy.\r\nSocial hubs spread throughout the galaxy give Commanders the ideal place to plan their next move. Form alliances, procure services, and even find expert support in highly coveted Engineers. These public outposts also help you acquire and upgrade weapons and gear to perfect your playing style.\r\nExperience intense first-person combat, kit out your character with an array of weapons and gear, and coordinate with teammates to master a multi-layered, deep, tactical environment where Commanders, SRVs and Starships converge.', 0, '2021-05-29 22:00:00'),
(43, 'Mass Effect Legendary Edition', 74, 34.99, 'One person is all that stands between humanity and the greatest threat it’s ever faced. Relive the legend of Commander Shepard in the highly acclaimed Mass Effect trilogy with the Mass Effect™ Legendary Edition. Includes single-player base content and over 40 DLC from Mass Effect, Mass Effect 2, and Mass Effect 3 games, including promo weapons, armors, and packs – remastered and optimized for 4K Ultra HD.<br>\r\n<br>\r\nExperience an amazingly rich and detailed universe where your decisions have profound consequences on the action and the outcome.<br>\r\n<br>\r\nRELIVE THE CINEMATIC SAGA: Heart-pounding action meets gripping interactive storytelling where you decide how your unique story unfolds.<br>\r\n• Three Games – One Launcher: Play through the single-player base content and over 40 DLC from all three games, including promo weapons, armors, and packs.<br>\r\n• Remastered for a New Generation: Experience the trilogy in 4K Ultra HD with enhanced performance, visuals, and graphics, all available in HDR.<br>\r\n• Visual Improvements on All Three Games: Updates include enhanced models, shaders, FX, lighting, and depth of field plus full-resolution audio.<br>\r\n<br>\r\nEXPERIENCE THE LEGEND OF SHEPARD: Create and customize your own character, from appearance and skills to a personalized arsenal then lead your elite recon squad across a galaxy in turmoil.<br>\r\n• New Shepard Customizations: With improved hair, makeup, eye color and skin tones you can create your Shepard in a unified character creator with all options available across the full trilogy, or choose to play as the iconic Femshep from Mass Effect 3 now available in all titles.<br>\r\n• Gameplay Enhancements for the First Mass Effect™ Game: Enjoy improved aiming and weapons balance, SFX, input/controls, squad behavior, cover behavior, and gameplay cameras.<br>\r\n<br>\r\nREFLECT ON YOUR CHOICES: Your choices seamlessly travel from one game to the next. Each decision you make will control the outcome of every mission, every relationship, every battle – and even the fate of the galaxy itself.<br>\r\n• Performance Mode Options: Choose between \"Favor Quality\" for increased resolution or \"Favor Framerate\" to boost your FPS on consoles.<br>\r\n<br>\r\nINCLUDED CONTENT: Mass Effect™ Legendary Edition includes single-player base content for all three titles (Mass Effect, Mass Effect 2 and Mass Effect 3), your favorite single-player story DLC, promo weapons, armors, and packs:<br>\r\nDLC:<br>\r\n• Bring Down the Sky<br>\r\n• Genesis<br>\r\n• Zaeed – The Price of Revenge<br>\r\n• Kasumi – Stolen Memory<br>\r\n• Lair of the Shadow Broker<br>\r\n• Firewalker Pack<br>\r\n• Overlord<br>\r\n• Normandy Crash Site<br>\r\n• Arrival<br>\r\n• Genesis 2<br>\r\n• From Ashes<br>\r\n• Mass Effect 3: Extended Cut<br>\r\n• Leviathan<br>\r\n• Omega<br>\r\n• Citadel<br>\r\n• Equalizer Pack<br>\r\n• Aegis Pack<br>\r\n• Firepower Pack<br>\r\n• Cerberus Weapons and Armor<br>\r\n• Arc Projector<br>\r\n• ME2 Alternate Appearance Pack 1<br>\r\n• ME2 Alternate Appearance Pack 2<br>\r\n• ME3 Alternate Appearance Pack 1<br>\r\n• Firefight Pack<br>\r\n• Groundside Resistance Pack<br>\r\n• Recon Operations Pack<br>\r\n• Collector\'s Weapon and Armor<br>\r\n• Terminus Weapon and Armor<br>\r\n• M-21 Incisor<br>\r\n• Blood Dragon Armor<br>\r\n• Inferno Armor<br>\r\n• Recon Hood<br>\r\n• Sentry Interface<br>\r\n• Umbra Visor<br>\r\n• N7 Warfare Gear<br>\r\n• AT-12 Raider<br>\r\n• Chakram Launcher<br>\r\n• M-55 Argus<br>\r\n• M-90 Indra<br>\r\n• Reckoner Knight Armor<br>\r\n• N7 Collector\'s Edition Pack', 0, '2021-05-29 22:00:00'),
(44, 'King of Seas', 153, 16.99, '<i>“Cannon shots echo on the seven seas as on the horizon the sun rises on a new dawn of pirates. Drop your moorings, unfold the sails and launch yourself into the heart of the storm shaping your empire. The murder of your father will not be forgiven.\"</i>\r\n<strong>King of Seas is an Action Role playing game set in a deadly procedurally generated pirate world. In a ferocious plot you will fight to regain what has been taken away and embark on an epic adventure in a fantastic world, filled with battles, lost islands and treasures. A universe full of amazing characters and breathtaking missions will keep you anchored as you strive to become the king of all pirates.</strong>\r\n<strong>MAIN FEATURES</strong>\r\n<ul class=\"bb_ul\"><li><strong>Story</strong>: A series of quests guide you on your journey and uncover the intriguing characters of the King of Seas world who will lead you to the next path of your epic adventure.\r\n</li><li><strong>Procedural Generation</strong>: Dive into a lush, procedurally generated world that constantly refreshes the exploration mechanics within each new game.\r\n</li><li><strong>Dynamic World</strong>: The world reacts to your every action, naval routes change and with each conquered settlement the difficulty adapts to constantly give you a more challenging time.\r\n</li><li><strong>Map</strong>: A thick fog will ensure travelling towards objectives is not plain sailing, after all wouldn\'t you want to lose the joy of exploration !?</li></ul><ul class=\"bb_ul\"><li><strong>Navigation system</strong>: Atmospheric effects influence gameplay. Sail during a storm at your own risk, escape the enemies and always remember to carefully watch the wind direction to stay in control during battles. The strategy starts here.\r\n</li><li><strong>Ship customization</strong>: Five types of highly customizable ships through an equipment and skill system, just as in any true role-playing game!\r\n</li><li><strong>Combat system</strong>: Not only cannon shots and nautical strategy but also speed and spectacle, thanks to a set of more than 20 skills to choose from and three branches of talents to suit any playstyle.</li></ul>\r\n<strong>ADDITIONAL FEATURES</strong>\r\n<ul class=\"bb_ul\"><li><strong>Special Missions</strong>: Extra rewards await you upon completion of these secondary missions, each settlement you conquer will be the source of new adventures!\r\n</li><li><strong>Treasure hunt</strong>: Secret maps are hidden in the abyssal depths, find them and obtain directions to submerged treasures!\r\n</li><li><strong>Trading</strong>: Each settlement produces specific products with their own market value. Buy them at the lowest price possible and sell them to other settlements where they are in demand. Buy low, sell high, this is the basis of trade!\r\n</li><li><strong>Fishing</strong>: Find as many as 30 varieties of fish living below the ocean surface. Fish them all but be careful to observe the time of day and weather conditions...\r\n</li><li><strong>Ranking</strong>: Every battle won will drive up the bounty on your head, compare it with the most famous pirates of history. Be the King of Seas!\r\n</li><li><strong>Multiple difficulties</strong>: The difficulty level adds a substantial multiplier to the bounty obtained in the game. How much will you be able to generate in hardcore mode?</li></ul>', 0, '2021-05-29 22:00:00'),
(45, 'First Class Trouble', 94, 8.69, 'First Class Trouble is a party game where players must work together and against each other to survive a disaster.\r\nWhether you play as one of the human Residents or the rebellious Personoids, you will have to use your wit (and the occasional flying champagne bottle) to stay alive. In First Class Trouble you either deceive or deduce your way to victory in a charming, yet unsettling and often mischievous environment. Whether you do it sober or with a slight buzz, First Class Trouble will serve you a dangerous cocktail of difficult decisions and whacky possibilities.\r\nThe goal is to shut down the Central Artificial Intelligence Network, also known as CAIN, of the luxurious intergalactic cruise ship ISS Alithea before it and its loyal Personoids take control of the ship.\r\nCollect information about the passengers and deduce who you can trust and who to avoid. Collaborate with your fellow residents to eliminate the suspected Personoids before engaging in the shutdown of CAIN.\r\nLie, disrupt and deceive your way through the ship among the residents to either reach CAIN and unleash its full potential or kill off the remaining residents to secure control of the vessel. Use your unique skills to communicate and navigate the ship in the shadows and kill off residents when they pose a threat to your identity.\r\nAboard the ISS Alithea, the customization possibilities are endless. Shop for new clothes and accessories in the onboard mall using your hard-earned Infinity Coins. Use your spare cash to pimp that Vroomba (Trademark not pending) of yours!\r\nMore items will be added with new updates.\r\nThe ISS Alithea is the ultimate playground for happy accidents. Explore new ways to eliminate both friend and foe in each level. Environmental hazards such as fires, bad wiring and poorly hanging chandeliers can all be used to get rid of your fellow passengers when you find it convenient.\r\nInteract with your fellow residents and personoids in unlimited, physicalized ways. Whack your friend to the end of the pool with the racket or simply nudge that foe into the fire and look away for a while.\r\n•	Enhance social deduction and interactions through in-game proximity based voice chat, ingame text chat and emote wheel functionality\r\n•	Several levels with unique themes and styles, along with items &amp; interactions specific for them\r\n•	6 player multiplayer', 0, '2021-05-29 22:00:00'),
(46, 'Saints Row The Third Remastered', 788, 19.89, 'Saints Row®: The Third™ - Remastered gives you control of the Saints at the height of their power, and you live the life to show for it. This is your City. These are your rules.\r\nRemastered with enhanced graphics, Steelport the original city of sin, has never looked so good as it drowns in sex, drugs and guns.\r\nYears after taking Stilwater for their own, the Third Street Saints have evolved from street gang to household brand name, with Saints sneakers, Saints energy drinks and Johnny Gat bobblehead dolls all available at a store near you. The Saints are kings of Stilwater, but their celebrity status has not gone unnoticed. The Syndicate, a legendary criminal fraternity with pawns in play all over the globe, has turned its eye on the Saints and demands tribute.\r\nRefusing to kneel to the Syndicate, you take the fight to Steelport, a once-proud metropolis reduced to a struggling city of sin under Syndicate control. Take a tank skydiving, call in a satellite-targeted airstrike on a Mexican wrestling gang, and fight against a highly-trained military force by your lonesome in the most outlandish gameplay scenarios ever seen.With enhanced graphics, improved lighting, reworked environments, and visual effects, Steelport and The Third Street Saints have never looked so good.\r\n<strong>City of Sin</strong> - Disrupt and dismantle the Syndicate stranglehold on weapons, cybercrime, and criminal rackets. Discover the secrets of Steelport, where there is action on every street corner, for better or, more likely, worse.\r\n<strong>Weapons of Crass Destruction </strong>– It’s one thing to defeat your enemies. It’s another to humiliate them. Hover jets, human cannonball cars and outrageous melee weapons are all part of the fun.\r\n<strong>Crazy Character Customisation </strong>– Create the most outlandish characters ever seen, from washed-up celebrities to maskless ninja pirates. Inside every sinner, there is a Saint. Who will you become?\r\n<strong>Over The Top Co-op </strong>– Fly solo or play online with a homie. Give freefall skydiving a try, landing in your partner’s flaming pickup as you make a desperate run toward a heavily armed Syndicate base. Steelport is always more fun with a friend.\r\n<strong>All DLC included</strong> – All three expansion mission packs and more than 30 pieces of DLC* from the original version.', 0, '2021-05-29 22:00:00'),
(47, 'Empire of Sin', 212, 9.99, 'Empire of Sin is a new strategy game brought to you by Romero Games and Paradox Interactive that puts you at the heart of the ruthless criminal underworld of 1920s Prohibition-era Chicago. Slip into the shoes of one of the fourteen real and historically inspired mob bosses such as Al Capone, Stephanie St. Clair, or Goldie Garneau and assemble a rag-tag gang, build and manage your criminal empire, and defend your turf from rival gangs. It’s up to you to hustle, charm, and intimidate your way to the top and do whatever it takes to stay there - break a leg! Roleplay: Choose one of fourteen unique bosses based on fictional and real-world gangsters, then set out to build and manage your criminal empire in Chicago’s infamous Prohibition era. Empire Management: Build your Empire of Sin and run Chicago’s underworld economy with business savvy, brutality or city-wide notoriety. Strategically manage your establishments such as speakeasies, supply chains, casinos and more. Turn-Based Combat: Assemble your gang and slug it out in turn-based combat to defend and expand your territory – or send a message to opposing gangs.', 0, '2021-05-29 22:00:00'),
(48, 'Evil Genius 2', 56, 26.58, 'Evil Genius 2: World Domination for PC is a fun and exciting game. After all, what more can you want from life but to construct a criminal lair capable of creating a doomsday device, all under the guise of a casino! The setting being underneath a volcanic island in the middle of the Pacific is a true thriller given! <br>\r\n<br>\r\n<h3>About the Game</h3><br>\r\nThe power of three is strong in this game – choose from three islands (each with different assets and attributes) and power your minions up using one of three classes – muscle, deception or science – although you do get to choose to be one of four evil geniuses during the character customisation stage! <br>\r\n<br>\r\nYour minions all have different character traits which can serve them well on your behalf, such as observant minions picking up on suspicious behaviour by other minions and potential intruders. Send them to commit crimes and complete missions to gather gold so you can keep building the device and expanding your lair. As you go, you can test your doomsday device in any part of the world, trying to dodge the Forces of Justice who are out to foil your plans. <br>\r\n<br>\r\nAs you play alone, side quests unlock specialist minion powers or loot items which come in handy. Your minions can go into high alert mode – perhaps after one of the observant ones spots something dodgy! Your ultimate aim is, of course – as the title implies! – world domination, and the deployment of your doomsday device weapon of mass destruction which will, with luck, force the Forces of justice into abject surrender! <br>\r\n<br>\r\n<h2>The Nitty Gritty</h2><br>\r\nUnusually for such games, you can immediately lay out all the rooms of your secret base, incorporating everything from a café for your minions to your Genius’s gold-plated rumble room. One of the more fun parts is mining out the rooms using laser cannons which you then use to place your furniture and fittings too! Talk about explosive interior design that looks good! <br>\r\n<br>\r\nThere are two paths of play: firstly, defence of your stronghold and, secondly, establishing a criminal network across the world. <br>\r\n<br>\r\nYour actions draw heat down on you and while at first you can despatch the bumbling detectives and spies with ease, they soon level up and start giving you serious headaches, with some apparently able to walk through your toughest security in a heartbeat, which is frustrating to say the least. <br>\r\n<br>\r\nIn true mad-genius-bent-on-domination style, you can set traps like giant fans, plunge pools, shark-infested of course, freeze rays, and laser grids – or just let them loose at the casino tables and watch them lose every penny! Missions include stealing the Declaration of Independence or kidnapping fellow crime bosses and other fun pastimes. <br>\r\n<br>\r\nThe graphics are excellent too, with fabulous animation makes it a delight to watch the game unfold. There is some waiting around for things to happen, but if you gather resources as quickly as you can, you can start working on your doomsday device which occupies a decent amount of time. Playing sandbox mode gives you immediate access to plenty of resources which is great if the natural pace of the regular game has become too frustrating for you!<br>\r\n<br>\r\n<h2>Four Villains to Embrace</h2><br>\r\nPlay as one of the following and embrace your inner villain:<br>\r\n<br>\r\n<li>Hulking brass-bedecked Red Ivan (played by the stentorian Brian Blessed)</li><br>\r\n<li>Goodie turned villain Emma (voiced by Samantha Bond who is usually on the side of good, such as when playing Miss Moneypenny in the earlier Bond films)</li> <br>\r\n<li>The gold hungry dictator Maximillian (voiced by Glen McReady) whose purpose in life is creating a Midas machine to turn everything to gold!</li> <br>\r\n<li>Mad scientist Zalika (voiced by the lovely Rakie Ayola) who is determined to perfect brain control to make people think better thoughts – however, be warned though, this tactic never works in real life, as some people seem to need to just always be miserable!</li>', 0, '2021-05-29 22:00:00'),
(49, 'Zombie Army 4 Dead War', 772, 29.98, 'Hitler’s hordes are back for more in this spine-chilling shooter from the makers of Sniper Elite 4! Abominable occult enemies, epic weapons and a harrowing new campaign for 1-4 players await in 1940s Europe, as you fight to save humankind from undead Armageddon!<br>\r\n<br>\r\n<strong>Shocking New Campaign</strong><br>\r\nThe resistance have defeated Zombie Hitler and cast him into Hell – but the dead rise once again with greater hunger than before!<br>\r\nContinue the alternate history of Zombie Army Trilogy in huge new levels, and uncover a sinister plan that takes the Survivor Brigade across Italy and beyond!<br>\r\nFight the forces of darkness in corpse-riddled canals, survive a Zombie Zoo, and journey to dark, inexplicable places no person has been before…and lived to tell the tale!<br>\r\n<br>\r\n<strong>Award-Winning Gunplay</strong><br>\r\nExperience the genre-defining ballistics Rebellion made famous in the Sniper Elite series, and put it to good use against the shambling hordes of the damned!<br>\r\nUpgraded Kill Cams and Dismemberment<br>\r\nThe X-Ray Kill Camera returns! Watch in gory-ous slow motion as bullets, bombs and more destroy bones and organs in X-ray. Marvel as your bullets tear off a rotten limb or two, and shiver as the dead KEEP COMING!<br>\r\n<br>\r\n<strong>Deep Progression and Customisation</strong><br>\r\nBuild the slayer that suits you as you rank up! Fancy yourself a guardian angel? Take damage for your teammates! Like that turret so much? Why not take it with you? Then kill in style as you unlock new outfits, emotes and taunts!<br>\r\n<br>\r\n<strong>Killer Melee</strong><br>\r\nWhen the dead surround you, fight back with enhanced melee combat! Barge through crowds, stomp on heads and dispatch the living dead with fearsome takedown moves!<br>\r\n<br>\r\n<strong>Epic Weaponry</strong><br>\r\nHarness the power of fire, lightning, and divine essence to upgrade your guns at workbenches, and create homespun hell raisers! An assault rifle that shoots lightning? A pistol with a flaming Bayonet? Anything goes in humankind’s last stand!<br>\r\n<br>\r\n<strong>Monstrous Multitudes</strong><br>\r\nTake on legions of ghoulish grabbers, hulking armoured elites, terrifying shadow demons, explosive suicide generals and a host of other surprises! When you’re staring down the fleshy barrel of a ZOMBIE TANK, you’ll wish you’d stayed behind the sofa!<br>\r\n<br>\r\n<strong>Bigger, Badder Horde Mode</strong><br>\r\nExtend your SLAYcation in the expanded Horde Mode. The longer you survive, the bigger the map gets. How long can you fight back without joining the horde of the LIVING DEAD?<br>\r\n<br>\r\n<strong>Extend Your Slay-Cation!</strong><br>\r\nWant more? Additional seasons of Zombie Army 4 are out now! Unveil the secrets of the occult in the new 3-part ‘Hell Cult’ campaign and face off against the terror of the skies in the horrifying ‘Death From Above’! From extra missions to new characters, weapons and more, get ready to blow apart your undead foes in new and terrifying ways!', 0, '2021-05-29 22:00:00'),
(50, 'Project Wingman', 0, 14.89, 'Project Wingman is a combat flight action game with an emphasis on polished and refined gameplay, true-to-its-roots inspirations, and an engaging single player experience. Perfect for those who aren\'t looking for a simulator experience, with the ease of pick up and play, all the way to those who want a fast-paced challenging flight action game.\r\nDogfight, strike, and fly through combat zones based off an alternate history of Earth. Either over the cold waters of the Bering Strait, attacking tanks in the brutal environments of Yellowstone magma fields, or diving through the Redwoods to strike targets of opportunity in the Pacific Northwest, across the oceans, above the scarred lands of the world, this war will take you from exotic battlefield to exotic battlefield, all while going up against odds way above your pay grade.\r\n<strong><u>Pure Combat Flight Action</u></strong>\r\nExotic weaponries such as railguns and geothermal-powered armaments will be ready to pluck you out of the sky if you\'re careless. Whether you are an attack aircraft pilot, skimming the ground with a gatling gun and rocket launchers attached to your wing, or an interceptor with long range, almost sniper-like missiles at your disposal, it will be up to you to prove yourself as an Ace pilot.\r\n<strong><u>Conquest Mode</u></strong>\r\nIn Conquest Mode, fight in an uphill battle against various bosses and ace squadrons in a territory capture game, drawing elements from roguelikes and RPGs. Players will have to earn enough money to not only purchase new aircraft, but build a mercenary army of their own in order to take on waves of increasingly difficult opposition as they struggle to take on a myriad of changing missions.\r\n<u><strong>Virtual Reality </strong></u>\r\nVirtual Reality headsets will work in-game to put the player in the cockpit of aerial warfare, immersing themselves in head-swiveling combat. Combine this with full compatibility with HOTAS peripherals and custom axis curves, and you will be able to experience the game however you want, using any DirectInput supported peripheral you like.<ul class=\"bb_ul\"><li>Fly in varied and exciting scenarios and locations unlike you\'ve ever seen before\r\n</li><li>Engaging single player campaign\r\n</li><li>Over 20 different aircraft and over 40 unique weapons at your disposal\r\n</li><li>Fight different kinds of adversaries such as giant mechanized fortresses and railgun cannons\r\n</li><li>Test your skills in Conquest mode and fight against hordes of adversaries\r\n</li><li>Want a different Conquest experience? - Adjust it with modifiers to your liking\r\n</li><li>Beautiful 3D Volumetric clouds rendered with TrueSKY\r\n</li><li>Fully rebindable controls and HOTAS compatibility with DirectInput support\r\n</li><li>VR Support</li></ul>', 0, '2021-05-29 22:00:00'),
(51, 'Nickelodeon Kart Racers 2', 48, 9.99, 'Nickelodeon Kart Racers is back and we’re kicking it into overdrive! In Nickelodeon Kart Racers 2: Grand Prix, you can select from 30 playable racers and 70 team members to assemble your ultimate pit crew. Choose your favorites from Nickelodeon’s hall of fame, including JoJo Siwa, SpongeBob SquarePants, the Teenage Mutant Ninja Turtles, the babies from Rugrats, the cool kids from Hey Arnold!, Ren and Stimpy, Lincoln Loud and his sisters, and more! More Characters + More Karts + More Tracks = MORE FUN! First, speed your way across a variety of Slime-filled tracks in a fun series of races where you can win highly-coveted cups and over 80 upgrades for your Kart! Then, shift into the next gear and challenge your friends in online multiplayer or in local arena multiplayer to see who can cross the finish line first or handle the wild arena challenges! There’s no slowing down - on your marks, get set, Slime! - Largest collection of Nickelodeon characters ever in a Kart game! - 100 beloved Nick characters to choose from - 30 playable racers and 70 crew members that each have unique powers designed to help you win - Strategize your ultimate pit crew to increase your level of attack, defense, or fun! - Tens of thousands different all-star character combinations - Local multiplayer up to 4, and online multiplayer up to 8 - New and improved racing engine for best in class racing fun! (Controller required for local Multi-Player modes)', 0, '2021-05-29 22:00:00'),
(52, 'Per Aspera', 134, 10.99, 'The surface of Mars is littered with Humanity’s failed attempts to colonize its surface. This time will be different - this time there is no room for human error.\r\nPer Aspera is a planetary simulation game that combines hard science fiction and base building and takes the experience planet-wide. Step into the role of AMI, an Artificial Consciousness with the prime directive of terraforming Mars for human colonization.<ul class=\"bb_ul\"><li>Balance a complex well of resources to build interconnected structures that span the entire planet.\r\n</li><li>Customize your planet with branching research trees that allow players to tailor their terraforming plan — Develop new technologies, steeped in real-world science, to create a thriving interplanetary civilization.\r\n</li><li>Uncover the mystery of a threatening presence on Mars and defend your colonies from unknown and combative forces.\r\n</li><li>Immerse yourself in a rich, compelling narrative or take your time and craft the perfect Martian landscape with Sandbox Mode.\r\n</li><li>Includes the immersive voice acting talents of Troy Baker, Phil LaMarr, Laila Berzins, Yong Yea, Lynsey Murrell, and Nneka Okoye.</li></ul>\r\nUsing scientific theories proposed by real space agencies and geographical data directly from NASA, Per Aspera presents life-like conditions and challenges steeped in theoretical science.\r\nPer Aspera contains a rich narrative that presents players with difficult decisions with planet-wide consequences. See the world through the eyes of an infant AI as it traverses a complicated ocean of self-discovery and shapes the fate of the human race. Navigate your ever-evolving programming to adapt to morally challenging concepts and forge relationships with the human colonists that look to you for their continued survival. The choices you make will impact how your mission ultimately concludes.\r\nKeep your wits about you as this is not the first time humans have tried to tame the Red Planet. Expose long-forgotten relics of Humanity’s failed attempts, learn from their past mistakes, and uncover a looming menace that threatens to see you fail at any cost.', 0, '2021-05-29 22:00:00'),
(53, 'Immortals Fenyx Rising', 59, 28.89, 'Immortals: Fenyx Rising for PC was originally called Gods and Monsters in its work-in-progress stage, but had to be changed after a legal challenge from an energy drink manufacturer. The game’s premise was announced (under that earlier name) some two years before the finished Fenyx was released. It is a third-person action adventure video game, and features the eponymous Fenyx, a Greek soldier who was stranded on the Golden Isle – an amazing beautiful land populated with the Greek gods of ancient myth.<br>\r\n<br>\r\n<h2>What’s the Story?</h2><br>\r\nFenyx’s crew – including his own big brother – are nowhere to be found, and Fenyx soon realises that not only is he trapped by himself on the island, but it is under attack from Typhon, a mighty titan who has escaped his prison in the darkest depths of Tartarus and wants to take over all of Olympus, to which end he has already imprisoned four of the gods who usually live there. Fenyx must find and release them, fighting his way across the island and working to achieve his goals.<br>\r\n<br>\r\nOr her goals – Fenyx can be male or female and is fairly well customisable, allowing you to change Fenyx’s hair and skin colours and numerous other details to end up with a personalised figure that is uniquely your own.<br>\r\n<br>\r\nThe game is narrated by the chief god himself, Zeus, and the human who stole fire from the gods, Prometheus. While the two have a chequered history, for the purposes of this game they are like a pair of mildly antagonistic frenemies, making sweeping claims and then being forced into backtracking it by the other!<br>\r\n<br>\r\nTheir banter is more than just entertainment (although it is excellent), it can actually affect the game. For example, if Zeus says, ‘That monster is tiny!’ while Fenyx is battling a beast, it becomes tiny, giving Fenyx huge advantage over it – but only until Prometheus chimes in with, ‘No, it’s not, it’s one of the biggest I’ve ever seen!’ with rather alarming results for poor Fenyx! <br>\r\n<br>\r\n<h3>The Nitty-Gritty</h3><br>\r\nThe game is family friendly with no gore following combat, no matter how many mythical beasts and creatures are despatched by Fenyx’s impressive array of weaponry. Slain creatures just dissolve into an unthreatening cloud of dust before vanishing. <br>\r\n<br>\r\nHaving said that, it is not an easy walk-through for older players and adults. There are plenty of combat techniques, power-ups, and weapons to learn, as well as different ways to attack. Occasionally, in between battling a minotaur or cyclops – or Typhon himself, you will have to solve puzzles that help you advance in your explorations across the island, and these range from easy to satisfying brain-testing. <br>\r\n<br>\r\nThis makes the game one that is actually perfect for the whole family, challenging and testing older players, amusing and teaching younger ones, and all in an engaging and compulsive world that makes you want to play through the storylines on offer. For example, whenever you meet Achilles, check out his feet. If you know the myth, you’ll get it – if you don’t, it’s not too serious and does not impact on the game play in any way.<br>\r\n<br>\r\nThere are plenty of such nods to the myths, all told in a fun and engaging way, and each god or goddess reacts and speaks in a way appropriate to their mythic selves – and Zeus, of course, has to muscle in or comment on many of these conversations, allowing for a lively bit of bantering interaction between the gods, while Fenyx watches and listens, wide-eyed! <br>\r\n<br>\r\n<h3>Good to Know</h3><br>\r\nThe island/ archipelago is divided into various regions, with each being dedicated to one particular god that Fenyx must find and restore after Typhon’s capture and imprisonment. You can move around, ride tame animals (having tamed them first!) Once you have mastered the first island, you will have discovered the component parts and instructions for repair of a set of wings, originally designed by Daedalus, of course. This allows you to explore further afield, where you gain the gratitude of the gods who reward you with: <br>\r\n<br>\r\n<li>The Sword of Achilles</li><br>\r\n<li>The Axe of Atalanta</li><br>\r\n<li>A Power Dash from Athena</li><br>\r\n<li>A Spear from Ares</li><br>\r\n<li>A Hammer from Haephestus</li><br>\r\n<li>The Bow of Odysseus</li><br>\r\n<li>The Braces of Heracles</li><br>\r\nYou will also gather bits and pieces of Zeus’s lightning bolts to power up and get stronger as you play through this delightfully cartoony but engaging game, with Phosphorus, the magical Phoenix, as your constant companion and aide.<br>', 0, '2021-05-29 22:00:00'),
(54, 'Chronos Before the Ashes', 0, 16.39, 'Chronos: Before the Ashes is an atmospheric RPG that chronicles a hero’s lifelong quest to save their homeland from a great evil. Grow wiser, stronger and more powerful as you explore the depths of the mysterious labyrinth. But beware, the labyrinth takes a heavy toll – each time your hero dies, they lose a year of their life! Adventure RPG - Refreshing combination of Adventure Game elements and RPG mechanics. Deep Combat – A variety of weapons, abilities and powers are available to the player in the pursuit of their quest. Unique Aging Mechanic – Every time the player dies they age one year. Player’s must adapt to their advancing age as they progress their character; starting the game young, nimble and quick, and ending wise and more attuned to magic.', 0, '2021-05-29 22:00:00'),
(55, 'HUMANKIND', 0, 31.99, 'Humankind for PC is a 4x game for those who have secretly always craved world domination. 4x stands for explore, expand, exploit, exterminate, and is usually applied to those games where the players work to increase their base from a tiny subsistence smallholding to a major civilisation. <br>\r\n<br>\r\nThis game is one of those, stretching through six eras from a nomadic existence to the heights of glorious civilisation. <br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nYou begin by choose one of ten paths of development to follow, growing and succeeding as you progress. The game is fairly flexible compared to some of its contemporaries, in that you can try out a path of progress and then change it if it seems not to be working out. Another point to bear in mind is that neighbouring civilisations will influence your people and make demands of you.<br>\r\n<br>\r\nWhen this happens, you can choose to submit to their requests, or double down and take out your neighbours, subjugating them to your will! If you want to fight other peoples for their possession, resources and land, you can ransack them, fight them for their mines or simply claim the land by building an outpost – but be careful as it is all too easy to find yourself an accidental warlord if you are too successful!<br>\r\n<br>\r\nAt the end of each era, you choose from another 10 cultures, accurately showing how empires and cultures rise, flourish and then give way to the next big thing. At every transition, your existing culture does not die away completely. Instead, you carry enough traits and features from your current way of life to create an accurate and unique melting pot. <br>\r\n<br>\r\nYou can customise your own appearance quite minutely, but you will always be an imaginary person as you cannot take on the persona of a real historical character, as the real world that shaped them offers vastly different influences and ideas in your world.<br>\r\n<br>\r\n<h3>Build Your Celebrity</h3><br>\r\nThe game is engrossing as it is not simply a numbers game where sheer numbers will win out – you can have a small army and limited resources, but still outfox a larger army with cunning, careful thought and planning. This encourages you to scout out the terrain, spot natural bottlenecks and encourage your soldiers to never give up, never surrender!<br>\r\n<br>\r\nYou cannot ‘win’ per se, but you can succeed by being famous! Score points by building ‘Fame’ which you do, firstly, by building holy sites, discovering world wonders, or other ‘world deeds’, as all of these are known, or, secondly, by earning era stars. As mentioned above, the game is very flexible, so you can change the way you play if your strategies aren’t working out, or if you think of a better way to do it. <br>\r\n<br>\r\nWith era stars, there are a total of 126 stars available to you over the course of the game, at a rate of 21 stars per era. You must earn at least 7 stars in each to be able to proceed to the next level. Earn stars by researching technologies, killing enemies and, as in real life, earning money. <br>\r\n<br>\r\nThere are a 60 total cultures in the game, ten for each era. The various cultures include, amongst others: Egyptians, Greeks, Nubians, Libyans, Romans, Hittites, Harrapans, Babylonians, Assyrians, Germans, and Chinese, giving you a wide and diverse range of cultures to choose as you build and expand your civilisation.<br>\r\n<br>\r\n<h3>Authoritarian or Liberal: You Choose</h3><br>\r\nThere are sliders to choose world outlook of your country, and with each twitch to one side or another you will create an impact on the country’s smooth running. Unlike in real life, which is much more nuanced, in the game, extremes can give more benefits, but otherwise these sliders give a reasonable overview of how societies work.<br>\r\n<br>\r\n<li>Geopolitical outlook – are you a nationalist patriot or a global villager?</li><br>\r\n<li> economics – rampant I-got-mine capitalism or a more communal society? </li><br>\r\n<li> culture – strict old-fashioned values or the embrace of progress?</li><br>\r\n<li> government – authoritarian dictator or liberal lovie?</li>', 0, '2021-05-29 22:00:00'),
(56, 'Age of Empires II', 60, 7.83, 'Age of Empires II: Definitive Edition for PC is the twentieth anniversary re-release of the real time strategy game which retains all the charm and popularity of the original release, but combines it with twenty years’ worth of improvements to the gaming world: ultra-high definition graphics, vastly improved gameplay and visuals and four new civilisations as well as a new single-player campaign called The Last Khans. <br>\r\n<br>\r\n<h2> About the Game</h2><br>\r\nThe major change in the programming can be found in a curious choice that players must make early in the game: whether or not to opt for the old AI as an opponent or to go for the new AI, an updated version designed specifically for the Definitive Edition release. <br>\r\n<br>\r\nYou may think that there should not be any real difference between the two, but the old AI was built literal generations ago when it comes to video gaming advances, and it actually needed to cheat in order to win! This was no doubt frustrating – and may still be so should you choose this option! <br>\r\n<br>\r\nThe new AI is sophisticated enough and has enough computing power not to need to cheat, which means that if the player is defeated, it is at least an honest win on the part of the CPU! However, a little caveat: when the two types of AI were played against each other, the new one easily defeated the old, so perhaps a canny player with ingenuity – and some luck – can beat the old system more easily than the new! The only way to find out is to try it both ways. <br>\r\n<br>\r\nA few systems have been tweaked to make the game more streamlined, such as being able to leave villagers in charge of farms – so there is no longer any need to return every season and tell them what to do, your farms will just replenish themselves at a steady rate. Pathfinding and managing large armies is also improved, with intuitive pathfinding coming into its own, so you can march along without any headaches while expanding your empire. <br>\r\n<br>\r\n<h3>Four New Civilisations</h3><br>\r\nThe four new civilisations mentioned above are as follows: <br>\r\n<br>\r\n<li>Bulgarians: These warlike cavalry-based soldiers advanced on the Danube valley in the 7th century, bringing with them not just domesticated horses, but stirrups that potentially changed the face of war in ancient Europe. Build forts, advance through passes, fend off invaders and attackers and take great pride in your Konnik warriors who fight first on horseback, and then on foot, and very probably from the ground as they take their dying breaths.</li><br>\r\n<li>Cumans: Nomadic tribes whose animal husbandry in the inhospitable reaches of the coldest steppes made them both feared and admired throughout the region, the fearsome, horse-back riding troops can be deployed against nearby cities to gain loot, power and territory, or they can be hired out as mercenaries to the highest bidder, fighting bloody battles to the death and boosting the reputation of anyone who has them under their command!</li><br>\r\n<li>Lithuanians: Band together the shy and secretive Baltic peoples who live in the swampy and dangerous lands into a fearsome and impressive army, under the name of the largest Duchy to be seen in late medieval Europe. Individually imposing, an army of these warlike people is a sight to cause even the bravest kings to quail!</li> <br>\r\n<li>Tatars: Fly across the plains of central Asia and Mongolia with your Great Khan as leader, riding horses as easily as walking on your own feet, wearing arrow proof armour made, almost magically, from smooth silk, attacking, retreating and advancing with a speed and mobility that modern armies would genuinely envy, against enemies who are unprepared and disbelieving of the Tatar skills in combat.</li>', 0, '2021-05-29 22:00:00');
INSERT INTO `product` (`id`, `name`, `available_stock`, `price`, `desc`, `featured`, `created_at`) VALUES
(57, 'Assetto Corsa', 134, 4.49, 'NEXT GENERATION RACING SIMULATOR\r\nAssetto Corsa features an advanced DirectX 11 graphics engine that recreates an immersive environment, dynamic lighthing and realistic materials and surfaces. The advanced physics engine is being designed to provide a very realistic driving experience, including features and aspects of real cars, never seen on any other racing simulator such as tyre flat spots, heat cycles including graining and blistering, very advanced aerodynamic simulation with active movable aerodynamics parts controlled in real time by telemetry input channels, hybrid systems with kers and energy recovery simulation. Extremely detailed with single player and multiplayer options, exclusive licensed cars reproduced with the best accuracy possible, thanks to the official cooperation of Car Manufacturers.\r\nASSETTO CORSA has been developed at the KUNOS Simulazioni R&amp;D office, located just inside the international racing circuit of Vallelunga, allowing the team to develop the game with the cooperation of real world racing drivers and racing teams.\r\nLEGENDARY TRACKS\r\nThe circuits have been developed using Laser scan technology, in order to guarantee the highest level of accuracy possible in reproducing real world motor racing environments.\r\nMonza, Silverstone, Imola, Mugello, Spa, Brands Hatch and many more tracks, including the historical reproduction of Monza, that brings again to life the legendary Sopraelevata, the high-speed oval where races were staged until 1961.\r\nEXCLUSIVE CARS\r\nThe Assetto Corsa physics engine is all new, using practical knowledge acquired from working closely with the elite of motorsport in order to engineer the best possible accuracy of physics and tactility of feeling.\r\nA physics engine like this begs to be used with officially licensed contents: Abarth, Audi, BMW, Classic Team Lotus, Ferrari, KTM, Lamborghini, Lotus cars, McLaren, Mercedes, Scuderia Glickenhaus, Pagani, Porsche, Tatuus and many more!\r\nHARDWARE COMPATIBILITY\r\nEnjoy ASSETTO CORSA using any kind of game device: keyboard, joypad, joystick, steering wheels including any kind of professional device and the most common motion systems.\r\nASSETTO CORSA is also compatible and ready for Oculus and OpenVR/VIVE, triple monitor view, Track IR and 3D VISION.\r\nGAMEPLAY &amp; FEATURES\r\nAssetto Corsa includes a career mode, a list of special and unique events and challenges, as well as a fully customizable, single player and multiplayer modes featuring quick races, custom championships, race weekends including free practice session, qualifying session and race. Drag races, drift challenges and much more! Four driving assist profiles (gamer, racer, pro, plus a fully-customizable profile) allow any kind of player to enjoy the simulation at their desired level.\r\nAdvanced setup options and telemetry for data analysis; dynamic simulation of the tyre rubber deposited on track, depending on the car laps; an adjustable time of the day mode, featuring sun position calculated in realtime, depending by geographical coordinates of the track and by the sun curve according to time and date, in order to get the same light conditions of the real tracks!\r\nMODDING &amp; CUSTOMIZATION\r\nAssetto Corsa will allow for considerable customisation and modification, in order to satisfy the expectations of professional simracers, gamers who prefer to approach the driving experience more progressively, and hobbyists who just like to reproduce and share their cars and tracks, taking advantage of the same editing tools developed and used by the developers of the game.\r\n<strong>CARS</strong>\r\nPRODUCTION\r\n- Abarth 595 EsseEsse (3 variants)\r\n- Abarth 500 EsseEsse (2 variants)\r\n- Alfa Romeo 33 Stradale\r\n- Alfa Romeo Giulia Quadrifoglio\r\n- Alfa Romeo Giulietta QV\r\n- Alfa Romeo Giulietta QV Launch Edition\r\n- Alfa Romeo MiTo QV\r\n- Audi Sport Quattro (2 variants)\r\n- Audi S1\r\n- Bmw 1M (2 variants)\r\n- Lamborghini Miura S.V.\r\n- Lotus Elise SC (3 variants)\r\n- Maserati Alfieri\r\n- Maserati Quattroporte GTS\r\n- Maserati Levante S\r\n- Mazda MX-5 NA\r\n- Porsche Panamera G2\r\n- Porsche Cayenne Turbo S\r\n- Porsche Macan Turbo\r\n- Shelby Cobra\r\n- RUF CTR Yellowbird\r\n- Toyota GT-86\r\n- Ford Mustang 2015\r\n- Chevrolet Corvette C7 Stingray\r\nGT\r\n- Bmw M3 E30 Evo (3 variants)\r\n- Bmw M3 E30 Group A\r\n- Bmw M3 E30 DTM\r\n- Bmw M3 E92 (3 variants)\r\n- Bmw Z4 E89 (3 variants)\r\n- Lotus Evora GTC\r\n- Lotus Evora GX\r\nGTR\r\n- McLaren MP4-12c GT3\r\n- Bmw Z4 GT3\r\n- Bmw M3 GT2\r\n- Ferrari 458 GT2\r\n- P4/5 Competizione\r\n- Mercedes SLS GT3\r\nCLASSIC GP\r\n- Classic Team Lotus Type 49\r\n- Classic Team Lotus 98T\r\n- Ferrari 312T\r\nRALLY\r\n- Audi Sport Quattro S1 E2\r\nENDURANCE\r\n- Mazda 787B\r\nSUPERCAR\r\n- Audi R8 Plus\r\n- Ferrari LaFerrari\r\n- Ferrari 458 Italia (2 variants)\r\n- Ferrari F40 (2 variants)\r\n- Ferrari 599xx\r\n- Lamborghini Huracán Performante\r\n- Lamborghini Sesto Elemento\r\n- McLaren Mp4 12c\r\n- Mercedes SLS AMG\r\n- Nissan GTR NISMO\r\n- Pagani Zonda R\r\n- Pagani Huayra\r\n- Pagani Huayra BC\r\n- Lotus Evora S (2 variants)\r\n- Lotus Exige S Roadster\r\n- Lotus Exige Scura\r\n- Lotus 2 Eleven GT4\r\nTRACKDAY\r\n- KTM X-Bow R\r\n- Lotus 2 Eleven\r\n- Lotus Evora GTE\r\n- Lotus Evora GTE Carbon\r\n- Lotus Exige 240R (2 variants)\r\n- Lotus Exige V6 Cup\r\nOPEN WHEEL\r\n- Tatuus FA-01\r\n- Lotus Exos T125 (2 variants)\r\n<strong>TRACKS</strong>\r\n- Laguna Seca\r\n- Magione - \"Autodromo dell\'Umbria\"\r\n- Imola - \"Autodromo Enzo e Dino Ferrari\"\r\n- Mugello - \"Autodromo Internazionale del Mugello\"\r\n- Silverstone - GP\r\n- Silverstone - International\r\n- Silverstone - National\r\n- Silverstone 1967\r\n- Monza - \"Autodromo di Monza\"\r\n- Monza - \"Classic 60\'s Edition\" (3 variants)\r\n- Nurburgring - GP\r\n- Nurburgring - Sprint\r\n- Spa Francorchamps\r\n- Vallelunga - \"Autodromo Piero Taruffi\"\r\n- Vallelunga - Circuito Club\r\n- Zandvoort\r\n- Trento - Bondone Hillclimb\r\n- Drift Track\r\n- Drag strip\r\n- Black Cat County (fantasy track)\r\n- Highlands (fantasy track)\r\n<strong>SHOWROOMS</strong>\r\n- Standard showroom\r\n- The Beach\r\n- Hangar\r\n- Industrial\r\n- Sunset\r\n<strong>GAME MODES</strong>\r\n- Free Practice\r\n- Racing against AI\r\n- Career\r\n- Custom championship\r\n- Online Multiplayer\r\n- HotLap\r\n- Time Attack\r\n- Special Events\r\n- Drift\r\n- Drag race\r\n<strong>FEATURES</strong>\r\n- In game telemetry and apps\r\n- Advanced car setup management\r\n- Flags\r\n- Penalties\r\n<strong>APPS LIST</strong>\r\n- Basic info\r\n- Chat app\r\n- Tyre app\r\n- Real time app\r\n- Help\r\n- Lap time\r\n- Pit stop presets\r\n- Friends Leaderboard\r\n- Camera On Board Customization\r\n- Time of the day display\r\n- Input monitor\r\n- Time performance indicator\r\n- Gear/rpm indicator\r\n- Track map\r\n- Rankings\r\n- G-meter indicator', 0, '2021-05-29 22:00:00'),
(58, 'Cities Skylines', 65, 2.56, '<strong>Cities: Skylines</strong> is a modern take on the classic city simulation. The game introduces new game play elements to realize the thrill and hardships of creating and maintaining a real city whilst expanding on some well-established tropes of the city building experience. You’re only limited by your imagination, so take control and reach for the sky!\r\nConstructing your city from the ground up is easy to learn, but hard to master. Playing as the mayor of your city you’ll be faced with balancing essential requirements such as education, water electricity, police, fire fighting, healthcare and much more along with your citys real economy system. Citizens within your city react fluidly, with gravitas and with an air of authenticity to a multitude of game play scenarios.\r\nColossal Order\'s extensive experience developing the Cities in Motion series is fully utilized in a fully fleshed out and well-crafted local traffic simulation.\r\nBe more than just an administrator from city hall. Designating parts of your city as a district results in the application of policies which results in you rising to the status of Mayor for your own city.\r\nThe city changes during the hours of the day and affects citizen schedules. Traffic is visibly slower at night and some zoned areas do not work with full efficiency. Cities: Skylines will put you in control of managing the different aspects of the day and night cycles.Build or improve on existing maps and structures. You can then import your creations into the game, share them as well as download the creations of other city builders on the Steam workshop.', 0, '2021-05-29 22:00:00'),
(59, 'Monster Hunter World', 3396, 12.89, 'Monster Hunter: World for PC is an action role-playing game in which the player tracks and hunts various monsters and animals and mythical creatures using a variety of weapons. The game is played from the third person point of view.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nThe protagonist, the Hunter, starts off with limited supplies and a very basic weapon inventory. He or she must track animals or monsters and slay them, taking their treasure and body parts to build stronger weapons and better assets. This, in turn, means they can go after bigger and stronger prey: and so the game goes, bigger animals resulting in bigger weapons.<br>\r\n<br>\r\nThe loose premise of the game is to track the Elder Dragon to a new continent – this is the main story arc of the whole game. However, the side quests and learning how to craft and upgrade your weapons are highly important, so the overall story becomes mere background to all the adventures and hunts along the way.<br>\r\n<br>\r\nOnce the story mission is completed, the game unveils a second half to the story, one that is more challenging and therefore more fun for the player. Side quests wait in the menu to be completed when you so desire.<br>\r\n<br>\r\nPlayers can, if they want to, simply explore the scenery, which is simply stunning on large PC screens. Locations from the hand-held version, namely Ancient Forest, Wildspire Waste and Coral Highlands, have made the transition to the PC version, and the developers have made the most of the improved graphics capability. <br>\r\n<br>\r\nDo be careful though, you might be attacked as you stand there admiring the exquisite sunset or the realistic jellyfish!<br>\r\n<br>\r\nThe game offers up to fourteen weapons, ranging from swords to hammers and everything in between. All of these weapons are upgradeable, and all will give a slightly different ambiance to the game play. Players must take the time to learn how to use the weapons as there is no useful tutorial to talk you through it in the heat of the moment.<br>\r\n<br>\r\n<h3>New Details</h3><br>\r\nThe Hunter is accompanied by a companion assistant, a feline creature called Palico – a portmanteau of ‘pal’ and ‘calico’ (a type of cat) – who travels alongside, offering what advice and assistance he can.<br>\r\n<br>\r\nTracking animals is made easier with luminescent scoutflies, who track the signs of prey. The Hunter must gather more clues to the beast’s whereabouts and once he or she has enough information, the scoutflies place a marker on the map, enabling the Hunter to navigate to that spot to commence the hunt.<br>\r\n<br>\r\nOnce an animal, monster or mythical beast has been spotted, the Hunter will be provided with a basic pop-up, providing minimal information about the creature. <br>\r\n<br>\r\nHowever, the more the Hunter interacts with the animal, examining it, a sort of in-game wiki lets you know which parts should be harvested and some interesting details about the creature.<br>\r\n<br>\r\nThe weapons are not only complicated to use, but they are also tricky to craft. However, once the process has been completed, the weapon becomes a strong asset, both useful and a sort of journal of the quests you undertook to create it. <br>\r\n<br>\r\nThe game map is immense, and has been divided into six zones for ease of navigation. However, there are no barriers or transition points going from one to the other, to move from one to the other is quite seamless.<br>\r\n<br>\r\n<h3>Ways to Play</h3><br>\r\n<li>Explorer</li><br>\r\nWork your way methodically through map, gathering everything that you can and investing the time in mastering each new asset. There are some help menus, but the game has quite high expectations of player investment: and it is worth it to spend some time on each aspect.<br>\r\n<br>\r\n<li>Dasher</li><br>\r\nIf you are easily bored by the methodical and studious, you can dash about the map, choosing destinations on a whim or following your instincts to see what lies around the next bend.<br>\r\n<br>\r\n<li>Solo</li><br>\r\nThis one is self-evident, referring to playing by yourself, free to explore whenever and wherever it suits you.<br>\r\n<br>\r\n<li>Multiplayer</li><br>\r\nTeam up with your buddies or make friends from strangers as up to four players can team up via online servers to explore the world and capture beasts.<br>\r\n<br>\r\n<h3>Endgame</h3><br>\r\nAs mentioned elsewhere, the loose story arc is to catch up to the Elder Dragon. But it is hard to say that this is the endgame – it seems very much to be just the beginning of a long, satisfying quest to explore the entire map!<br>', 0, '2021-05-29 22:00:00'),
(60, 'Farming Simulator 19', 177, 11.39, 'Farming Simulator 19 for PC marks the tenth year of the Farming Simulator games, and the twelfth incarnation across all gaming platforms. The game has a unique following amongst those who love the series, and this version offers some exciting new options.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nPlayers work at tasks that simulate real life farming tasks, from breeding the best livestock, to growing crops for cash, general good farm management is a must to help the player sell assets that are created on the farm.<br>\r\n<br>\r\nPrevious versions of the game have included animals like sheep, pigs, cows and chickens: this version has added horses, due, it is said, to popular demand. Crops include brand new cotton and oats alongside wheat and corn (or grains), soybeans, root crops like potatoes, as well as poplar, sugar cane, silage, hay and grass. All the crops and animals have different needs, and must be managed in slightly different ways to the others, giving you plenty of interest in raising a variety of crops and animals. <br>\r\n<br>\r\nA big plus for this version of the game is the introduction of, alongside the horses, cotton and oats, as mentioned above, high-end branded machinery, including the well-known John Deere, alongside the likes of Komatsu and Rau, not to mention Wilson trailers.<br>\r\n<br>\r\n<h3>Play for Zen in Three Exciting Worlds</h3><br>\r\nThe beauty of the game is that much of the work is endlessly repetitive: lots of ploughing, sowing, watering, and reaping. This means that the game is basically a grind game, but this is its attraction to the many players who adore it: the repetitive actions have a charm all their own, being almost therapeutic. <br>\r\n<br>\r\nThere is, however, enough variety with seasonal changes and with taking on new farming tasks, like raising animals or changing the crops being grown to keep the game fresh and interesting. You are even impelled, occasionally, to change your vehicle from time to time as well as performed basic maintenance tasks like refuelling: all of which ensures that your interest remains high and the game does not become boring.<br>\r\n<br>\r\nThere are three distinct open worlds to play in, each having significant differences to the others. Try them all before picking your favourite to grow your ideal farm, complete with crops and animals.<br>\r\n<br>\r\n<h3>How to Get Started</h3><br>\r\n<li>Start from scratch</li><br>\r\nBuild your farm up from nothing, clearing the ground, sowing the seed and slowly expanding the terrain as you build the assets that allow you to do so.<br>\r\n<br>\r\n<li>Begin in the middle!</li> <br>\r\nCheat the system slightly by starting with an already established, moderately sized farm that has initial crops in place and a system just waiting for you to pick up the reins.<br>\r\n<br>\r\n<li>Manage for the big guy</li><br>\r\nGet right ahead of the game and start off managing a bigger farm rather than owning your own smaller one. This option gives you access to assets that you might otherwise not be able to get your hands on for a while.<br>\r\n<br>\r\n<li>Multiplayer</li><br>\r\nInvite your farming enthusiast friends to come along and farm alongside you. Six people working together makes farm chores a breeze, and you can even invite people from up to fifteen other farms to join up for a huge farming extravaganza.<br>\r\n<br>\r\n<li>Career Mode</li><br>\r\nWill take you along the path of a long term farmer, moving gracefully through the seasons, slowly building your farm to the peak of profitability as you go. Meanwhile, Mission Mode offer shorter term satisfaction. Complete tasks, such as mowing or delivering cargo for cash. These tasks have time limits and will earn a bonus for early completion: see how many bonuses you can earn.<br>', 0, '2021-05-29 22:00:00'),
(61, 'The Elder Scrolls Online', 65, 5.99, 'Included: <br>\r\n<br>\r\nThe Elder Scrolls Online: Morrowind DLC<br>\r\nThe Full Elder Scrolls Online Base Game<br>\r\n<br>\r\nThe Elder Scrolls Online for PC is a massively multiplayer online role-playing game (MMORPG) that is part of the Elder Scrolls series and the first multiplayer offering from the game. Set on the fictional continent of Tamriel – as are all the other games in the series – the game is not directly linked to any of the others, being instead a standalone offering in a world that would be familiar to regular players but still accessible to newcomers.<br>\r\n<br>\r\nMore than ten million people have played the games since its initial release, and around a million people per month are registered as playing their way through the game at any point.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nPlay is non-linear with players able to choose quests from a smorgasbord of options. You can roam freely around the world, playing sandbox style and stumbling across the secrets of Tamriel and choosing to help with quests or not, as you like. Alternatively, you can accept every quest that is offered, and watch out for random events, taking advantage of the chance to gather prizes by winning your way to the top of the leader board.<br>\r\n<br>\r\nThere are two simultaneous conflicts going on: a battle for the Imperial Throne which will offer the winner power over all Tamriel, and a fight against Prince Molag Bal, a Daedra, who must be stopped from completing his mission. The player can take his or her time over completing these tasks, exploring far and wide and ignoring these twin calls to action until they are ready to get to work on them.<br>\r\n<br>\r\n<h3>How to Play</h3><br>\r\nYou begin play along with many others, trying to retrieve your soul from Molag Bal, and manage to escape from his clutches. From there, you can play your way around the world, gathering equipment and completing missions until you attain level 10. At this point, competitive play is possible, and you are given more information and deeper missions with every gain of five levels.<br>\r\n<br>\r\nAs with many MMORPGs you will spend a lot of your time battling other players as they try to beat you to the treasure or simply off you because you’re in their way. Keep your inventory well stocked and make sure your weapons are easily to hand and that you know how to use them, or else you risk facing an untimely demise along with all the attendant annoyances that come with sudden death.<br>\r\n<br>\r\n<h3>Pick Your Species and Race</h3><br>\r\nThere are ten different races, each of which fall under one of three species. They are as follows:<br>\r\n<br>\r\n<li>Human Races: Nords, Redguards, Bretons, Imperials – these human races work well together and have distinct differences in how they look, ranging from skin colour to mode of dress</li><br>\r\n<li>Elvish Races: Dunmer (Dark Elves), Altmer (High Elves), Bosmer (wood Elves), Orsimer (Orc Elves) – elves are also known as the ‘mer’ and they are much longer-lived than humans, with lifespans of up to two or three hundred years. Perhaps because of this, they are conditionally fertile, only becoming so when populations drop too low and a birth-rate boost is required to restore population levels</li><br>\r\n<li>Bestial Races: Khajiit, Argonians – as the name sounds, beastfolk are chimera, sentient half-men half-beast beings. They vary greatly, even amongst themselves, much like comparing mammals amongst themselves. They have unusual metabolisms, skeletal structures and powers, and any player who chooses to be one of these characters must take a moment to learn the advantages and disadvantages of the beastfolk form they have chosen </li><br>\r\nAlong with these choices, players must also pick classes and skill sets for their characters. Each choice affects the abilities and talents of their avatar, strengthening them in certain areas and weakening them in others: so do be careful to choose wisely!<br>', 0, '2021-05-29 22:00:00'),
(62, 'Far Cry 5', 84, 9.79, 'Far Cry 5 for PC is a crazy fun action-adventure first person shooter in which you must be on your guard against weird and wacky opponents. Animals and enemies will try and take you out, while other animals and strangers might randomly take out those enemies for you. As the name implies, everything is a far cry from reality!<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nYou take on the part of a rookie sheriff’s deputy, going along with your colleagues to effect an arrest. Your mission is to arrest a cult leader named Joseph Seed who has a nasty habit of kidnapping people to force them to join his doomsday cult. <br>\r\n<br>\r\nThe planned arrest, a joint mission between the Sheriff and his men and the US Marshals goes awry and Joseph Seed and his cult scatter into the bush, swearing hideous punishment on those who have interfered with them. A helicopter crash kills off some of your colleagues, leaving you to track the cultists and Seed down. <br>\r\n<br>\r\nThe attempted arrest leads Seed to begin his end game, he and his followers believing that end times are upon the world. They are prepared to kill everyone in the county in order to ‘save’ their souls for eternity: it is your mission to track them down to minimise the death toll.<br>\r\n<br>\r\nIt is an open world format, meaning that you can freely explore wherever you want to wander, collecting items that might be useful to you along the way – these can include big ticket things like planes and helicopters, as well as food, weapons and survival packs.<br>\r\n<br>\r\n<h3>New Details</h3><br>\r\nThis incarnation of the game offers a much wider range of melee weapons than before, allowing players to find their perfect weapon and hone their skills with it, before unleashing it on the enemy.<br>\r\n<br>\r\nThe physics engines have been dramatically improved. For example, bullets fired over long distances now drop with every hundred metres or so, as is true in real life. Therefore, long shots need to be pitched upwards slightly, in order to counteract this authentic feature.<br>\r\n<br>\r\n<h3>Ways to Play</h3><br>\r\n<li>Solo</li><br>\r\nPlay alone, wandering far and wide in the world, and watching all the excitement as it goes on around you and sometimes starring you! You can explore the map, go on a blood thirsty killing spree or simply find a quiet place by the river to fish. <br>\r\n<br>\r\nDo be aware though, that given the nature of the game, even a quiet moment fishing can turn into a blood bath with no warning!<br>\r\n<br>\r\n<li>With a Friend</li><br>\r\nMeet up with a buddy who is also online and team up to explore together, covering each other from enemy fire, and working together to bring down big game and large groups of cultists.<br>\r\n<br>\r\n<li>With a Virtual Companion</li> <br>\r\nThere are nine AI companions to choose from: namely, a bear, a mountain lion, a dog, and various people. The people are very talkative, while the bear is great for taking out enemies, and dog can scent cultists and other animals long before you are aware, they are there. <br>\r\n<br>\r\nYou can also take along a ‘gun for hire’ or a specialist, such as a sniper for sneaky stealth attacks on distant outposts, to add to your firepower.<br>\r\n<br>\r\n<h3>Endgame</h3><br>\r\nUnlike most games, there are three endings to play out<br>\r\n<br>\r\n<li>Deputy Says No</li> <br>\r\nIf the deputy declines to press on with arresting Joseph Seed, Seed forgives him while taking the deputy’s companions into the cult, often under the influence of Bliss, a hallucinogenic drug that ensures a certain amount of compliance. It is widely used by the cultists to kidnap people.<br>\r\n<br>\r\n<li>Deputy Arrests Seed</li><br>\r\nIf the deputy goes ahead with the arrest, all hell breaks loose – the vehicle carrying the arrested Seed in it crashes, killing almost everyone. <br>\r\n<br>\r\nThe Deputy loses consciousness, only regaining it once Seed has carried him to a cabin, handcuffing him securely. Seed declares that the deputy is his family now, as the cult is destroyed.<br>\r\n<br>\r\n<li>Secret Ending</li><br>\r\nObscurely, this ending occurs near the beginning of the game, should the Deputy decline to arrest Joseph Seed in the first instance, then the cataclysmic events that play out in the normal storyboard simply do not happen. <br>\r\n<br>\r\nInstead, the group leave well enough alone, and Seed is left unmolested – and all the deputies and US Marshals get to live to fight another day.<br>', 0, '2021-05-29 22:00:00'),
(64, 'Dark Souls II', 80, 6.99, 'Gamers are in for a big surprise in DARK SOULS™ II: Scholar of the First Sin. An unforgettable journey awaits you in a breathtaking world where each dark corner and unexpected encounter will test your resolve. Go beyond what you thought was possible and discover incredible challenge and intense emotional reward. Whether you’ve previously played DARK SOULS™ II, or are new to the award-winning franchise, you are in for an entirely different experience with this exclusive, “Director’s Cut” version of the game.\r\n- The definitive edition of DARK SOULS™ II. DARK SOULS™ II: Scholar of the First Sin includes all the DARK SOULS™ II content released to-date in one package and much more!\r\n- A brand new experience and challenge. Enemy placement has been overhauled, resulting in a completely different play dynamic than experienced before. The safe zones that some players remembered are no longer safe! A new NPC invader called Forlorn will also play a key role in changing the gameplay experience. Hardened players will have to forget everything they thought they knew about DARK SOULS™ II.\r\n- Online play has been enhanced with the addition of a special item to regulate souls acquired in battle - it’s now possible to match up more consistently online. The number of players who can participate in an online session has also been increased, from 4 to 6 people, completely changing the online play dynamic.\r\nDARK SOULS™ II: Scholar of the First Sin brings the franchise’s renowned obscurity &amp; gripping gameplay to a new level. Join the dark journey and experience overwhelming enemy encounters, diabolical hazards, and unrelenting challenge.', 0, '2021-05-29 22:00:00'),
(65, 'Human Fall Flat', 14, 4.99, 'Human: Fall Flat for PC is a platform puzzle game that is perfect for those with a quirky sense of humour and a knack for seeing things a little differently. The animations are comedic even as the puzzles can be fiendish and you will spend hours alternately chuckling at your character’s antics or cursing as you try to work out how to solve the current puzzle.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nYou control a shapeless humanoid figure called Bob – they are all called Bob! – as you work your way around the game. Each level consists of getting Bob to the exit where he enters the next level and does it all over again.<br>\r\n<br>\r\nBob has no special powers he is all human, and must navigate around the levels in a very human fashion: no flying, no death-defying leaps or gravity defying gliding to avoid larger than usual gaps.<br>\r\n<br>\r\nInstead, Bob must use what is around the landscape to enable him to climb, jump and otherwise get around the obstacles in his way. Various secrets are hidden that offer tutorials on how to tackle new challenges: these can include stacking boxes, learning to climb up walls, navigate ledges and even how to make walls crumble so you can get through to the other side.<br>\r\n<br>\r\n<h3>Customising Bob</h3><br>\r\nBob is something of a blob at first, vaguely humanoid but featureless and sporting only a baseball cap which is sort of built into his general shape. However, playing co-op mode or multiplayer doesn’t have to be confusing, each player can customise Bob their own way. <br>\r\n<br>\r\nBob can be dressed in a variety of clothing – you can even get your fellow players to emulate the Village People if you want to! – or you can dress him in any way you choose. <br>\r\n<br>\r\nOr Bob can stay naked! You can paint his skin any colour you like, including stripes, polka dots or a smiley face. You can put war-stripes on him, or just paint his cap: the Paint style customisation tool lets you do your own thing with your Bob.<br>\r\n<br>\r\n<h3>Ways to Play</h3><br>\r\n<li>Single Player – Potentially the most difficult way to play, you have to take Bob through the puzzles by yourself, working out solutions, fetching and moving objects that will help you and plugging away at tricky manoeuvres until you have mastered them well enough to get to the end of the level</li><br>\r\n<li>Co-op Mode – Your Bob and your friend’s Bob can work together to puzzle out how to get to the exit in the quickest and safest manner, as you enjoy watching their antics and help each other out. Bob’s death-grip works on other Bobs, so if one of you has mastered a particular climb or swing, just have the other one grab hold and be carried safely across</li><br>\r\n<li>Multiplayer Mode – Up to eight of you can work to solve puzzles as a group. The word group fits better than ‘team’ as some of the other players can work against the others, throwing away boxes needed for climbing, selfishly using ropes needed by all of you, or doing other mildly annoying things of that ilk. Mildly annoying as items tend to respawn or be plentiful, and there are usually multiple ways to get to a solution</li><br>\r\n<li>Pro Tip: In co-op mode and multiplayer mode, your Bob can hang onto other players to swing across or to be piggybacked up a climbing wall. In this game, multiplayer is definitely more fun – the more Bobs there are slapping sticky hands onto walls, splatting down cliffs and puzzling their marshmallow heads over solutions, the more enjoyment there is to be had by all</li>', 0, '2021-05-29 22:00:00'),
(66, 'Civilization VI', 61, 6.78, 'Civilization VI for PC is a 4X, turn based, empire-building game. 4X stands for eXplore, eXpand, eXploit, eXterminate, and this is a reasonable summary of what the player needs to do in order to take the civilisation from small village to superpower.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nBuild civilisation from tiny village or settlement all the way up to political juggernaut – basically a digital boardgame in which you have to build your empire from scratch into a leader on the world’s stage through trade, deals, battles and much more.<br>\r\n<br>\r\nThe terrain affects your successes, with forest, desert and tundra all having their own advantages and disadvantages to the player, so you will need to adapt your game play to get the best out of the area in which you are playing.<br>\r\n<br>\r\n<h3>New Details</h3><br>\r\nYou can now spread your city around a bit – previously all improvements to a city were stacked into the hex block on which the city was built. <br>\r\n<br>\r\nGives more scope for expansion and gives the player more freedom in the layout of their city<br>\r\n<br>\r\nThe new ‘unstacked’ way allows for cities to be better laid out, and players can earn bonuses for placing appropriate buildings in the right place – for example placing barracks near a training ground is a sensible decision, and is rewarded in the game<br>\r\n<br>\r\nThis is not to say that you can no longer stack items, but it is now somewhat limited and stacking can only happen with similar types of construction<br>\r\n<br>\r\nThe menus are displayed as ‘trees’ and there are trees for many aspects of the game, from Technology to Culture. The latter is new, and allows players to more easily win a game played from a cultural slant – something that was quite tricky in the original incarnation.<br>\r\n<br>\r\n<h3>Ways to Play</h3><br>\r\nThe game rewards players for sensible decisions – building a marina, for example, in the middle of dry land will result in few resources being made available, whereas building it by the water will ensure a steady flow of resources coming your way. There is really only one way to play: you against the game, but here are some tips that will help you if you are just getting started:<br>\r\n<br>\r\n<li>Planning ahead is key</li><br>\r\nAs mentioned above, you will need to consider every move carefully, in every aspect of the game. From where you are going to place a theatre today to leaving enough virgin countryside for a National Park some time far in the future, you have to think about everything!<br>\r\n<br>\r\n<li>Barbarians are smart</li><br>\r\nDo not think that because you caught just one glimpse of a barbarian who then vanished that your city is safe, especially in the early days of construction. Often, they are scouts, assessing whether your city is attackable, and will return before you know it with a horde all set to destroy your careful creation!<br>\r\n<br>\r\n<li>Traders generate roads</li><br>\r\nUse this useful feature to get your infrastructure in place by spreading your traders far and wide. Doing this will ensure that your civilisation benefits from a wide network of roads with very little other effort from you. <br>\r\n<br>\r\n<li>Read the tech and civic trees carefully</li><br>\r\nThese can offer you invaluable advice and can even offer warnings if you learn to read them thoroughly, putting their tips into good practice to build a magnificent civilisation. <br>\r\n<br>\r\n<h3>Endgame</h3><br>\r\nStrategy is the key to succeeding at this game, and you must always be thinking three or four steps ahead of the game at every stage. Filling up the best tiles too soon can leave you short of assets at a later time, so you must plan out your city as carefully as possible, leaving enough space to expand into when necessary.<br>', 0, '2021-05-29 22:00:00'),
(67, 'Mortal Kombat 11', 0, 11.89, 'Mortal Combat 11 for PC is a 2.5D fighting game that marks – as the name implies – an impressive twenty-seven years of Mortal Kombat. This not only gives players gives a lot of and back story (especially new players) but it also means the developers have had plenty of practise at making compelling and immersive fighting games. This experience shows!<br>\r\n<br>\r\n2D is, obviously, flat images having length and breadth. 3D offers depth alongside, whether actual depth, as in real life scenarios, or simulated depth for games and movies. 2.5D is when the illusion of 3D is offered on a 2D platform, or when a game is sometimes 2D with some fully 3D features. This game is the former.<br>\r\n<br>\r\n<h2>About the game</h2><br>\r\nPlayers all start out with the same equipment and form, much of which can then be customised to suit their preferences. The appearance of the avatar has no bearing on the abilities of the character, so a player can bring all their aesthetic tastes to bear without making their avatar weaker or less capable, unlike in some other games.<br>\r\n<br>\r\nThere is a total of twenty-five playable characters, many with fascinating and compelling back stories, which gives every player plenty of choice when it comes to looks, aggression, defence and so on.<br>\r\n<br>\r\n<h3>Time Travelling Fun</h3><br>\r\nThe main feature of this version of the Mortal Kombat timeline is the time travel element. This is ideal for older players who get a nostalgic glimpse into previous games, while newer players get to see old storylines rewind and work out differently. This fascinating features leads to some very different outcomes – and different outcomes than those desired by the players too! <br>\r\n<br>\r\nIn order to earn enough points for upgrades and access to locked areas, players might find that some grinding is necessary. Grinding is repeating tasks or going over old missions in order to gain experience points or other benefits. However, this can be enjoyable, especially repeating easier missions with new powers: old enemies are splattered with joyful ease!<br>\r\n<br>\r\n<h3>Last Resort Death Knell</h3><br>\r\nOne new modification in this game is the introduction of Fatal Blows. These are not available all the time, only being usable once your health level as dropped to dangerous lows. They are a sort of last resort, a final flourish to attempt to get your opponent before he or she finishes you off.<br>\r\n<br>\r\nThe offence and defence metres are now separate, so you can boost your offence to make an attack particularly strong or you can boost defence for cunning roll-escapes or counterattacks without using up too much power. Tutorials will quickly and easily talk you through using these new features, and you’ll be fighting your way to success in no time.<br>\r\n<br>\r\n<h3>Ways to play</h3><br>\r\n<li>Story Mode</li><br>\r\nAs mentioned above, the back story for MK is now a long and complicated saga worthy of publication as a standalone book or movie. Play through the game, until you achieve one of the two official endings – or go off canon and make up your own ending! <br>\r\n<br>\r\n<li>Combat mode</li><br>\r\nBlood splashes everywhere as you just enjoy the sickening but inventive ways to paint the gore around, taking out everyone you see. Explore the open map to find targets or follow the on-screen instructions, just taking your own blood-thirsty time about it! <br>\r\n<br>\r\n<li>Krypt mode</li><br>\r\nThis is more of a sub-game than a mode, and can save you some of the above-mentioned grinding. Plunder the island for treasure and other loot, smashing down walls and opening chests to retrieve gold and other valuables, which can then be used to buy customised skins, weapons and gears, secret entrances and even to modify AI behaviour in your own favour. <br>', 0, '2021-05-29 22:00:00'),
(68, 'Resident Evil 3', 74, 14.99, 'Includes Resident Evil Resistance, a new 1 vs 4 online multiplayer game set in the Resident Evil universe where four survivors face-off against a sinister Mastermind.<br>\r\n<br>\r\nResident Evil 3 for PC is a follow-on from the remake of the previous Resident Evil 2, and a remake of the original 1999 game. <br>\r\n<br>\r\nThis remake looks to be just as popular as the previous one, the developers having chosen exactly the right features when choosing which to improve and which to leave alone. There is even more action than Resident Evil 2, as per customer feedback, although the game developers have not made this game as shiny slick and reminiscent of a Hollywood blockbuster as Resident Evil 6 – which is a good thing.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nAgainst the backdrop of a lethal ‘cannibal virus’ which seems to be transforming citizens into zombies, Jill Valentine and her colleagues in the police are trying to uncover the full extent of the nefarious doings of the evil Umbrella Corp. Carlos Oliveira is also back, the rough-looking mercenary also looking into Umbrella Corp’s actions and motivations for his own reasons. Their semi-uneasy truce adds spice to the game: can she trust him fully or should she hold back a bit? Only playing through will tell! <br>\r\n<br>\r\nThere are more open spaces than the rather restricted confines of Resident Evil 2, and this game gives players decent views of and around Racoon City which is rather lovely, even as it is also rather conflicted. Shops, sewers and subways are all explorable, and sharp-eyed players will spot immovable yellow padlocks in some places. Once Jill has learned one or two rather specific skills, she can return to these areas to see what is hidden behind them<br>\r\n<br>\r\n<h3>New Way to Play</h3><br>\r\nEach purchase of the game comes with a copy of Resident Evil Resistance – which is a new, seemingly unbalanced 1 versus 4 game. There is one Mastermind against four survivors all playing across one limited map. <br>\r\n<br>\r\nThe survivors aim to keep that appellation (i.e., survive!), while the mastermind is more of a distant overlord, placing traps and enemies and not actively engaging with the survivors. The Mastermind needs to play something of a chess game, anticipating the survivors’ movements, while they should behave as though everything is a trap!<br>\r\n<br>\r\n<h3>Amazing Improvements</h3><br>\r\nThe character imagery is vastly improved for both Jill and Carlos. The characters’ clothing and body shapes are slightly less clichéd, and the graphics are immensely improved with the action looking quite like real filmed footage rather than computer rendered action. Jill and Carlos both look very realistic, almost as though they have been photographed rather than drawn.<br>\r\n<br>\r\nThis humanising effect however, doesn’t translate to Nemesis, the arch enemy, although he too has been improved, tweaked and modified! He is bigger and badder than ever, with awe-inspiring bulk and red-hot rage displayed in the tension of his massive shoulders, the clench of huge Thanos-like fists, and his many and sneaky ways to track you down!<br>\r\n<br>\r\n<h3>New Move!</h3><br>\r\n<li>For this game you can now dodge away from a zombie, should it manage to sneak up to you and get closer than is comfortable. </li><br>\r\n<li>If you time your dodge just right it will give you enough time to grab your gun and sort out the zombie, or run away if you are not looking a fight right now! </li><br>\r\n<li>If a zombie does manage to lay its foul hands on you all is not lost – button mashing (pressing all the buttons simultaneously) can sometimes shake them off and give you precious moments to make your escape!</li>', 0, '2021-05-29 22:00:00'),
(69, 'Outlast', 4, 2.99, 'Hell is an experiment you can\'t survive in Outlast, a first-person survival horror game developed by veterans of some of the biggest game franchises in history. As investigative journalist Miles Upshur, explore Mount Massive Asylum and try to survive long enough to discover its terrible secret... if you dare.\r\n<strong><u>Synopsis:</u></strong>\r\nIn the remote mountains of Colorado, horrors wait inside Mount Massive Asylum. A long-abandoned home for the mentally ill, recently re-opened by the “research and charity” branch of the transnational Murkoff Corporation, the asylum has been operating in strict secrecy… until now.\r\nActing on a tip from an anonymous source, independent journalist Miles Upshur breaks into the facility, and what he discovers walks a terrifying line between science and religion, nature and something else entirely. Once inside, his only hope of escape lies with the terrible truth at the heart of Mount Massive.\r\nOutlast is a true survival horror experience which aims to show that the most terrifying monsters of all come from the human mind.\r\n<strong><u>Features:</u></strong>\r\n<ul class=\"bb_ul\"><li>True Survival Horror Experience: You are no fighter - if you want to survive the horrors of the asylum, your only chance is to run... or hide\r\n</li><li>Immersive Graphics: AAA-quality graphics give players a detailed, terrifying world to explore\r\n</li><li>Hide and Sneak: Stealth-based gameplay, with parkour-inspired platforming elements\r\n</li><li>Unpredictable Enemies: Players cannot know when - and from where - one of the asylum’s terrifying inhabitants will finally catch up to them\r\n</li><li>Real Horror: Outlast’s setting and characters are inspired by real asylums and cases of criminal insanity</li></ul>\r\n<strong><u>Warning:</u></strong>\r\nOutlast contains intense violence, gore, graphic sexual content, and strong language. Please enjoy.', 0, '2021-05-29 22:00:00'),
(70, 'Doom', 21, 4.89, 'Doom for PC is the fourth game in a series and a return to the origins, being a reboot of the highly acclaimed game that is something of the great-great grandpa of modern gaming – the first edition was released on MS-DOS in 1993, shortly after personal computing became widely normalised. There would have been no double click to access the game: instead, commands would have to be typed into DOS to start play, that’s how long ago that was!<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nThe player takes on the persona of an unnamed Marine (called, variously: Doomguy, or Marine, or even Doom Slayer) who is tasked with battling the inhabitants of Hell who have been unleashed upon a freshly colonised Mars by the evil antagonist, employee of Union Aerospace Corporation, one Olivia Pierce who has been promised wonderful things by Satan.<br>\r\n<br>\r\nFellow corporation employee, Samuel Hayden wants to stop her – but first he has to uncover her secrets, and for that he needs the Doom Slayer who swings into action, despatching demon after demon as he gets on the case.<br>\r\n<br>\r\nLevels follow fairly predictable patterns: beginning with Samuel giving Doom Slayer his orders, and ending with a massive ‘boss battle’-type scene but this adds a reassuring structure to an otherwise zany game in which anything can (and sometimes does) happen.<br>\r\n<br>\r\n<h3>Best of the Old/ Best of the New</h3><br>\r\nThe game has received enormous praise for recapturing the beloved atmosphere of shooter games from the 90s, while combining it with modern graphics and physics engines to satisfy our ever more critical computing tastes: the painfully slow dial-up connections of the 90s would certainly not appeal to today’s gamers!<br>\r\n<br>\r\nMany of the weapons, too, have been lifted from the original game for a nostalgic blast, but these too have been upgraded and given new and nasty twists that probably would not have been thought of in the pre-Internet (well, it was there, it just wasn’t all that widely used) days of the 90s. Weapons can be improved and upgraded, so more experienced players have better skills and more powerful weapons: a kind of exponential benefit of playing.<br>\r\n<br>\r\nIn each level, you will find access to one of the old-school game maps that are hidden until you stumble across them. Once found, they fit themselves into the map menu under the title of ‘classic maps’.<br>\r\n<br>\r\n<h3>Ways to Play</h3><br>\r\n<li>Single player: ‘badass demons, big * guns and moving fast’ is the advice given by the game developers when talking about this mode. Doom Slayer is agile, speedy and facing opponents who are also fast and cunning. He can keep the edge, but only by staying sharp and not letting them overwhelm him or sneak up on him all unawares. There are thirteen maps to play through, but watch out for Ultra Nightmare mode which can lose your save point!</li><br>\r\n<li>Multiplayer: this mode opens up the Doom world to the player with a huge variety of ways to play against other gamers. Deathmatches, freeze tag, King of the Hill and even a Battle Royale style fight to the death are all amongst the offerings in this mode. Winning – even just playing sometimes – awards experience points, these add up to accessing new levels, which unlocks new skins, weapons and other customisation features</li><br>\r\n<li>Level Creation Tool: this mode is called ‘SnapMap’ and it allows players to create, edit and shape levels according to their own preferences and logic. While building the level, the game offers an aerial view, and any missed connections will show up in a different colour, so the connections can be installed. Levels can be test played before they are published</li>', 0, '2021-05-29 22:00:00');
INSERT INTO `product` (`id`, `name`, `available_stock`, `price`, `desc`, `featured`, `created_at`) VALUES
(71, 'Stellaris', 1, 3.39, 'Stellaris for PC is a 4X real-time strategy game: 4X meaning explore, expand, exploit, and exterminate which refers to the actions taken by the characters in order to achieve the aims of the game, whether they are gathering valuable resources, claiming new territories, or simply kicking enemy butt.<br>\r\n<br>\r\n<h2>About the Game</h2><br>\r\nThere are eight species from which the player can choose, and the strategic thinking should be applied right from the start. Some species are better with some pathways than others: for example, warlike races are unlikely to make good spiritual pacifists just as ethereal beings are unlikely to be able to swing a hefty weapon with any great authority! See more about the races below.<br>\r\n<br>\r\nThe player joins their species of choice very shortly after the invention of faster-than-light (FTL) travel has dramatically expanded their options. You can choose to be a peaceful explorer, sharing resources and information as you go, or you can be completely blood-thirsty, besting every other being you come across.<br>\r\n<br>\r\nWhichever way you choose to play, there are pathways to be followed: from building military might to learning farming skills, to playing politics in order to get what you need. For example, you can land on a new planet and take their resources by force, or you can form an alliance or bartering system to get hold of those resources peacefully.<br>\r\n<br>\r\nAmongst the pathways to be followed and expanded there is science, construction and vehicle building, all of which can help you no matter how militant or pacifist you have decided to be.<br>\r\n<br>\r\n<h3>Technology is Available: For Some!</h3><br>\r\nAI and robotic technology is available, but if you are a pacifist and spiritual species you will not be able to enjoy these. Instead, landing on any planet that already has this technology will see it being dismantled or decommissioned in favour of raising temples and other spiritually relevant buildings. <br>\r\n<br>\r\nPolitics comes into play too: authoritarian regimes will not permit democratic elections to be held, while materialistic races cannot bar the creation and sale of robots. As mentioned above, this means that you must make good choices early on in the game in order to enjoy the facets of worldbuilding that you enjoy the most in your game.<br>\r\n<br>\r\n<h3>A Rundown of Races</h3><br>\r\n<li>Arthropoid (insectile): the thought of playing as a sort of giant insect might be unappealing until you think about some of the positives: the endless indestructibility of cockroaches, the beauty (and wings) of butterflies, and even the tank-like structure of a beetle</li><br>\r\n<li>Avian (birdlike): these delicate looking beings pack more punch than you’d think at first glance. And anyway, who doesn’t want to play as a massive penguin or super-powerful platypus? </li><br>\r\n<li>Fungoid : mushrooms are fun guys. That’s it. That’s all that needs to be said here</li><br>\r\n<li>Humanoid: within the umbrella of humanoid, you can find a wealth of different features, strengths and powers, linked solely by the basic design of two arm, two legs, and a head, all attached to a torso in more or less the same recognisable order. Pick your favourite from the variations on offer, and then train them up your own way</li><br>\r\n<li>Mammalian: play as any of your favourite animals: or even mix and match characteristics from different creatures until you achieve your perfect designer beast</li><br>\r\n<li>Molluscoid (invertebrate): these fascinating creatures will allow you to squeeze into small spaces, hide from enemy eyes and enjoy a whole raft of tricksy traits as you explore the furthest reaches of the galaxy</li> <br>\r\n<li>Reptilian: force aliens to bow down to your crocodilish overlord, recreate the dinosaurs or simply enjoy basking with the might offered by these war-like races</li><br>\r\n<li>Plantoid (this last was added as DLC after the initial release): want to take things slow and chilled? Maybe enjoy some zen meditation? Then a plantoid (meaning of or like plants) is the race you want to be</li>', 0, '2021-05-29 22:00:00');
